INSERT INTO `tager_mail_logs` VALUES (12, 3, 'dev@furylion.net', 'FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Александр</p><p><strong>Phone:</strong> +375336767733</p><p><strong>E-Mail</strong> alexander@valkovich.com</p><p><strong>Message</strong> Мое письмо</p>', 'SUCCESS', NULL, '2021-06-11 16:14:15', '2021-06-11 16:14:18', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/5h\\/in\\/5Hing7ltNL.pdf\",\"as\":\"CV_Max_Sirosh_producer_game_designer.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/5h\\/in\\/5Hing7ltNL.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (13, 3, 'info@furylion.net', 'FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Игнат Булаш</p><p><strong>Phone:</strong> +375296348945</p><p><strong>E-Mail</strong> ignatbigcat@gmail.com</p><p><strong>Message</strong> Добрый день, меня зовут Игнат. Я недавно окончил курс \"Геймдизайн\" школы Polygon.by и очень хочу стать частью вашей команды и полезным человеком выполняющим цели и задачи. Легкообучаем и коммуникабелен, хорошо работаю в команде. Буду рад получить обратную связь.</p>', 'SUCCESS', NULL, '2021-06-12 12:22:44', '2021-06-12 12:22:46', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/tw\\/es\\/tWEsrv9X4g.pdf\",\"as\":\"\\u0411\\u0443\\u043b\\u0430\\u0448 \\u0418\\u0433\\u043d\\u0430\\u0442.\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/tw\\/es\\/tWEsrv9X4g.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (14, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Vadim</p><p><strong>Company:</strong> Dreamers</p><p><strong>E-Mail</strong> vadim.rou@mail.ru</p><p><strong>Message</strong> Good day! My name is Vadim and I live in St. Petersburg. I really want to know if there is an opportunity to take an internship with you. I\'m a video game developer, but I work in a small team. I am a 2nd year student at a university and would like to have an incredible experience working with you. Sincerely, Vadim.</p>', 'SUCCESS', NULL, '2021-06-12 15:25:57', '2021-06-12 15:25:59', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (15, 3, 'info@furylion.net', 'FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Павел</p><p><strong>Phone:</strong> 80447883992</p><p><strong>E-Mail</strong> Rmnk.pvl@gmail.com</p><p><strong>Message</strong> Добрый день добрые люди!\n\nЗаинтересован, мотивирован, настроен закрыть вакансию 2D Artist на младшей позиции в компании.\nУверен смогу поддержать качество графического контента на должном уровне.\n\nОцените пожалуйста мои навыки по некоторым работам на https://www.behance.net/rmnkpvlee21 .\n\n\nСпасибо за уделенное время!</p>', 'SUCCESS', NULL, '2021-06-14 11:06:17', '2021-06-14 11:06:19', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/2a\\/zs\\/2AZSqVuQWI.docx\",\"as\":\"\\u041f\\u0430\\u0432\\u0435\\u043b \\u0420\\u043e\\u043c\\u0430\\u043d\\u044e\\u043a_2d Artist.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/2a\\/zs\\/2AZSqVuQWI.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (16, 3, 'info@furylion.net', 'FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Вадим</p><p><strong>Phone:</strong> 89106066325</p><p><strong>E-Mail</strong> kosacevvadim@gmail.com</p><p><strong>Message</strong> Добрый день. Сейчас нахожусь в поиске работы на вакансию \"Инженер по тестированию\".\n\nЯ прошёл курсы «Инженер по тестированию» онлайн-школы «Яндекс.Практикум», где изучил теорию и выполнил много практических задач. Работа была разделена на двухнедельные спринты, что помогало правильно распределить свои время и ресурсы. После курсов у меня есть огромный запал применить знания и умения в коммерческой сфере.\n\nЯ крайне ответственно подхожу к любой деятельности и уверен, что смогу выполнять поставленные задачи. Так как это моя первая работа в тестировании, первоочередная задача для меня — научиться тестировать хорошо, я готов полностью посвятить себя этому и с головой погрузиться в работу.\n\nБуду рад с вами пообщаться и узнать больше о проекте!</p>', 'SUCCESS', NULL, '2021-06-14 13:02:14', '2021-06-14 13:02:16', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/i6\\/5h\\/I65Huno2r0.pdf\",\"as\":\"QA \\u041a\\u043e\\u0441\\u0430\\u0447\\u0451\\u0432 \\u0412\\u0430\\u0434\\u0438\\u043c.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/i6\\/5h\\/I65Huno2r0.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (17, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Максим Стулёв</p><p><strong>Company:</strong> https://www.artstation.com/stulev</p><p><strong>E-Mail</strong> stulevmaksim22@gmail.com</p><p><strong>Message</strong> Здравствуйте! Я 3d Character artist, буду рад быть часть вашей команды</p>', 'SUCCESS', NULL, '2021-06-14 14:29:22', '2021-06-14 14:29:24', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/gw\\/fz\\/GWfZOWusGy.pdf\",\"as\":\"CV \\u041c\\u0430\\u043a\\u0441\\u0438\\u043c \\u0421\\u0442\\u0443\\u043b\\u0451\\u0432 #1.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/gw\\/fz\\/GWfZOWusGy.pdf\"}]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (18, 3, 'info@furylion.net', 'FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Алина</p><p><strong>Phone:</strong> 8029312523</p><p><strong>E-Mail</strong> lina.kunevich@gmail.com</p><p><strong>Message</strong> Здравствуйте!\nЗаинтересовала ваша компания. Высылаю свое резюме, и если вы находитесь в поиске менеджера проектов, очень буду рада пообщаться:)</p>', 'SUCCESS', NULL, '2021-06-14 20:29:37', '2021-06-14 20:29:40', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/ui\\/pe\\/uIpetkcRFi.pdf\",\"as\":\"CV_\\u0410\\u043b\\u0438\\u043d\\u0430 \\u041a\\u0443\\u043d\\u0435\\u0432\\u0438\\u0447.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/ui\\/pe\\/uIpetkcRFi.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (19, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Krzysztof</p><p><strong>Company:</strong> Krzysztof Słabicki</p><p><strong>E-Mail</strong> contact@krzysztofslabicki.com</p><p><strong>Message</strong> Dear developers,\n\nI write electronic music. I would like to offer my composing services.\nPlease visit my website \nwww.krzysztofslabicki.com\nIf interested, please contact me at: \ncontact@krzysztofslabicki.com</p>', 'SUCCESS', NULL, '2021-06-15 08:02:18', '2021-06-15 08:02:20', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (20, 3, 'info@furylion.net', 'FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Мария</p><p><strong>Phone:</strong> 89995367479</p><p><strong>E-Mail</strong> meduzzus@gmail.com</p><p><strong>Message</strong> Добрый день!\n\nХочу стать частью вашей команды, на позиции ГД-джуна (СПб).\n\nХочу стать частью вашей крутой команды, чтобы тоже развиваться и стать крутым сеньором.\n\nНа данный момент я учуcь на двух курсах по геймдизайну, у XYZ и California Institute of Arts. У меня нет опыта в игровой индустрии, но у меня есть огромный интерес в этой сфере и амбиции. Я люблю и очень хорошо учусь новому, без проблем освою необходимые навыки. Хорошо умею анализировать, а так же креативить. Ответствнная и инициативная. У меня есть несколько соло-инди проектов в разработке.\n\nМоё резюме в прикреплённом файле.\n\nСпасибо, за уделённое время,\n\nМария</p>', 'SUCCESS', NULL, '2021-06-15 09:30:33', '2021-06-15 09:30:35', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/0x\\/m9\\/0xM9gwO32X.pdf\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435_\\u041c\\u0430\\u0440\\u0438\\u044f_\\u041f\\u0430\\u043f\\u043e\\u044f\\u043d_\\u0413\\u0414.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/0x\\/m9\\/0xM9gwO32X.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (21, 3, 'info@furylion.net', 'FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Сергей Чепиков</p><p><strong>Phone:</strong> +375445370942</p><p><strong>E-Mail</strong> oo4epaoo@gmail.com</p><p><strong>Message</strong> Почему я хочу работать 3D художником?\n\nПотому, что это интересная и увлекательная работа. Потому, что 3D художники, это невероятные люди, которыми действительно можно гордиться. Потому, что компьютерные игры, компьютерная графика, могут создавать только уникальные и интересные люди, с огромным запасом знаний и идей. Я хочу познакомиться с этими людьми, работать с ними и учиться у них. Я хочу работать 3D художником, чтобы увидеть, как куётся этот растущий графический гигант, чтобы приложить свою руку к этому, чтобы быть частью этого. Пафосно? Да, наверное. Но я считаю, что всегда есть место здоровому пафосу, когда речь идёт о мечтах и свершениях :)\n\nЧто я могу предложить?\n\nПунктуальность и тактичность. Работоспособность и стрессоустойчивость. Большой и разносторонний опыт работы с людьми и для людей. Огромное желание профессионально развиваться в сфере геймдева и принимать максимум участия в развитии всевозможных захватывающих проектов.\n\nБуду очень рад с вами работать! :)\n\nСсылка на портфолио: https://www.artstation.com/oo4epaoo\n\n\nСпасибо за внимание.</p>', 'SUCCESS', NULL, '2021-06-15 12:40:58', '2021-06-15 12:41:00', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/kf\\/zt\\/kFzt4YZ9PD.pdf\",\"as\":\"CV_Chepikov.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/kf\\/zt\\/kFzt4YZ9PD.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (22, 3, 'jobs@furylion.net', 'FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Черкай Кирилл</p><p><strong>Phone:</strong> 79234432208</p><p><strong>E-Mail</strong> Nacherkai@gmail.com</p><p><strong>Message</strong> Меня зовут Кирилл Черкай.\nАртстанция - https://www.artstation.com/nacherkai\nPDF-портфолио - https://yadi.sk/i/HW9mMDDiwIyo0A\n\nУже более двух лет я профессионально занимаюсь рисованием комиксов, где приобрёл столь необходимые на игровых проектах навыки визуального повествования через дизайн персонажей, локаций, формы и цвета. Своё профессиональное развитие хотел бы продолжить в команде горящих желанием делать круто художников и дизайнеров, у которых есть чему поучиться.\n\n\nВ издательстве «Терлецки комикс» я рисую одну из двух флагманских серий – «Причудливые Авантюры Жожо». В данном проекте я вношу свой вклад на каждом этапе – от обсуждения идей и сценария, до оформления промо-материалов. Первый том серии разошелся уже четырьмя тиражами и не единожды попадал в топ продаж профильных магазинов комиксов.\n(https://vk.com/market-101952234?section=album_2)\n\n\nВместе с агентством «Параллель», я участвовал в следующих коммерческих проектах:\n\n«В поисках Playstation», где по готовому сценарию визуализировал одну из двух историй. (https://sp.esquire.ru/playstation/booktwo)\n\n«Ситимобил. Вас везёт герой», где по готовому сценарию делал раскадровки и лайнарт двух историй.\n\n(https://superhero.city-mobil.ru)\n\n«GlamGoGang. В поисках идеальной причёски», на котором занимался дизайном персонажей.\n\n\nВ свободное от работы время расширяю квалификацию, проходя курсы (Курс по концепт-арту от Дмитрия Клюшкина на базе онлайн-школы XYZ) или самостоятельно изучая софт (Успел на базовом уровне освоить 3Ds max и Adobe animate).\n\n\nБыл бы рад весь имеющийся опыт применить в разработке визуально-нарративной части игрового проекта.</p>', 'SUCCESS', NULL, '2021-06-15 15:18:59', '2021-06-15 15:19:02', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/te\\/os\\/teOsmD9w2j.pdf\",\"as\":\"2D illustrator Cherkai Kirill Artworks.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/te\\/os\\/teOsmD9w2j.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (23, 3, 'jobs@furylion.net', 'FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Нестюк Александр</p><p><strong>Phone:</strong> 89109983891</p><p><strong>E-Mail</strong> aleksandrrr009@gmail.com</p><p><strong>Message</strong> Добрый день, увидел у вас вакансию junior 3d artist, очень хотел бы попробовать попасть на эту должность, на ваших условиях.\nСсылка на мое портфолио https://www.artstation.com/alexandrrr008\nСсылка на резюме https://yadi.sk/i/GD_GQLaPrJm4aQ</p>', 'SUCCESS', NULL, '2021-06-16 10:37:12', '2021-06-16 10:37:14', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/0b\\/dr\\/0Bdr7N5Yya.jpg\",\"as\":\"20210606_212135.jpg\",\"mime\":\"image\\/jpeg\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/0b\\/dr\\/0Bdr7N5Yya.jpg\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (24, 3, 'jobs@furylion.net', 'FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Александр</p><p><strong>Phone:</strong> 89109983891</p><p><strong>E-Mail</strong> Aleksandrrr009@gmail.com</p><p><strong>Message</strong> https://www.artstation.com/alexandrrr008\nОчень большое желание попасть в геймдев, готов пройти тестовые задания и обучения. Также я на данный момент изучаю курсы по 3D в skillbox. Я успешно изучил и прошел модули Maya, zbrush, photoshop. Могу отметить, что освоил процедуру создания геймреди модели. Готов учиться и развиваться в этой сфере.</p>', 'SUCCESS', NULL, '2021-06-16 15:35:48', '2021-06-16 15:35:51', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/kp\\/pr\\/KPpr3oWAhM.docx\",\"as\":\"\\u041d\\u0435\\u0441\\u0442\\u044e\\u043a \\u0410\\u043b\\u0435\\u043a\\u0441\\u0430\\u043d\\u0434\\u0440.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/kp\\/pr\\/KPpr3oWAhM.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (25, 3, 'jobs@furylion.net', 'FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Michael Halchenko</p><p><strong>Phone:</strong> +380665953001</p><p><strong>E-Mail</strong> michaelgalchenko@gmail.com</p><p><strong>Message</strong> With over two years of experience combined with ample field knowledge, I am confident that I am an excellent candidate for the position of 3D artist at your studio. Moreover, I am confident that if the opportunity presented itself, I would be a valuable addition not only to your team, but to the entire organization.\n\nMy name is Mikhail Halchenko and I am a detail and precision oriented person. Moreover, for six months I worked as a freelancer, and this tremendous experience allowed me to acquire excellent communication skills and an important ability to meet deadlines.\n\nFurther, I am a Maya Certified 3D Artist, this is the result of my fruitful efforts in the 3D modeling course \"3DMAYA\". Offering experience with all the software you need to work with, including Maya, Zbrush, Marmoset, Substance Painter, Photoshop and Unreal Engine 4. Having worked as a 3D artist at \"morphy.vision\" for over 2 months, I was mainly responsible for hard surface modeling objects for characters (Low poly / High poly), UV, baking and texturing ensuring that all assigned projects are completed on time.\n\nLast but not least, do not hesitate to contact me if you have any questions about my career. If in doubt about my portfolio, I ask you to send me a test assignment to prove my skills. You can contact me by phone +380665953001 (Viber / Telegram are also available) or by email michael.galchenko@gmail.com Thank you for reviewing my application.</p>', 'SUCCESS', NULL, '2021-06-17 17:34:30', '2021-06-17 17:34:32', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/r5\\/7c\\/R57CI8irXh.pdf\",\"as\":\"Mykhailo_Halchenko_Resume.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/r5\\/7c\\/R57CI8irXh.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (26, 3, 'jobs@furylion.net', 'FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Маргарита Салимгараева</p><p><strong>Phone:</strong> +79870358441</p><p><strong>E-Mail</strong> salimgaraevamargo@yandex.ru</p><p><strong>Message</strong> 3D аниматор</p>', 'SUCCESS', NULL, '2021-06-17 19:00:21', '2021-06-17 19:00:23', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/r6\\/kk\\/R6KKtIu6qG.pdf\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/r6\\/kk\\/R6KKtIu6qG.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (27, 3, 'jobs@furylion.net', 'FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Рамиль Абдулхаевич Рахматуллин</p><p><strong>Phone:</strong> 89811416162</p><p><strong>E-Mail</strong> kinooomegas@mail.ru</p><p><strong>Message</strong> Добрый день. Начал заниматься моделированием пол года назад, прошел курс Робо-Механизма в Blender и Substance painter: от создания и оптимизации полигональной сетки модели для повышения производительности игровых движков до запекания всех основных карт текстур и финальных презентационных рендеров, согласно всем требованиям профессиональной гейм-индустрии. После чего уже сделал самостоятельно пару работ, две из которых выложил по ссылке в резюме. На данный момент изучаю риггинг/анимацию. Хочу попасть в вашу компанию, что бы продолжить развиваться в этой сфере и меня всегда привлекала доп. реальность, ведь за этим будущее. Я хочу стать частью вашей команды, т.к. ищу людей с общими интересами, которые готовы поделиться опытом.</p>', 'SUCCESS', NULL, '2021-06-18 13:10:19', '2021-06-18 13:10:20', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/hs\\/e5\\/Hse5bEb1GK.docx\",\"as\":\"\\u0440\\u0435\\u0437\\u044e\\u043c\\u0435 1.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/hs\\/e5\\/Hse5bEb1GK.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (28, 3, 'jobs@furylion.net', 'FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Олег</p><p><strong>Phone:</strong> +79103708338</p><p><strong>E-Mail</strong> olpoegin@gmail.com</p><p><strong>Message</strong> Добрый день, меня зовут Олег. Я по поводу вакансии junior 3d. Прикрепляю ссылку на первую game ready модель по курсу скилбокс. https://www.instagram.com/p/CPZDok0BEP5/?utm_medium=copy_link</p>', 'SUCCESS', NULL, '2021-06-20 18:56:49', '2021-06-20 18:56:51', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/qz\\/hn\\/QzhNLhi7xT.jpg\",\"as\":\"IMG-20210527-WA0047.jpg\",\"mime\":\"image\\/jpeg\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/qz\\/hn\\/QzhNLhi7xT.jpg\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
