INSERT INTO `tager_mail_logs` VALUES (32, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Сергей</p><p><strong>Phone:</strong> +375445370942</p><p><strong>E-Mail:</strong> oo4epaoo@gmail.com</p><p><strong>Message:</strong> Почему я хочу работать 3D художником?\n\nПотому, что это интересная и увлекательная работа. Потому, что 3D художники, это невероятные люди, которыми действительно можно гордиться. Потому, что компьютерные игры, компьютерная графика, могут создавать только уникальные и интересные люди, с огромным запасом знаний и идей. Я хочу познакомиться с этими людьми, работать с ними и учиться у них. Я хочу работать 3D художником, чтобы увидеть, как куётся этот растущий графический гигант, чтобы приложить свою руку к этому, чтобы быть частью этого. Пафосно? Да, наверное. Но я считаю, что всегда есть место здоровому пафосу, когда речь идёт о мечтах и свершениях :)\n\nЧто я могу предложить?\n\nПунктуальность и тактичность. Работоспособность и стрессоустойчивость. Большой и разносторонний опыт работы с людьми и для людей. Огромное желание профессионально развиваться в сфере геймдева и принимать максимум участия в развитии всевозможных захватывающих проектов.\n\nБуду очень рад с вами работать.\n\nСсылка на портфолио: https://www.artstation.com/oo4epaoo\n\nСпасибо за внимание.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-06-21 14:06:47', '2021-06-21 14:06:49', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/qs\\/vv\\/QSVVcSRBjN.pdf\",\"as\":\"CV_Chepikov.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/qs\\/vv\\/QSVVcSRBjN.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (33, 3, 'jobs@furylion.net', 'Intern Developer - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Михаил</p><p><strong>Phone:</strong> +375336693392</p><p><strong>E-Mail:</strong> kuzmitch.mikh@yandex.by</p><p><strong>Message:</strong> Я студент ПГУ, 3 курс. Обучаюсь на факультете компьютерных наук и электроники. \nИзучал такие языки, как Java, C, C++ и в данный момент углубляюсь в язык C#. Так же имел опыт в работе с Blender и риггином персонажа в Unity.\nНа прошлом месте работы сталкивался с необходимостью разбираться в чужом коде и модифицировать его.</p><p><strong>Vacancy:</strong> Intern Developer</p>', 'SUCCESS', NULL, '2021-06-21 20:22:38', '2021-06-21 20:22:42', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/ff\\/a8\\/FFa8jB3RJr.pdf\",\"as\":\"KuzmichMichaelCV.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/ff\\/a8\\/FFa8jB3RJr.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
