INSERT INTO `tager_mail_logs` VALUES (36, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Сергей</p><p><strong>Phone:</strong> +79643024142</p><p><strong>E-Mail:</strong> sergey.kobelew@yandex.ru</p><p><strong>Message:</strong> Здравствуйте! Меня зовут Кобелев Сергей, меня заинтересовала ваша вакансия junior 3d artist(фентези оружие), я бы хотел пройти стажировку в вашей студии и попасть в команду FuryLion и получить возможность поработать над реальным проектом. Я могу быстро учиться и всегда готов узнавать новое, а еще я обожаю оружие и все что с ним связано, поэтому ваша стажировка хорошо мне подходит и я бы очень был рад поучаствовать в ней.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-06-24 17:42:04', '2021-06-24 17:42:06', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/ro\\/p9\\/rop9nZUJrG.pdf\",\"as\":\"\\u0421\\u0435\\u0440\\u0433\\u0435\\u0439\\u041a\\u043e\\u0431\\u0435\\u043b\\u0435\\u0432Junior3d_\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/ro\\/p9\\/rop9nZUJrG.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (37, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Залялиев Руслан</p><p><strong>Phone:</strong> 89251212418</p><p><strong>E-Mail:</strong> zalyalievrus@gmail.com</p><p><strong>Message:</strong> Здравствуйте! Меня зовут Руслан, и я обожаю видеоигры.\n\nА с некоторых пор стал любить их ещё больше, потому что теперь я работаю над их созданием. Мне бы очень хотелось иметь возможность работать и учиться под началом художников из вашей студии.\nЯ всегда готов к выполнению тестового задания, поэтому в случае данной необходимости, буду рад поработать над ним!\n\nНадеюсь, что данное письмо Вам пришло. Благодарю за скорый ответ!</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-06-25 18:50:45', '2021-06-25 18:50:48', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/n6\\/5c\\/N65cV4t5yO.pdf\",\"as\":\"\\u0417\\u0430\\u043b\\u044f\\u043b\\u0438\\u0435\\u0432 \\u0420\\u0443\\u0441\\u043b\\u0430\\u043d_3D \\u0445\\u0443\\u0434\\u043e\\u0436\\u043d\\u0438\\u043a.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/n6\\/5c\\/N65cV4t5yO.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
