INSERT INTO `tager_mail_logs` VALUES (46, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Денис</p><p><b>Phone:</b> 89293365723</p><p><b>E-Mail:</b> man.fire@list.ru</p><p><b>Message:</b> Добрый день, я хотел бы узнать имеются ли у вас вакансии по типу — комьюнити менеджер, тестировщик игры или специалист тех поддержки? :)\nОпыт ведения групп в соц сетях, так же запуск таргетированной рекламы. Большой опыт игры в компьютерных и мобильных игр например world of tanks более 30000 боёв. Знание методик и техник продаж. И опыт создание нового контента в играх по типу кликеров. Официальный статус тестера в дискорде в 2х кастомных играх в дота2. Большой опыт ММОРПГ.</p>', 'SUCCESS', NULL, '2021-06-30 12:01:58', '2021-06-30 12:02:00', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/qp\\/ix\\/QPIxzYo7L1.pdf\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/qp\\/ix\\/QPIxzYo7L1.pdf\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (47, 3, 'jobs@furylion.net', '2D \\ 3D - Animator - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Ковалевский Михаил</p><p><strong>Phone:</strong> 89818423530</p><p><strong>E-Mail:</strong> mikekovalevskiy@mail.ru</p><p><strong>Message:</strong> Добрый день! Заинтересовала ваша вакансия! Я развиваюсь в 2D-анимации и давно слежу за различными игровыми компания. Очень хотелось бы работать именно в сфере игр. У меня есть большое желание развиваться и в 3D анимации, но возможности моего компьютера, к сожалению, так не думают. Было бы очень интересно пообщаться!\nШоурил: https://www.youtube.com/watch?v=OUVgm6a7Ai8\nBehance: https://www.behance.net/mikekovalevskiy</p><p><strong>Vacancy:</strong> 2D \\ 3D - Animator</p>', 'SUCCESS', NULL, '2021-06-30 19:20:39', '2021-06-30 19:20:43', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/xa\\/ko\\/XAKOnxiQkt.docx\",\"as\":\"\\u041a\\u043e\\u0432\\u0430\\u043b\\u0435\\u0432\\u0441\\u043a\\u0438\\u0439 \\u041c.\\u0421 \\u0440\\u0435\\u0437\\u044e\\u043c\\u0435.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/xa\\/ko\\/XAKOnxiQkt.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
