INSERT INTO `tager_mail_logs` VALUES (49, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Владимир</p><p><strong>Phone:</strong> +79951910899</p><p><strong>E-Mail:</strong> arsfan4@mail.ru</p><p><strong>Message:</strong> Здравствуйте!\nМеня зовут Савченко Владимир, я экономист по образованию, но имею большое желание сменить деятельность и развиваться в сфере 3D.\n Последние несколько лет занимался самообразованием и созданием 2D/3D артов (см. портфолио). Начинал с арт обработки фотографий. В этом году прошел курс STYL от XYZ по созданию стилизованных персонажей. \nЯ стремлюсь делать персонажей, но прекрасно понимаю свой уровень, поэтому готов взяться за любую должность связанную с 3D. Буду рад ответить на все интересующие Вас вопросы. Заранее благодарю за внимание и уделенное мне время.\n\n\nС уважением,\nСавченко Владимир\n+7 (995) 191 08 99\narsfan4@mail.ru\nПортфолио:  https://www.artstation.com/maxdan_sv</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-02 07:29:37', '2021-07-02 07:29:42', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/44\\/ow\\/44OWhJqRxV.pdf\",\"as\":\"\\u0420\\u0415\\u0417\\u042e\\u041c\\u0415.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/44\\/ow\\/44OWhJqRxV.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (50, 3, 'jobs@furylion.net', 'Unity Developer - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Станислав</p><p><strong>Phone:</strong> +375297616783</p><p><strong>E-Mail:</strong> shepelevich.stanislav@yandex.by</p><p><strong>Message:</strong> Здраствуйте. Заинтересован в возможности попасть к вам в качестве Unity Developer-а.</p><p><strong>Vacancy:</strong> Unity Developer</p>', 'SUCCESS', NULL, '2021-07-02 14:16:57', '2021-07-02 14:16:59', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/d0\\/mb\\/D0mbylUfW2.docx\",\"as\":\"Rezyume.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/d0\\/mb\\/D0mbylUfW2.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (51, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Денис Островских</p><p><strong>Phone:</strong> +79818834301</p><p><strong>E-Mail:</strong> denisostrovskih@gmail.com</p><p><strong>Message:</strong> Здравствуйте! Я начинающий 3d-artist (моделлер) с небольшим опытом, но огромным желанием попробовать себя в гейм-индустрии) Есть знание 3d пакетов, понимание полной цепочки пайплайна, небольшое знание сопутствующих программ ( uv layout, substance painter,marmoset toolbag), коммуникабельность, усидчивость и большое желание развиваться) Возможно я Вас заинтересую на позицию junior)\nP.S. ссылка на небольшое портфолио из двух \"сырых\" некоммерческих проектов присутствует в резюме</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-03 14:39:22', '2021-07-03 14:39:25', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/kk\\/uw\\/KkUWXfWegb.txt\",\"as\":\"Ostrovskih Denis.txt\",\"mime\":\"text\\/plain\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/kk\\/uw\\/KkUWXfWegb.txt\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (52, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Родион</p><p><strong>Phone:</strong> 89312106980</p><p><strong>E-Mail:</strong> rodionpero@gmail.com</p><p><strong>Message:</strong> Ищу свою первую работу в игровой индустрии! Очень хочу прикоснуться к процессу создания новых, захватывающих миров! Всегда ищу способы развить свои навыки! Совсем нет вредных привычек. Люблю видеоигры, возможно чрезмерно :)</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-04 18:54:52', '2021-07-04 18:54:55', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/hi\\/8x\\/hI8xai4XeG.docx\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/hi\\/8x\\/hI8xai4XeG.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (53, 3, 'jobs@furylion.net', '2D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Роман</p><p><strong>Phone:</strong> +375447399381</p><p><strong>E-Mail:</strong> d3dflipper@gmail.com</p><p><strong>Message:</strong> Здравствуйте! Прошу рассмотреть мою кандидатуру на позицию 2D Artist.\nhttps://www.artstation.com/d3dflipper\nТакже прикрепляю СV с детальной информацией.</p><p><strong>Vacancy:</strong> 2D Artist</p>', 'SUCCESS', NULL, '2021-07-05 07:14:27', '2021-07-05 07:14:30', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/th\\/vf\\/thvfodQrld.pdf\",\"as\":\"CV_2dartist_Roman_Tarasevich.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/th\\/vf\\/thvfodQrld.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (54, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Михаил Афанасьев</p><p><strong>Phone:</strong> 89082241504</p><p><strong>E-Mail:</strong> m.afanasev-viz@yandex.ru</p><p><strong>Message:</strong> Здравствуйте!\n\nМеня очень заинтересовала ваша вакансия и я хочу попробовать свои силы.\n\nУверен мы друг друга не разочаруем.\n\nУже 4 года работаю удалённо, поэтому умею планировать рабочий день и ставить задачи не срывая сроков.\n\nЕсть опыт работы 4 года в архитектурной визуализации и моделинге. С прошлого года начал изучать геймдейв.\n\nС детства играю в игры и мечтал попасть в эту индустрию, развита насмотренность и целеустремлённость.\n\nВ портфолио работ по геймдейву не так много, но я ГОТОВ ВЫПОЛНИТЬ тестовое задание от вас чтобы показать мой скилл.\n\nУ меня художественное и инженерное образование, что даёт огромное преимущество в работе. \n\nВсегда довожу все до конца, постоянно обучаюсь и развиваюсь в работе и я хочу работать в вашей компании.\n\nСсылки на мое портфолио:\n\nhttps://www.behance.net/Afanasev-VIZ\nАрхитектурная визуализация \n\nhttps://www.artstation.com/mafanasev-viz\nGame dev\n\nМой Инстаграм и отзывы от моих клиентов \n\nhttps://instagram.com/afanasev_viz\n\nЖду от вас обратной связи.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-05 09:49:21', '2021-07-05 09:49:25', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/o8\\/ct\\/O8ctyTj6g8.png\",\"as\":\"C88B7E6E-0055-4348-BF8F-7D277EEA35B7.png\",\"mime\":\"image\\/png\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/o8\\/ct\\/O8ctyTj6g8.png\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (55, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Александр Беляев</p><p><strong>Phone:</strong> +79967793046</p><p><strong>E-Mail:</strong> belyaev.200515@gmail.com</p><p><strong>Message:</strong> Здравствуйте. Я рисую и увлекаюсь компьютерной графикой и играми с детства, закончил художественную школу, проходил курсы по Digital-art. Всему остальному научился самостоятельно (Photoshop, ZBrush, Cinema 4D). Я очень хочу принимать участие в создании компьютерных игр и стать частью квалифицированной команды. О себе могу сказать, что очень быстро обучаюсь и готов стараться и выполнять любые поручения 24/7.\n\nhttps://www.artstation.com/sasha_malyar</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-05 15:03:56', '2021-07-05 15:03:59', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/e6\\/rh\\/E6rheKZdNy.pdf\",\"as\":\"\\u0411\\u0435\\u043b\\u044f\\u0435\\u0432 \\u0410\\u043b\\u0435\\u043a\\u0441\\u0430\\u043d\\u0434\\u0440 (2).pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/e6\\/rh\\/E6rheKZdNy.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (56, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Иван</p><p><strong>Phone:</strong> 89524485120</p><p><strong>E-Mail:</strong> ivaneremeev9@gmail.com</p><p><strong>Message:</strong> Добрый день! Меня зовут Иван, я 3д художник по персонажам. Хотелось бы попасть в вашу команду по разработке игр! Прикрепляю к письму свое резюме и портфолио:\n https://www.artstation.com/ieremeev</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-05 17:45:09', '2021-07-05 17:45:12', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/6r\\/5o\\/6r5OBgmsNs.pdf\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/6r\\/5o\\/6r5OBgmsNs.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
