INSERT INTO `tager_mail_logs` VALUES (58, 3, 'jobs@furylion.net', 'VFX Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Авраменко Павел Вячеславович</p><p><strong>Phone:</strong> +375336471139</p><p><strong>E-Mail:</strong> whnerevar@gmail.com</p><p><strong>Message:</strong> Портфолио - https://www.artstation.com/wh_nerevar/albums/2904434\nЗдравствуйте.\nМеня зовут Павел, я создаю спецэффекты для мобильных и ПК проектов.\nНе имею опыта работы в студии / компании, но больше года занимаюсь фрилансом и сотрудничаю с независимыми разработчиками.\nС большим удовольствием присоединился бы к вашей команде.\nГотов к тестовому заданию.</p><p><strong>Vacancy:</strong> VFX Artist</p>', 'SUCCESS', NULL, '2021-07-06 08:46:15', '2021-07-06 08:46:17', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/mv\\/up\\/MVUpbY7ANq.pdf\",\"as\":\"Real-time VFX Artist. \\u0410\\u0432\\u0440\\u0430\\u043c\\u0435\\u043d\\u043a\\u043e \\u041f\\u0430\\u0432\\u0435\\u043b - \\u0420\\u0435\\u0437\\u044e\\u043c\\u0435.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/mv\\/up\\/MVUpbY7ANq.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (59, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Константин</p><p><strong>Phone:</strong> 89018522657</p><p><strong>E-Mail:</strong> wildchesnokov@mail.ru</p><p><strong>Message:</strong> Доброго времени, мои работы - https://www.artstation.com/konstantinchesnokov.Есть ещё 1 game ready на google diske ( https://drive.google.com/drive/folders/1DwKHUdK39tGkrZbSMO-xQXn8YUGuFXlq?usp=sharing ) топор, делаю его прямо сейчас, не устраивают ещё текстуры,но весь пейплайн теперь понял,там и сетка и UV.+ ещё немного \nинтересных wipok(смотрите на гугл диск :D),которые я начал месяца 1.5 назад,или два но не понимал UV/bake и т.п/ сейчас понимаю ( разбирался)\nТ.е я уверенно работаю в zbrush(всё, что на рендерах моё)\nМоделю в blender|maya\nRetop - maya\nUv - bledner|maya\nbake - marmoset\nнемного знаю marvlous,могу что-то сшить.\nИнтересно пройти 2 обучение,но если нет возможности,прошёл бы и 1.\nУсидчивый,учусь сам,решаю проблемы,желание работать character artist в итоге.\nСейчас делаю ещё low poly,могу скинуть,если нужно :)</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-06 12:38:28', '2021-07-06 12:38:30', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/rk\\/hn\\/RKhNUoVcM2.docx\",\"as\":\"Wip.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/rk\\/hn\\/RKhNUoVcM2.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (60, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Дмитрий</p><p><strong>Phone:</strong> +79821113012</p><p><strong>E-Mail:</strong> gaussd11@gmail.com</p><p><strong>Message:</strong> Здравствуйте, я очень заинтересован вашим предложением. Немного о себе: Дмитрий, 31 год, без вредных привычек. Решил полностью поменять род деятельности, выбор пал на 3Д, так как всегда хотел заниматься творчеством, да и трёхмерка показалась тем, с чем я справлюсь (вроде бы получается). Неконфликтный, способный выслушать любую критику и сделать выводы. Прошёл курс XYZ по персонажке.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-07 17:06:42', '2021-07-07 17:06:44', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/f9\\/zx\\/F9zxJKO7WM.doc\",\"as\":\"CV Belov_Dmitry.doc\",\"mime\":\"application\\/msword\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/f9\\/zx\\/F9zxJKO7WM.doc\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (61, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Анастасия Бондарь</p><p><b>Phone:</b> 89811807010</p><p><b>E-Mail:</b> mdf663@ya.ru</p><p><b>Message:</b> Доброго дня! \nНа данный момент я работаю руководителем группы по работе с монетизацией и юр. жалоб в Яндексе. \nИщу вакансии на должность Jun Project manager, связи с развитием себя, как специалиста в данной нише. \n\nБережно руковожу командой из 25 специалистов. \nВырастила 2-х старших специалистов, которые участвуют в проектах, а также помогают в работе с командой. \nНа выходе получаю увеличенные KPI и высокий уровень доверия в команде.\nСкорость и продуктивность работы была увеличена на 15% за последние 4 месяца. \n\nПомимо этого также разрабатываю проекты направленные на улучшение процессов в команде, автоматизация работы. \n\nИгровой опыт более 13 лет :)\nЗнакома с HomeScapes. На мой взгляд, это тот проект, который можно развивать бесконечно, органично встраивать пользовательские запросы, в том числе и рекламные продукты. \n\nСпасибо за уделенное время.</p>', 'SUCCESS', NULL, '2021-07-08 11:49:01', '2021-07-08 11:49:04', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/lp\\/wp\\/lPwPOfwjwo.pdf\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435 \\u0411\\u043e\\u043d\\u0434\\u0430\\u0440\\u044c.\\u0410.\\u042e.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/lp\\/wp\\/lPwPOfwjwo.pdf\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
