INSERT INTO `tager_mail_logs` VALUES (64, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Семён</p><p><b>Phone:</b> 89995283328</p><p><b>E-Mail:</b> semka42@yandex.ru</p><p><b>Message:</b> Добрый день!\nМеня зовут Семён и в настоящий момент я думаю о смене своей профессиональной деятельности.\nМеня всегда интересовала игровая индустрия и я бы хотел попробовать свои силы в данной сфере, хоть моя специальность с ней и не связана. Однако я готов учиться новому. Интересен, конечно, в первую очередь гейм-дизайн, однако готов рассмотреть различные должности, на которые я могу подойти.</p>', 'SUCCESS', NULL, '2021-07-09 20:00:24', '2021-07-09 20:00:27', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/ou\\/ug\\/ouuGGqvj9F.pdf\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435 \\u0415\\u0432\\u0441\\u0438\\u043a\\u043e\\u0432 \\u0421\\u0435\\u043c\\u0451\\u043d \\u041a\\u043e\\u043d\\u0441\\u0442\\u0430\\u043d\\u0442\\u0438\\u043d\\u043e\\u0432\\u0438\\u0447.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/ou\\/ug\\/ouuGGqvj9F.pdf\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (65, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Леонид</p><p><strong>Phone:</strong> 89236157971</p><p><strong>E-Mail:</strong> leokorekov42@gmail.com</p><p><strong>Message:</strong> Начинающий 3D artist, люблю игры, есть огромное желание развиваться в данном направлении и создавать качественные и красивые игровые модели</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-10 09:11:17', '2021-07-10 09:11:21', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/me\\/gd\\/MegduOBhDu.pdf\",\"as\":\"\\u041b\\u0435\\u043e\\u043d\\u0438\\u0434 \\u0412\\u0430\\u043b\\u0435\\u0440\\u044c\\u0435\\u0432\\u0438\\u0447 \\u041a\\u043e\\u0440\\u0435\\u043a\\u043e\\u0432.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/me\\/gd\\/MegduOBhDu.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (66, 3, 'jobs@furylion.net', '3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Александр</p><p><strong>Phone:</strong> +79818491890</p><p><strong>E-Mail:</strong> morph.morph@yandex.ru</p><p><strong>Message:</strong> Здравствуйте. Меня зовут Александр.\n\nУмею делать SubD ,low poly, hi poly, UV развертку, бейкать карты нормалей, АО, Curvature. Текстурю в Substance painter.\nОпыта в продакшене не имею, имею сильную мотивацию учиться и развиваться.\n\nПроходил курсы :\n1)videosmile_ru, Курсы от VideoSmile, Текстуринг (Супер Substance - Александр Коляса)\n2)videosmile_ru, Курсы от VideoSmile, 3D графика - Софт (Супер Maya - Юрий Снытко)\n\nВладею программами Autodesk Maya, Substance painter, Marmoset toolbag, RizomUV, Maya Arnold.\n\nСсылка на ArtStation - https://www.artstation.com/morphclash</p><p><strong>Vacancy:</strong> 3D Artist</p>', 'SUCCESS', NULL, '2021-07-10 21:50:48', '2021-07-10 21:50:51', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/z5\\/or\\/z5ORcXr9zm.pdf\",\"as\":\"\\u041b\\u0435\\u0432\\u0438\\u0442\\u0438\\u043d \\u0410\\u043b\\u0435\\u043a\\u0441\\u0430\\u043d\\u0434\\u0440 \\u0412\\u0430\\u0441\\u0438\\u043b\\u044c\\u0435\\u0432\\u0438\\u0447.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/z5\\/or\\/z5ORcXr9zm.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
