INSERT INTO `tager_mail_logs` VALUES (70, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Ed Manrique</p><p><strong>Company:</strong> edmanTV</p><p><strong>E-Mail</strong> eddy@hightechvideo.net</p><p><strong>Message</strong> Managing Director\nI\'m a freelance animator and motion graphics designer specializing in animated videos for the Tech industry.\nUnlike explainer video \"factories\", I do not use templates or pre-made animations.\nMy videos tell stories, educate customers, explain the complex, and humanize brands.\nSee for yourself at my video portfolio https://vimeo.com/showcase/techvideos\nBased in Miami, I\'ve worked for marketing agencies and tech companies worldwide.\nIf there is something I can do for you, please do not hesitate to contact me.\nHave a great day.</p>', 'SUCCESS', NULL, '2021-07-12 19:31:51', '2021-07-12 19:31:55', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
