INSERT INTO `tager_mail_logs` VALUES (72, 3, 'jobs@furylion.net', '2D Animator - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Антон</p><p><strong>Phone:</strong> +375293026348</p><p><strong>E-Mail:</strong> a.s.chii41@gmail.com</p><p><strong>Message:</strong> Добрый день! Меня зовут Антон, и меня заинтересовала ваша вакансия 2D аниматора. Уровень junior, но я хочу активно развиваться и познавать дзен аниматора. В приложенном файле моё резюме, там же ссылка на моё портфолио. Буду рад попробовать себя в компании с таким богатым опытом и надеюсь, у меня получится внести свой маленький, но значимый вклад в рабочий процесс. Если вас заинтересует моё резюме, прошу связаться со мной по указанным в нём контактам.</p><p><strong>Vacancy:</strong> 2D Animator</p>', 'SUCCESS', NULL, '2021-07-12 23:10:35', '2021-07-12 23:10:39', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/o0\\/xc\\/o0xc0F2eV0.pdf\",\"as\":\"resume_Anton_Silyuk_-_2D_Animator.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/o0\\/xc\\/o0xc0F2eV0.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
