INSERT INTO `tager_mail_logs` VALUES (74, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Такеши</p><p><strong>Phone:</strong> +79213431191</p><p><strong>E-Mail:</strong> kesha.koloshin@mail.ru</p><p><strong>Message:</strong> Добрый день! Меня зовут Такеши Колошин, и я хочу устроится к вам на работу. Я умею работать в Zbrush, Maya, рисую текстуры в Substance painter, занимаюсь постобработкой в Photoshop.\nУ меня есть художественное образование, а вместе с ним понимание пропорций, цветовых сочетаний и фактур.\nЗнаю английский язык на уровне Intermediate.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-13 14:02:32', '2021-07-13 14:02:35', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/d4\\/hb\\/D4hbyp0C9Q.docx\",\"as\":\"\\u0440\\u0435\\u0437\\u044e\\u043c\\u0435 \\u041a\\u043e\\u043b\\u043e\\u0448\\u0438\\u043d \\u0422\\u0430\\u043a\\u0435\\u0448\\u0438 \\u0410\\u043d\\u0442\\u043e\\u043d\\u043e\\u0432\\u0438\\u0447.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/d4\\/hb\\/D4hbyp0C9Q.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
