INSERT INTO `tager_mail_logs` VALUES (76, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Oleg</p><p><strong>Phone:</strong> 79963228034</p><p><strong>E-Mail:</strong> job3d.prokopev@gmail.com</p><p><strong>Message:</strong> Портфолио:\nhttps://op4.artstation.com/\nО себе и флуд:\nПереезжаю в Санкт-Петербург(29.07.2021) и желаю пройти очное обучение в вашей компании.\nВ основном работаю с Maya, хоть и моделирую окружение, реквизит, оружие и прочее. Готов выучить 3Ds Max до того, как попаду в Питер, если вы сможете быстро ответить.\nВ портфолио скетчи, я не считаю это законченными работами, но без них мне даже никто и не отвечал(На проработку качественного проекта попросту нет времени) (:</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-13 16:36:13', '2021-07-13 16:36:15', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/hz\\/us\\/hzusxtj2Gc.docx\",\"as\":\"Resume_Oleg_Prokopev.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/hz\\/us\\/hzusxtj2Gc.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
