INSERT INTO `tager_mail_logs` VALUES (78, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Марсель</p><p><strong>Phone:</strong> +7(917) 343-55-00</p><p><strong>E-Mail:</strong> tetra.carne@gmail.com</p><p><strong>Message:</strong> Добрый день! Меня зовут Марсель Исламуратов, и я хочу работать в вашей компании. Вот почему:\n- Имею в портфолио GameReady модель;\n- Доброжелательный, аккуратный, быстро перехожу на новый софт. Так же люблю работать в команде; \n- Меня привлекли условия труда компании, поэтому с радостью пройду обучение в вашей школе по направлению - Фентези оружие и доспехи, показав отличные результаты!\nСпасибо за внимание!</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-14 11:10:30', '2021-07-14 11:10:32', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/n4\\/sw\\/n4swaWk8Uw.pdf\",\"as\":\"\\u0418\\u0441\\u043b\\u0430\\u043c\\u0443\\u0440\\u0430\\u0442\\u043e\\u0432 \\u041c\\u0430\\u0440\\u0441\\u0435\\u043b\\u044c \\u0414\\u0430\\u043c\\u0438\\u0440\\u043e\\u0432\\u0438\\u0447.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/n4\\/sw\\/n4swaWk8Uw.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
