INSERT INTO `tager_mail_logs` VALUES (81, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Владислав</p><p><strong>Phone:</strong> +79127407684</p><p><strong>E-Mail:</strong> jsp.vpushkarev@gmail.com</p><p><strong>Message:</strong> Здравствуйте! \nЯ младший 3D художник. В 2012-2013 году увлекался маппингом на движке \"Hammer\", создавал игровые локации для неофициальных серверов Counter-Strike: Source. Увлекаться 3D начал с прошлого года. За этот период выполнил 9 самостоятельных проектов. В последние годы я работал по другой специальности, а сейчас хочу посветить себя полностью 3D сфере. Нацелен на обучение по направлению фентези оружие и доспехи. \nСсылка на портфолио: https://vladislavpushkarev.artstation.com\n\nНиже прикрепляю pdf файл с моим резюме и с работами из портфолио.\n\nБлагодарю за уделенное мне время!</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-15 02:08:25', '2021-07-15 02:08:28', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/vh\\/hh\\/VhHhQQGJCz.pdf\",\"as\":\"Summary_PushkarevV.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/vh\\/hh\\/VhHhQQGJCz.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (82, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Alexey</p><p><strong>Phone:</strong> +380506367047</p><p><strong>E-Mail:</strong> uporotiylemur@gmail.com</p><p><strong>Message:</strong> Доброго времени суток!\nЯ, Алексей, в поисках проекта, в котором мог бы вырасти, как профессионал.\nВ данный момент подрабатываю в студии 3d moiler.\nЯ выпускник компьютерной академии \"Шаг\", в области 3д дизайна.\nДипломным проектом был анимированный персонаж в программе Maya.\nhttps://www.artstation.com/uporotiy_lemur\nВ ссылке на мой артстейшен дипломный проект присутствует.\nМогу добавить, еще что прошел курсы XYZ, есть успехи.\nТак же для одного проекта, ссылку на которое мне сказали не выкладывать, я выполнил тестовое задание.\nhttps://drive.google.com/open?id=169T3oun2ekwLagN66gCXj8KCShOJhvOW\nНадеюсь на сотрудничество.\nИнтересно посмотреть тестовое задание. :)</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-15 11:06:09', '2021-07-15 11:06:15', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/3t\\/jh\\/3tJh5wMXtE.png\",\"as\":\"final_presentation.png\",\"mime\":\"image\\/png\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/3t\\/jh\\/3tJh5wMXtE.png\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (83, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Илья</p><p><strong>Phone:</strong> 89235704430</p><p><strong>E-Mail:</strong> rovinskii02@mail.ru</p><p><strong>Message:</strong> Здравствуйте!\n\nМеня зовут Ровинский Илья, я умею создавать 3D модели и развиваюсь как 3D artist. Самостоятельно разобрался в тонкостях пайплайна. Также работал несколько месяцев в стартапе. Смогу создать 3D модель для различных целей: для AR/VR, игры, кино, 3D принтера и т.д. На данный момент осваиваю UE4 для создания полноценный игровой локации.\n\nНаправление для обучение я готов пойти на любое куда возьмут, но сам хотел бы создавать фентези оружие и доспехи.\n\nБуду рад пройти у вас обучение и в дальнейшем успешно с вами работать.\n\nЭто ссылка на моё портфолио на render.ru — https://render.ru/ru/artist/225761/portfolio\n\nСпасибо за уделенное мне время.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-17 04:34:56', '2021-07-17 04:34:59', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/0x\\/yv\\/0XyV0zMMzE.pdf\",\"as\":\"\\u0420\\u043e\\u0432\\u0438\\u043d\\u0441\\u043a\\u0438\\u0439 \\u0418\\u043b\\u044c\\u044f \\u0421\\u0435\\u0440\\u0433\\u0435\\u0435\\u0432\\u0438\\u0447.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/0x\\/yv\\/0XyV0zMMzE.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
