INSERT INTO `tager_mail_logs` VALUES (86, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Кузьмин Даниил Сергеевич</p><p><strong>Phone:</strong> +79320108958</p><p><strong>E-Mail:</strong> denka1009@rambler.ru</p><p><strong>Message:</strong> Добрый день, интересует возможность попасть к вам в роли 3D джуна. Портфолио https://www.artstation.com/denka1009 https://www.instagram.com/chameleon.dk</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-19 08:06:08', '2021-07-19 08:06:10', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/6k\\/6g\\/6k6GrhJIR5.docx\",\"as\":\"\\u041a\\u0443\\u0437\\u044c\\u043c\\u0438\\u043d \\u0414\\u0430\\u043d\\u0438\\u0438\\u043b. \\u0420\\u0435\\u0437\\u044e\\u043c\\u0435.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/6k\\/6g\\/6k6GrhJIR5.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (87, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Илья</p><p><b>Phone:</b> +79088599024</p><p><b>E-Mail:</b> dzhurailya9@gmail.com</p><p><b>Message:</b> Здравствуйте, давно хочу к вам в команду в качестве Junior 3D Artist. Серьезно занимаюсь 3д артом около двух лет. За это время успел поработать с разными инди командами над играми разных жанров. Из этих команд, к сожалению, осталась на плаву только одна.\nУверенно владею Substance Painter, Maya, Blender, RizomUV, Marmoset toolbag 4. Есть опыт моделирования военной техники по собственноручно собранным референсам, моделированию оружия по концептам, и пропсов по фотографиям. Люблю делать hardsurface. Постоянно стараюсь узнавать новое. Открыт любым новым штукам и с радостью научусь им. Также есть опыт работы с Unity и Unreal engine 4, импортировал свои модели и собирал уровни. Умею работать в команде. Знаю английский язык на уровне: читаю, перевожу. Очень хотелось бы попробовать выполнить тз и, возможно, работать с вами.\n\nОставляю свой артстейшен и с нетерпением жду ответа: Whale Shark 3D Artist | https://www.artstation.com/whaleshark</p>', 'SUCCESS', NULL, '2021-07-20 19:05:39', '2021-07-20 19:05:42', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/o6\\/th\\/O6ThcIv1UU.png\",\"as\":\"CVdzhurailya.png\",\"mime\":\"image\\/png\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/o6\\/th\\/O6ThcIv1UU.png\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (88, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Андрей</p><p><strong>Phone:</strong> +79017235536</p><p><strong>E-Mail:</strong> hamlett@list.ru</p><p><strong>Message:</strong> Здравствуйте, я начинающий 3D artist, студент компании Skillbox по направлению 3D generalist. В сфере 3D графики развиваюсь уже более года и мечтаю о карьере в геймдеве. В резюме есть ссылка на пой профиль на артстанции. Больше моих работ можно посмотреть по ссылке https://disk.yandex.ru/d/p3BeZqlQgQ6zvw\nБлагодарю за внимание</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-21 14:10:21', '2021-07-21 14:10:24', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/9u\\/8z\\/9u8z7QAYy1.docx\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435 \\u0410\\u043d\\u0434\\u0440\\u0435\\u0439 \\u0418\\u043b\\u044c\\u044f\\u0448\\u0435\\u043d\\u043a\\u043e.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/9u\\/8z\\/9u8z7QAYy1.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (89, 3, 'jobs@furylion.net', 'Project Manager - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Владимир</p><p><strong>Phone:</strong> +375298107580</p><p><strong>E-Mail:</strong> mazurenkovlad26@gmail.com</p><p><strong>Message:</strong> Доброго времени, отклик на вакансию Project Manager</p><p><strong>Vacancy:</strong> Project Manager</p>', 'SUCCESS', NULL, '2021-07-23 11:09:33', '2021-07-23 11:09:35', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/hd\\/dj\\/hDDJOTojn9.pdf\",\"as\":\"22Resume.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/hd\\/dj\\/hDDJOTojn9.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (90, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Илья</p><p><b>Phone:</b> 89608043674</p><p><b>E-Mail:</b> iprab0t@gmail.com</p><p><b>Message:</b> Здравствуйте. Меня зовут Илья. Занимаюсь обзорами мобильных игр с 2013 года. Имею ютуб канал с аудиторией 350К подписчиков. Также развиваю свой тик ток канал посвященный мобильным играм, на данный момент в тик токе у меня 20К подписчиков. Очень хочу поучаствовать в разработке мобильных игр (мечта детства). Ищу работы и был бы рад сотрудничеству с Вами. Хотел бы попробовать себя в роли тестировщика (имеется небольшой опыт, работал тестировщиком в банке), также могу взять на себя задачи связанные с видео, развитием ютуб/тик ток для компании. Также прикрепляю свое резюме.  Спасибо за внимание.</p>', 'SUCCESS', NULL, '2021-07-23 14:04:50', '2021-07-23 14:04:53', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/gh\\/8f\\/gh8fGxXH5r.pdf\",\"as\":\"\\u0413\\u043e\\u0440\\u0438\\u043d \\u0418\\u043b\\u044c\\u044f.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/gh\\/8f\\/gh8fGxXH5r.pdf\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
