INSERT INTO `tager_mail_logs` VALUES (92, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Alexey</p><p><strong>Phone:</strong> +380713928446</p><p><strong>E-Mail:</strong> uporotiylemur@gmail.com</p><p><strong>Message:</strong> Доброго времени суток!\nЯ, Алексей, в поисках проекта, в котором мог бы вырасти, как профессионал.\nВ данный момент подрабатываю в студии 3d moiler.\nЯ выпускник компьютерной академии \"Шаг\", в области 3д дизайна.\nДипломным проектом был анимированный персонаж в программе Maya.\nhttps://www.artstation.com/uporotiy_lemur\nВ ссылке на мой артстейшен дипломный проект присутствует.\nМогу добавить, еще что прошел курсы XYZ, есть успехи.\nТак же для одного проекта, ссылку на которое мне сказали не выкладывать, я выполнил тестовое задание.\nhttps://drive.google.com/open?id=169T3oun2ekwLagN66gCXj8KCShOJhvOW\nНадеюсь на сотрудничество.\nИнтересно посмотреть тестовое задание. :)</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-25 07:40:37', '2021-07-25 07:40:40', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/9z\\/s4\\/9zS4wI8WxD.mp4\",\"as\":\"123.mp4\",\"mime\":\"video\\/mp4\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/9z\\/s4\\/9zS4wI8WxD.mp4\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
