INSERT INTO `tager_mail_logs` VALUES (95, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Петр</p><p><strong>Phone:</strong> +79115240193</p><p><strong>E-Mail:</strong> pet.rumin2012@yandex.ru</p><p><strong>Message:</strong> https://www.artstation.com/aromas1234</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-25 14:04:45', '2021-07-25 14:04:47', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/yp\\/yi\\/ypyILJ68yJ.pdf\",\"as\":\"\\u0420\\u044e\\u043c\\u0438\\u043d \\u041f\\u0435\\u0442\\u0440 \\u041d\\u0438\\u043a\\u043e\\u043b\\u0430\\u0435\\u0432\\u0438\\u0447.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/yp\\/yi\\/ypyILJ68yJ.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (96, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Алексей Колупаев</p><p><strong>Phone:</strong> +79127008238</p><p><strong>E-Mail:</strong> montehkaa@mail.ru</p><p><strong>Message:</strong> Здравствуйте!\nИщу работу 3D художником (предпочтительно character artist).\n\nМеня заинтересовала ваша вакансия, так как я имею огромное желание работать в игровой индустрии и участвовать в создании качественных игр.\n\nЯ сам геймер, поэтому имею представление о том, что хотел бы видеть игрок. Обладаю опытом и навыками создания персонажа от идеи до готовой модели, high poly и low poly. Проходил курсы (XYZ, Knower school), также совершенствую свои навыки в процессе работы. В своих моделях делаю упор на стилизацию с хорошей детализацией (примеры работ unicorndead.artstation.com).\n\nСпасибо за уделённое время, буду рад сотрудничеству!\nС уважением, Алексей.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-26 07:18:31', '2021-07-26 07:18:33', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/3a\\/is\\/3aiSShWyug.pdf\",\"as\":\"\\u041a\\u043e\\u043b\\u0443\\u043f\\u0430\\u0435\\u0432 \\u0410\\u043b\\u0435\\u043a\\u0441\\u0435\\u0439 \\u0410\\u043b\\u0435\\u043a\\u0441\\u0430\\u043d\\u0434\\u0440\\u043e\\u0432\\u0438\\u0447 (1).pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/3a\\/is\\/3aiSShWyug.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (97, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Ася</p><p><strong>Phone:</strong> +7(953) 661-31-29</p><p><strong>E-Mail:</strong> asyaquill@gmail.com</p><p><strong>Message:</strong> Здравствуйте! \n\nМеня зовут Ася, откликаюсь на позицию Junior 3D Artist. \nЯ закончила архитектурно-строительный факультет по специальности “Архитектура”. В процессе обучения столкнулась с 3D-графикой, что увлекло гораздо больше, чем архитекторская деятельность. Впоследствии работала моделлером и визуализатором, вместе с этим разбираясь в пайплайне создания персонажей для игр. \n\nВесь этот опыт позволил мне поработать самостоятельно и в команде, изучить некоторые теоретические аспекты, помогающие в работе, такие как композиционные приёмы, особенности света и цвета. Так же приобрела знания о процессе работы во многих программах, так что изучение новых 3d-пакетов или вспомогательных инструментов теперь меня не пугает. \n\nК сожалению, не имею опыта работы на должности 3D Artist в игровой индустрии, поэтому готова пройти обучение по направлению “Анатомия лица. Клинап 3D скана головы”. Для меня это было бы особенно интересно, так как изучение остеологии и миологии - моё хобби. \n\nМоё резюме и ссылка на портфолио находятся во вложении. \n\nЕсли у вас появились какие-либо дополнительные вопросы, с радостью на них отвечу в telegram https://t.me/asyaquill или по почте: asyaquill@gmail.com</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-26 10:33:01', '2021-07-26 10:33:05', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/gq\\/dz\\/GqdzH7mvT2.pdf\",\"as\":\"\\u041a\\u0432\\u0438\\u043b\\u043b \\u0410\\u0441\\u044f \\u041c\\u0438\\u0445\\u0430\\u0439\\u043b\\u043e\\u0432\\u043d\\u0430.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/gq\\/dz\\/GqdzH7mvT2.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (98, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Мануил Айнулин</p><p><strong>Phone:</strong> 89500225333</p><p><strong>E-Mail:</strong> amametall@mail.ru</p><p><strong>Message:</strong> Здравствуйте, меня зовут Мануил Айнулин. Начал изучать созданние игровых ассетов с 2021 года, учился воссоздавать оружие и персонажей по концепт арту. Затем занялся анатомией, и полным циклом создания игрового персонажа, изучал: ретопологию, UV развёртку, бейкинг текстур, текстурирование. Работаю в: ZBrush, Maya, TopoGun, UVlayout, Substance Painter, Marmoset Toolbag 3. Возможно ли у вас пройти обучение по программе  FuryLion School, с дальнейшим трудоустройством. \nПортфолио:   https://drive.google.com/drive/folders/1zNmY3FGS5ssPmXEm_VXIj2mhYqMc0FS9</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-07-26 11:10:14', '2021-07-26 11:10:18', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/5i\\/hs\\/5IHsGyNvp9.rar\",\"as\":\"\\u041f\\u043e\\u0440\\u0442\\u0444\\u043e\\u043b\\u0438\\u043e 3d junior (\\u041c\\u0430\\u043d\\u0443\\u0438\\u043b \\u0410\\u0439\\u043d\\u0443\\u043b\\u0438\\u043d).rar\",\"mime\":\"application\\/x-rar\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/5i\\/hs\\/5IHsGyNvp9.rar\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
