INSERT INTO `tager_mail_logs` VALUES (100, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Мария Сергеева</p><p><strong>Company:</strong> --</p><p><strong>E-Mail</strong> ladoladoga@gmail.com</p><p><strong>Message</strong> Добрый день!\nПрошу рассмотреть мое резюме на вакансию 3d моделлера. Прикрепляю резюме и ссылку на примеры работ: https://drive.google.com/drive/folders/13GKIEXLuMLcdNev3fDCK44m3NRBEGfpC?usp=sharing\n\nС уважением,\nМария Сергеева.</p>', 'SUCCESS', NULL, '2021-07-27 14:02:09', '2021-07-27 14:02:11', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/px\\/rk\\/PXRKIt1SLU.docx\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.documentapplication\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/px\\/rk\\/PXRKIt1SLU.docx\"}]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
