INSERT INTO `tager_mail_logs` VALUES (104, 3, 'jobs@furylion.net', '2D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Александра</p><p><strong>Phone:</strong> 89199098005</p><p><strong>E-Mail:</strong> samaramap@mail.ru</p><p><strong>Message:</strong> Здравствуйте, уважаемый HR-менеджер компании “FuryLion”!\n\nПрошу Вас рассмотреть мое резюме на вакансию 2D-художника.\n\nС радостью  приму участие в конкурсе на вакансию в вашей компании “FuryLion”. Мне важно стать частью вашей команды опытных профессионалов, которая активно развивается и совершенствуется, чтобы радовать своих клиентов. \n\nСчитаю, что я подходящий кандидат и смогу успешно справиться с обязанностями, описанными в вакансии. Вот почему:\n\nВ моем портфолио есть примеры работ: https://www.artstation.com/alexpetce \nВладею графическим планшетом, программами: Photoshop, Illustrator\nРазбираюсь в основах композиции, цвета и света\nПонимаю законы перспективы, построения, анатомии\nОбладаю развитым чувством вкуса\nОбожаю рисовать, постоянно совершенствую свой навык\nУровень английского языка — Pre-Intermediate\n\nАкадемическая база и прошлый опыт работы помогают мне лучше понимать специфику профессии 2D-художника.\n\nС удовольствием займусь выполнением тестового задания.\n\nЗаранее благодарю за проявленный интерес к моей кандидатуре.\n\nС уважением, \nАлександра Шакмакова.\n\nТелефон: 8 919 909 8005\nEmail: samaramap@mail.ru\nTelegram: @alexpetce</p><p><strong>Vacancy:</strong> 2D Artist</p>', 'SUCCESS', NULL, '2021-07-29 15:24:54', '2021-07-29 15:24:56', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/dt\\/mk\\/DtMksfTn6R.pdf\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435 \\u0410\\u043b\\u0435\\u043a\\u0441\\u0430\\u043d\\u0434\\u0440\\u0430 \\u0428\\u0430\\u043a\\u043c\\u0430\\u043a\\u043e\\u0432\\u0430.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/dt\\/mk\\/DtMksfTn6R.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (105, 3, 'jobs@furylion.net', '2D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Армен Карапетьянц</p><p><strong>Phone:</strong> 89272194367</p><p><strong>E-Mail:</strong> armen12_0@mail.ru</p><p><strong>Message:</strong> Добрый день.\nМеня заинтересовала, открывшаяся у вас, вакансия 2D художник.\nК сожалению на данный момент времени у меня нет опыта работы в этой области, однако более 10 лет профессионально занимаюсь изобразительным искусством.\nИмею четырех летний опыт работы с раскадровкой и рисованием объясняющих роликов (реклама, презентации, анонсы, инструкции, отчеты и т. д.) Прекрасно знаю что такое дедлайн и на сколько важно его соблюдать. Умение учиться, всегда позволяло мне, в короткие сроки приобрести или усовершенствовать уже имеющиеся знания и навыки.\nПримеры моих работ CG\nhttps://armenkarapetyants.artstation.com/\nтрадиционные материалы \nhttps://www.instagram.com/armenkarapetyants/\nБлагодарю Вас за уделенное мне время.\nС уважением, Армен.</p><p><strong>Vacancy:</strong> 2D Artist</p>', 'SUCCESS', NULL, '2021-07-29 15:30:53', '2021-07-29 15:30:54', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/4z\\/pe\\/4ZPeWdL3yu.docx\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.documentapplication\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/4z\\/pe\\/4ZPeWdL3yu.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (106, 3, 'jobs@furylion.net', '2D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Алена</p><p><strong>Phone:</strong> 89119359373</p><p><strong>E-Mail:</strong> enotxxx92@mail.ru</p><p><strong>Message:</strong> Здравствуйте! Есть огромное желание развиваться в gamedev индустрии. Хочу попасть на вакансию 2d художник (junior) Прошла 6-ти месячный курс  \"концепт- художник\"  в xyz school. Базово знаю 3d пакеты zbrush, 3dsmax, в планах освоить zbrush и unity на профессиональном уровне. Буду ждать обратной связи!\nМои работы можно посмотреть тут https://instagram.com/alyo_s_ha?utm_medium=copy_link\nИ тут https://www.artstation.com/aly0sha_grishechk1na/profile</p><p><strong>Vacancy:</strong> 2D Artist</p>', 'SUCCESS', NULL, '2021-07-30 05:56:32', '2021-07-30 05:56:35', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/bx\\/f0\\/BXF0NT8kmg.pdf\",\"as\":\"\\u0413\\u0440\\u0438\\u0448\\u0435\\u0447\\u043a\\u0438\\u043d\\u0430 \\u0410\\u043b\\u0451\\u043d\\u0430 \\u041e\\u043b\\u0435\\u0433\\u043e\\u0432\\u043d\\u0430.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/bx\\/f0\\/BXF0NT8kmg.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
