INSERT INTO `tager_mail_logs` VALUES (108, 3, 'jobs@furylion.net', '2D Animator - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Ксения Николаевна Лобан</p><p><strong>Phone:</strong> +375297093041</p><p><strong>E-Mail:</strong> ksyusha.loban@mail.ru</p><p><strong>Message:</strong> Уважаемый HR-менеджер!\nПрошу Вас рассмотреть мое резюме на вакансию «2D Animator».\nЯ окончила курс Kate Motion Academy.\nЯ являюсь ответственным, целеустремлённым человеком. Я очень энергична и жизнерадостна. Умею работать в команде, хорошо лажу с людьми.\nПрилагаю свое резюме и надеюсь на возможность рассказать о себе подробнее в ходе личного собеседования.\n\nС уважением,\nКсения Лобан!\n\nПортфолио:\nhttps://www.behance.net/loban-k</p><p><strong>Vacancy:</strong> 2D Animator</p>', 'SUCCESS', NULL, '2021-07-30 09:24:54', '2021-07-30 09:24:57', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/2l\\/dv\\/2LdVqIYpor.docx\",\"as\":\"Kseniya Loban_Resume.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/2l\\/dv\\/2LdVqIYpor.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (109, 3, 'jobs@furylion.net', '2D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Маргарита Мурзинова</p><p><strong>Phone:</strong> 89602802850</p><p><strong>E-Mail:</strong> ritamurzinova@gmail.com</p><p><strong>Message:</strong> Здравствуйте! Меня зовут Маргарита, я 2D-художник. Мое портфолио: https://murzinova.artstation.com/\nЯ закончила художественную школу и курсы графического дизайна при СПБГХПА им. Штиглица, в настоящее время повышаю квалификацию на курсах академического рисунка и в Skillbox. Владею Adobe Photoshop, Illustrator, Corel Draw. Знаю основы композиции и теории цвета. Рисую на планшете и от руки, использую метод фотобашинга. Подстраиваюсь под нужную стилистику, работаю быстро.  \nНа данный момент у меня нет опыта работы в геймдеве. В основном я занималась графическим дизайном, геральдикой, иллюстрацией и книжной версткой.\nЯ готова выполнить тестовое задание, чтобы продемонстрировать свой уровень.</p><p><strong>Vacancy:</strong> 2D Artist</p>', 'SUCCESS', NULL, '2021-07-30 16:28:18', '2021-07-30 16:28:20', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/bz\\/hh\\/bzHh46muCQ.docx\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435 2D \\u0445\\u0443\\u0434\\u043e\\u0436\\u043d\\u0438\\u043a .docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/bz\\/hh\\/bzHh46muCQ.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (110, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Кирилл</p><p><strong>Phone:</strong> 89834082952</p><p><strong>E-Mail:</strong> kirya-kuznetsov-2002@bk.ru</p><p><strong>Message:</strong> Здравствуйте, очень хотелось бы развиваться в данном направлении, очень надеюсь что вам понравиться моя работа и мы сможем сотрудничать!</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-01 06:43:36', '2021-08-01 06:43:39', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/iu\\/x8\\/iUX8a50tIe.jpg\",\"as\":\"qB7PrLWZHvU.jpg\",\"mime\":\"image\\/jpeg\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/iu\\/x8\\/iUX8a50tIe.jpg\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (111, 3, 'jobs@furylion.net', '3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Андрей Бородатый</p><p><strong>Phone:</strong> 89214110066</p><p><strong>E-Mail:</strong> and_bor@mail.ru</p><p><strong>Message:</strong> Добрый день. Нахожусь в поиске команды в которой мог бы развиваться, как 3D Artist и участвовать в интересных проектах. Помимо знания основных пакетов моделирования(Maya,Zbrush) и умения их применять, \nимею опыт в традиционной 2D и 3D анимации и хорошую художественную базу. Благодарю за уделенное время.</p><p><strong>Vacancy:</strong> 3D Artist</p>', 'SUCCESS', NULL, '2021-08-01 10:44:12', '2021-08-01 10:44:14', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/2t\\/wx\\/2TwxVK87aA.pdf\",\"as\":\"\\u0410\\u043d\\u0434\\u0440\\u0435\\u0439_\\u0411\\u043e\\u0440\\u043e\\u0434\\u0430\\u0442\\u044b\\u0439_-_3D_Artist.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/2t\\/wx\\/2TwxVK87aA.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (112, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Антон</p><p><strong>Phone:</strong> +79960247945</p><p><strong>E-Mail:</strong> zare4niyevgeny@yandex.ru</p><p><strong>Message:</strong> Владею основным пайпланом создания различных ассетов: Blender, MarmosetToolBag, Zbrush, Substance Painter, Unreal Engine.\nИмею навыки текстуринга, моделинга, рендеринга, создания UV-разветок, оптимизации моделей.\nАктивно изучаю 3д геймдев моделирование, имел опыт работы на фриланс биржах в качестве художника 3д в коммерческой иллюстрации( продуктовый дизайн).</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-01 11:58:02', '2021-08-01 11:58:05', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/9q\\/hr\\/9QHrBAHiEv.txt\",\"as\":\"\\u043f\\u043e\\u0440\\u0442\\u0444\\u0435\\u043b\\u044c.txt\",\"mime\":\"text\\/plain\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/9q\\/hr\\/9QHrBAHiEv.txt\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
