INSERT INTO `tager_mail_logs` VALUES (115, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Андрей</p><p><strong>Phone:</strong> +79081926129</p><p><strong>E-Mail:</strong> Mr.adriel@yandex.ru</p><p><strong>Message:</strong> Добрый день, давно изучаю 3д. Но по степени возможности и основной работы, небыло шанса проявить себя как 3д художник. Проживаю в Санкт-Петербурге, готов к обучению, и критике, хотел бы работать в дружной команде. Могу выполнить небольшое тестовое задание по теме вакансии.\n Спасибо за внимание.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-02 11:19:08', '2021-08-02 11:19:11', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/i2\\/m9\\/i2M94cmDTx.pdf\",\"as\":\"\\u0410\\u043d\\u0434\\u0440\\u0435\\u0439 \\u0412\\u043b\\u0430\\u0434\\u0438\\u043c\\u0438\\u0440\\u043e\\u0432\\u0438\\u0447 \\u041a\\u043e\\u0442\\u043e\\u0432.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/i2\\/m9\\/i2M94cmDTx.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
