INSERT INTO `tager_mail_logs` VALUES (119, 3, 'jobs@furylion.net', 'Game Designer (HC) - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Владимир Мазуренко</p><p><strong>Phone:</strong> +375298107580</p><p><strong>E-Mail:</strong> mazurenkovlad26@gmail.com</p><p><strong>Message:</strong> Добрый день, Владимир Андреевич, высшее техническое образование, ранее PM стартапа, разрабатывающего цифровые продукты и устройства. До настоящего момента искал работу, способную разжечь огонь в моих глазах, в которую я смогу по-настоящему влюбиться, и кажется, нашёл). Хочу сразу отметить, что опыта работы в gamedev у меня нет, однако есть уникальный опыт работы над инновационными, сложными и интересными цифровыми (и не только) проектами в составе команды талантливых специалистов и профессионалов в своей области. Я уверен, что перенос этого опыта и знаний в команду таких же интересных и талантливых ребят будет крайне полезным не только с точки зрения тимбилдинга, но и коммерческой деятельности компании. С детальной информацией о моей профессиональной деятельности Вы можете ознакомиться в резюме, спасибо за уделённое время!</p><p><strong>Vacancy:</strong> Game Designer (HC)</p>', 'SUCCESS', NULL, '2021-08-03 20:44:36', '2021-08-03 20:44:39', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/wq\\/bv\\/WqBvJ6dl3F.pdf\",\"as\":\"Resume_Game_Designer.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/wq\\/bv\\/WqBvJ6dl3F.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (120, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Глеб</p><p><strong>Phone:</strong> +79964595779</p><p><strong>E-Mail:</strong> mspoxir@gmail.com</p><p><strong>Message:</strong> Нацелен стать 3D character artist. \nПоступил в СПБГУПТД(на направление с 3D). \nХочу получить опыт работы в команде, узнать техн. ошибки, просто узнать что-то новое (броню, например, научится моделировать)\n\n\nhttps://www.artstation.com/artwork/QrvON3</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-03 21:28:09', '2021-08-03 21:28:11', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/4i\\/n0\\/4In0mwgWTM.pdf\",\"as\":\"CV-Gleb.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/4i\\/n0\\/4In0mwgWTM.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
