INSERT INTO `tager_mail_logs` VALUES (122, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Siddharth N</p><p><strong>Company:</strong> Juego Studio</p><p><strong>E-Mail</strong> siddharth@juegostudio.com</p><p><strong>Message</strong> Hello ,\nGreetings!\nAre you looking to outsource any of your upcoming game design or development?\nI represent Juego Studios, we offer game design & development and AR/VR development services. We are a team of 150+ members and have worked on 200+ projects with some of the leading brands in the world like Animoca, Project Factory, Disney interactive studios, WB, etc…\nPlease have a look on our game-portfolio, https://vimeo.com/album/5000891\nLooking forward to understand your current development needs and how we can work together?\nThanks & Regards,\nSiddharth N\nBusiness Development Manager\nJuego Studio\nGR Grand Plaza, \nBengaluru, 560078\nwww.juegostudio.com</p>', 'SUCCESS', NULL, '2021-08-04 13:42:06', '2021-08-04 13:42:08', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
