INSERT INTO `tager_mail_logs` VALUES (124, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Башун Олег Гарикович</p><p><strong>Company:</strong> HAND</p><p><strong>E-Mail</strong> AlehBashun@gmail.com</p><p><strong>Message</strong> Реализация проекта HAND</p>', 'SUCCESS', NULL, '2021-08-05 08:56:10', '2021-08-05 08:56:13', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/tg\\/2c\\/tG2CgRBFBN.docx\",\"as\":\"\\u041f\\u0440\\u0435\\u043a\\u0442 HAND \\u0411\\u0430\\u0448\\u0443\\u043d \\u041e\\u043b\\u0435\\u0433 \\u0413\\u0430\\u0440\\u0438\\u043a\\u043e\\u0432\\u0438\\u0447 08 2021.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/tg\\/2c\\/tG2CgRBFBN.docx\"}]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (125, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Siddharth N</p><p><strong>Company:</strong> Juego Studio</p><p><strong>E-Mail</strong> siddharth@juegostudio.com</p><p><strong>Message</strong> Hi,\n\nHope you\'re doing well!!\n\nAre you looking to outsource any of your upcoming games design or development?\n\nJuego Studio, offers end-to-end solutions for game development companies. We are experienced in Unity3D, Cocos2d-X, PlayCanvas, Unreal, and well specialized in AR/VR solutions.\n\nFrom storyboarding, concept art to complete asset production, we provide stunning art and design services for games, VR & AR apps, simulations and trailers.\n\nOur seasoned team of artists and programmers have delivered games for high profile studios like EA, WB, Disney, Century Fox, etc.\nI have shared few literatures; \nGame Portfolio; https://www.juegostudio.com/game-development-portfolio\n \nOur game deck: https://vimeo.com/showcase/5000891\n\nI’d love to discuss in detail how we can help you with your needs.\n\nRegards,\nSiddharth N\nBusiness Development Manager\nJuego Studio\nGR Grand Plaza, \nBengaluru, 560078\nwww.juegostudio.com</p>', 'SUCCESS', NULL, '2021-08-05 10:19:52', '2021-08-05 10:19:55', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (126, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Евгений Геннадиевич Сухомлинов</p><p><strong>Phone:</strong> +79684818179</p><p><strong>E-Mail:</strong> sk84life@list.ru</p><p><strong>Message:</strong> Здравствуйте, мне 27, я начинающий специалист в сфере 3D, мне очень хочется попробовать свои силы в настоящей студии, надеюсь вас заинтересуют работы с моего портфолио, и вы дадите мне шанс выполнить тестовое, что бы рассмотреть в качестве будущего кандидата в вашу студию.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-05 12:13:48', '2021-08-05 12:13:50', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/8f\\/qh\\/8fqHQ7lMj4.pdf\",\"as\":\"CV.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/8f\\/qh\\/8fqHQ7lMj4.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (127, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Кунаккужин Фаниль Газимьянович</p><p><strong>Phone:</strong> +79373514858</p><p><strong>E-Mail:</strong> kunakkuzhin1997@gmail.com</p><p><strong>Message:</strong> Здравствуйте, меня зовут Кунаккужин Фаниль. Занимаюсь 3D моделированием, скульптингом, анимацией и левел дизайном. Работаю в программах:\n- Autodesk Maya;\n- Unity;\n- Cinema 4D;\n- Blender;\n- Adobe Photoshop;\n- Adobe Premiere Pro;\n- Adobe Illustrator.\nМоделирую персонажей как с нуля, так и по заданным референсам или концептам, занимаюсь их ретопологией, текстурированием (PBR и Hand-Paint). Умею оптимизировать полигональные сетки модели, создаю UV-развертки, симуляции ткани, риггинг и анимацию персонажа. Помимо персонажей создаю окружение для игр – локации и объекты в ней. Быстро обучаюсь и осваиваю новые задачи. Хорошо рисую, леплю, знаю анатомию людей и животных. Имею высшее образование-магистр (красный диплом)-специализация - \"Дизайн среды\". Умею работать в команде и легко нахожу общий язык с коллегами.\nПрошел теоретический и практический курс обучения в Wargaming Academy (24.11.20-04.06.21) в ходе которого мы создали игру «Lose the Last» в команде из 8 человек. Моя роль в команде была 3d generalist, level designer и concept artist.\nПортфолио: https://www.artstation.com/fanil_kunakkuzhin\nРезюме: https://spb.hh.ru/resume/182082b3ff08fdf8f50039ed1f52..\nПочта: kunakkuzhin1997@gmail.com</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-05 16:54:33', '2021-08-05 16:54:36', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/wk\\/s4\\/WkS4Qjtm8w.pdf\",\"as\":\"\\u041a\\u0443\\u043d\\u0430\\u043a\\u043a\\u0443\\u0436\\u0438\\u043d \\u0424\\u0430\\u043d\\u0438\\u043b\\u044c \\u0413\\u0430\\u0437\\u0438\\u043c\\u044c\\u044f\\u043d\\u043e\\u0432\\u0438\\u0447.pdf\",\"mime\":\"application\\/pdf\",\