INSERT INTO `tager_mail_logs` VALUES (129, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Вячеслав</p><p><b>Phone:</b> +375293985948</p><p><b>E-Mail:</b> slavarsound@gmail.com</p><p><b>Message:</b> Добрый день. \n    Я занимаюсь саунд дизайном и сейчас нахожусь в поиске интересных проектов.  \nВозможно Вас заинтересует сотрудничество. Примеры моих работ Вы можете посмотреть на https://vimeo.com/slavarsound.\n    Спасибо, что уделили мне внимание. Хорошего дня.</p>', 'SUCCESS', NULL, '2021-08-06 10:24:41', '2021-08-06 10:24:44', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/4b\\/wv\\/4BWVkGLZfC.pdf\",\"as\":\"\\u0420\\u0435\\u0437\\u043d\\u0438\\u0447\\u0435\\u043d\\u043a\\u043e \\u0412\\u044f\\u0447\\u0435\\u0441\\u043b\\u0430\\u0432 - \\u0421\\u0430\\u0443\\u043d\\u0434 \\u0434\\u0438\\u0437\\u0430\\u0439\\u043d\\u0435\\u0440.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/4b\\/wv\\/4BWVkGLZfC.pdf\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (130, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Артем Назаренко</p><p><strong>Phone:</strong> 89097528913</p><p><strong>E-Mail:</strong> mindfriend8@gmail.com</p><p><strong>Message:</strong> Доброго времени суток, меня зовут Артём и я предлагаю свою кандидатуру на должность 3d художника/художника по персонажам. Сейчас нахожусь в процессе активной работы над своими навыками, и как следствие, своего портфолио. Прилагаю ссылку на него:\n https://www.artstation.com/wethevoodoopeople\nЖиву в Санкт-Петербурге, обучаюсь на заочном отделении СПбГУТ, закончил курс STYL от XYZ school, где мне дали основы 3d моделирования персонажей, а также толчок для последующего прогресса. Постоянно нахожусь в поисках новых методов моделирования, изучаю тонкости анатомии, а также пайплайн для ААА-проектов и синематиков. Буду очень рад работать с Вами! \nВ случае, если нужно будет выполнить тестовое задание - я полностью готов показать свои навыки. Отправляю вам файлы моей текущей работы, а также уже готовой, которую я сделал во время обучения на курсе от XYZ.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-06 16:44:54', '2021-08-06 16:44:57', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/0f\\/lz\\/0FLZaRXz82.pdf\",\"as\":\"Junior 3d artist.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/0f\\/lz\\/0FLZaRXz82.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
