INSERT INTO `tager_mail_logs` VALUES (133, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Сергей</p><p><strong>Phone:</strong> +79856465576</p><p><strong>E-Mail:</strong> roodpey@mail.ru</p><p><strong>Message:</strong> Добрый день! Компьютерной графикой начал заниматься 4 года назад. Прошел обучение в московской школе Scream School по программе 3D Дженералист. В настоящее время работаю в анимационной студии \"Паровоз\". Хочу перейти в GameDev. Работаю в программах Maya, Zbrush, Substance Painter. Портфолио https://www.artstation.com/roodpey</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-07 20:16:52', '2021-08-07 20:16:54', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/ep\\/yd\\/EPydQNIcqw.pdf\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435 3D Artist.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/ep\\/yd\\/EPydQNIcqw.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
