INSERT INTO `tager_mail_logs` VALUES (139, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Никита</p><p><strong>Phone:</strong> 89068354081</p><p><strong>E-Mail:</strong> zavalishin270701@mail.ru</p><p><strong>Message:</strong> Добрый день. Я люблю воплощать различные образы героев как из кино, так и брать за основу комиксы и книги. Занимаюсь созданием персонажей около 4-х лет. Недавно закончил курс от XYZ по созданию персонажа (STYL), вы можете увидеть результат в моем портфолио (персонаж-воин). Хорошо владею ZBrush, знаю Maya и 3Ds Max на базовом уровне. Также работаю в Substance painter, Marmoset, Photoshop. В основном занимался созданием моделей для 3D-печати под заказ(некоторые из них есть в моем портфолио). Мои навыки вы сможете оценить по данной ссылке: https://www.artstation.com/nikiti4444</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-12 11:25:56', '2021-08-12 11:25:58', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/c0\\/tj\\/C0tJesNp54.pdf\",\"as\":\"Resume.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/c0\\/tj\\/C0tJesNp54.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (140, 3, 'jobs@furylion.net', '2D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Вера Рудко</p><p><strong>Phone:</strong> +375333609773</p><p><strong>E-Mail:</strong> rudverse@gmail.com</p><p><strong>Message:</strong> Добрый день, FuryLion!\nМеня зовут Вера. Меня заинтересовала вакансия 2D Artist.\n\nУ меня есть опыт создания собственных небольших игр в Unity. Я занималась как технической частью проекта, так и визуальной.\nВладею полным пайплайном работы от скетча до финального рендера. Работаю с растровой и векторной графикой.\n\nМои работы собраны в портфолио: https://www.behance.net/verarudko\nРезюме прикрепляю к этому письму во вложении. Буду рада, если посмотрите и дадите фидбек. Также готова к выполнению тестового задания.</p><p><strong>Vacancy:</strong> 2D Artist</p>', 'SUCCESS', NULL, '2021-08-13 08:22:33', '2021-08-13 08:22:36', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/np\\/3d\\/nP3deY5SOi.pdf\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/np\\/3d\\/nP3deY5SOi.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
