INSERT INTO `tager_mail_logs` VALUES (147, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Алексей</p><p><strong>Phone:</strong> +380506367047</p><p><strong>E-Mail:</strong> uporotiylemur@gmail.com</p><p><strong>Message:</strong> Доброго времени суток!\nЯ, Алексей, в поисках проекта, в котором мог бы вырасти, как профессионал.\nВ данный момент подрабатываю в студии 3d moiler.\nЯ выпускник компьютерной академии \"Шаг\", в области 3д дизайна из Донецка.\nДипломным проектом был анимированный персонаж в программе Maya.\nhttps://www.artstation.com/uporotiy_lemur\nВ ссылке на мой артстейшен дипломный проект присутствует.\nМогу добавить, еще что прошел платно на продвинотом уровне курсы XYZ Draft punk, есть успехи.\nТак же я выполнил тестовst задание в различные проекты.\nОднако пока только работаю в студии 3D Moiler удаленно.\nНадеюсь на сотрудничество.\nИнтересно посмотреть тестовое задание. :)</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-17 11:20:23', '2021-08-17 11:20:25', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/ei\\/og\\/eIogLymAeF.png\",\"as\":\"final_icon.png\",\"mime\":\"image\\/png\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/ei\\/og\\/eIogLymAeF.png\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (148, 3, 'jobs@furylion.net', 'Intern Developer - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Антон</p><p><strong>Phone:</strong> +375295346842</p><p><strong>E-Mail:</strong> t0nsharp@yandex.by</p><p><strong>Message:</strong> Хочу связать жизнь с геймдевом. Работаю с Unity и языком программирования C#. Мне понравилась ваша компания и перспективы карьерного роста, и поэтому хочу попасть на стажировку с последующем трудоустройством.</p><p><strong>Vacancy:</strong> Intern Developer</p>', 'SUCCESS', NULL, '2021-08-17 20:59:13', '2021-08-17 20:59:15', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/0e\\/er\\/0eeRFhLXhE.docx\",\"as\":\"CV.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/0e\\/er\\/0eeRFhLXhE.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (149, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Чайчиц Сергей Васильевич</p><p><b>Phone:</b> +375295033006</p><p><b>E-Mail:</b> chaichits@mail.ru</p><p><b>Message:</b> Здравствуйте, увидел что вы ищете 3д художника и уверен, что смогу быть вам полезен, т.к. уже полтора года работаю на аутсорс студию swame art. В основном делали модели техники для отечественных варгеймов, но также подрабатывал на фрилансе, где удалось поучаствовать в создании синематика к азиатской ММО. Опыт в создании моделей для ААА проектов есть и я готов сделать тестовое. Быстро обучаюсь и хочу работать у вас. Основной софт который я сейчас использую - Blender, но переходил я на него с Maya и могу вспомнить навыки, если это необходимо. Также работаю в Substance painter, Zbrush, Marmoset, Marvelouse Designer. Прикрепляю коллаж с несколькими моими работами, если свяжетесь со мной смогу продемонстрировать модели техники которые я делал и другие работы. Спасибо за внимание.</p>', 'SUCCESS', NULL, '2021-08-18 08:53:23', '2021-08-18 08:53:25', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/6x\\/4p\\/6X4pKngyEn.jpg\",\"as\":\"MyCollages.jpg\",\"mime\":\"image\\/jpeg\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/6x\\/4p\\/6X4pKngyEn.jpg\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (150, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Алина</p><p><strong>Phone:</strong> +79817412531</p><p><strong>E-Mail:</strong> ali.anosova1704@gmail.com</p><p><strong>Message:</strong> Добрый день. Меня зовут Алина, мне 22 года. Я только начинаю осваивать 3D-моделирование. Владею программой Marvelous Designer и базово Photoshop. Закончила художественную школу. Очень нравится направления создания анимации и 3D-моделирования. Быстро учусь. Имеется небольшое портфолио с костюмами https://www.artstation.com/iamalina. Буду благодарна за совет, как начинающему, какие лучше пройти курсы или как лучше освоить программы для 3D-художника?\nЗаранее спасибо.\nС уважением, Аносова Алина</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-18 10:20:29', '2021-08-18 10:20:31', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/ma\\/pj\\/mapjnboKCn.png\",\"as\":\"\\u043a\\u043e\\u0441\\u0442\\u044e\\u043c.png\",\"mime\":\"image\\/png\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/ma\\/pj\\/mapjnboKCn.png\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (151, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Глеб</p><p><strong>Phone:</strong> 89174151638</p><p><strong>E-Mail:</strong> gl.gu1@yandex.ru</p><p><strong>Message:</strong> Здравствуйте! \nЯ занимаюсь созданием game-ready 3D моделей и хотел бы присоединиться к команде FuryLion в качестве 3D художника. \n\nВ работе использую: Blender, Zbrush, Maya, Marmoset Toolbag, Substance Painter, Substance Designer, Unreal Engine. \n\nЕсли данная вакансия актуальна, то буду рад обсудить подробности и выполнить тестовое задание.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-18 14:36:07', '2021-08-18 14:36:09', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/vf\\/mb\\/VFmBz5oeTE.pdf\",\"as\":\"\\u0413\\u043b\\u0435\\u0431 \\u0413\\u0443\\u0441\\u0435\\u0432 3D Artist.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/vf\\/mb\\/VFmBz5oeTE.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (152, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Михаил</p><p><strong>Phone:</strong> 89049115798</p><p><strong>E-Mail:</strong> skeggi69@gmail.com</p><p><strong>Message:</strong> @neznaikin_v_3d</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-19 09:38:53', '2021-08-19 09:38:55', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/2p\\/wz\\/2pWZTRz12K.jpg\",\"as\":\"Screenshot_2021-08-19-12-38-44-476_com.instagram.android.jpg\",\"mime\":\"image\\/jpeg\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/2p\\/wz\\/2pWZTRz12K.jpg\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (153, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Алексей Колупаев</p><p><strong>Phone:</strong> +79127008238</p><p><strong>E-Mail:</strong> montehkaa@mail.ru</p><p><strong>Message:</strong> Здравствуйте!\nИщу работу 3D художником (предпочтительно character artist).\n\nМеня заинтересовала ваша вакансия, так как я имею огромное желание работать в игровой индустрии и участвовать в создании качественных игр.\n\nЯ сам геймер, поэтому имею представление о том, что хотел бы видеть игрок. Обладаю опытом и навыками создания персонажа от идеи до готовой модели, high poly и low poly. Проходил курсы (XYZ, Knower school), также совершенствую свои навыки в процессе работы. В своих моделях делаю упор на стилизацию с хорошей детализацией (примеры работ приложены в резюме).\nМое портфолио unicorndead.artstation.com\nСпасибо за уделённое время, буду рад сотрудничеству!\nС уважением, Алексей.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-20 08:31:36', '2021-08-20 08:31:38', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/wu\\/0c\\/wU0C9dhVF8.pdf\",\"as\":\"\\u041a\\u043e\\u043b\\u0443\\u043f\\u0430\\u0435\\u0432 \\u0410\\u043b\\u0435\\u043a\\u0441\\u0435\\u0439 \\u0410\\u043b\\u0435\\u043a\\u0441\\u0430\\u043d\\u0434\\u0440\\u043e\\u0432\\u0438\\u0447 (1).pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/wu\\/0c\\/wU0C9dhVF8.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (154, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Дмитрий</p><p><b>Phone:</b> +375295952897</p><p><b>E-Mail:</b> ratlinzx@gmail.com</p><p><b>Message:</b> Здравствуйте, меня зовут Дмитрий я 3Dхудожник. \nИмею опыт в создании моделей для казуальных (и не только) игр в различных стилистиках. А также под AR\\VR и 3D печать.\nНиже ссылка на мое портфолио, резюме и почту для связи.\nПортфолио: ratlin.artstation.com\nРезюме: https://drive.google.com/file/d/1dZu-4q1NEtHqhvsAKGSIyUaKnwx_lUBP/view?usp=sharing\nКонтакты: ratlinzx@gmail.com\nДоброго вам дня.</p>', 'SUCCESS', NULL, '2021-08-20 09:49:40', '2021-08-20 09:49:42', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/rx\\/vp\\/rxVp8Roue5.pdf\",\"as\":\"Rezume_Dzmitry_Kalatushkin.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/rx\\/vp\\/rxVp8Roue5.pdf\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (155, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Дмитрий</p><p><b>Phone:</b> +375295952897</p><p><b>E-Mail:</b> ratlinzx@gmail.com</p><p><b>Message:</b> Здравствуйте, меня зовут Дмитрий я 3Dхудожник. \nИмею опыт в создании моделей для казуальных (и не только) игр в различных стилистиках. А также под AR\\VR и 3D печать.\nНиже ссылка на мое портфолио, резюме и почту для связи.\nПортфолио: ratlin.artstation.com\nРезюме: https://drive.google.com/file/d/1dZu-4q1NEtHqhvsAKGSIyUaKnwx_lUBP/view?usp=sharing\nКонтакты: ratlinzx@gmail.com\nДоброго вам дня.</p>', 'SUCCESS', NULL, '2021-08-20 09:50:34', '2021-08-20 09:50:36', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/at\\/io\\/AtIo1rdf79.pdf\",\"as\":\"Rezume_Dzmitry_Kalatushkin.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/at\\/io\\/AtIo1rdf79.pdf\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (156, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Kirill</p><p><strong>Company:</strong> AppGreat</p><p><strong>E-Mail</strong> kirill@app-great.com</p><p><strong>Message</strong> Good afternoon! \n\nI\'m Kirill from AppGreat - mobile apps promotion agency. We are more than 6 years on the market, giving cool traffic for iOS/Android applications around the world.\n\nWe work with incentive traffic(keywords, reviews, ratings, ASO, trending searches), non-incentive (MT, Fb, Adwords, InApp, RTB...), and also know how to attract 100% organic to android and how to bring the application to the TOP 1-3 in the USA with a guarantee for iOS.\n\nWe can raise you to the TOP 1-3 with holding the position for 7 days for the keywords no wifi games and others. We have successful cases.\n	\nI am writing to offer loyal conditions for promotion and work with us.\n	\nI propose moving on to a more detailed discussion.\nWaiting for feedback!\n\nRegards,\nKirill Alimpiev\ntelegram: @A_Kirill17\nskype: kirill@app-great.com\ne-mail: kirill@app-great.com</p>', 'SUCCESS', NULL, '2021-08-20 13:03:31', '2021-08-20 13:03:32', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (157, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Владимир</p><p><strong>Phone:</strong> +79859665474</p><p><strong>E-Mail:</strong> Tsyrentarov.VS@gmail.com</p><p><strong>Message:</strong> Добрый день!\n\nВ 2018 году закончил интенсив в Scream School (Британская высшая школа дизайна) по цифровой иллюстрации (традиционка + Photoshop), где обучали основам рисунка, концепту окружения, концепту персонажа, Matte Painting.\nВ декабре 2020 закончил курсы в Центре \"Профессионал\" по моделированию, анимации, частицам tyFlow в 3Ds Max. Летом 2020 прошел небольшой бесплатный вводный курс по Blender, а расширенный курс по Blender прошел в начале января 2021.\nОпыта работы в данной сфере нет, но имеется желание расти и развиваться. С 3D работал лишь с продуктовой визуализацией по заказам. А в геймдеве был лишь специалистом ручного тестирования в 2007-2008 в Sibilant Interactive и Primal Software.\n\nТекущее портфолио по категориям имеется тут - https://www.artstation.com/truepack\n\nК сожалению, работ не так много, как хотелось бы, так как работал в другой сфере.\n\nСпасибо!\n\nС уважением, Цырентаров Владимир</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-21 00:27:22', '2021-08-21 00:27:24', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/cu\\/tc\\/CUtcmOJPxj.pdf\",\"as\":\"\\u0426\\u044b\\u0440\\u0435\\u043d\\u0442\\u0430\\u0440\\u043e\\u0432 \\u0412\\u043b\\u0430\\u0434\\u0438\\u043c\\u0438\\u0440 \\u0421\\u0435\\u0440\\u0433\\u0435\\u0435\\u0432\\u0438\\u0447.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/cu\\/tc\\/CUtcmOJPxj.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (158, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Макшанова Галина Игоревна</p><p><strong>Company:</strong> Вологда</p><p><strong>E-Mail</strong> mgi2007@mail.ru</p><p><strong>Message</strong> Добрый день! Я профессиональный музыкант, пишу музыку в разных стилях, работаю по референсам, иногда под псевдонимом Alessa Shane. Ищу работу по созданию музыки для игр, новелл, рекламы... Буду рада, если обратите внимание на мою музыку.\n\nМоя страница ВК https://vk.com/alessashane\nСсылка на яндекс-диск: https://disk.yandex.ru/d/tPls5GRM8xGKIw?w=1</p>', 'SUCCESS', NULL, '2021-08-21 11:05:58', '2021-08-21 11:06:00', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (159, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Данил</p><p><strong>Phone:</strong> +79874230920</p><p><strong>E-Mail:</strong> danilvalitov@gmail.com</p><p><strong>Message:</strong> Здравствуйте\nМеня Зовут Данил\n\nПортфолио\nhttps://www.artstation.com/danilvalitov\n\n\nВ свободное время занимаюсь изучением 3D, в частности hard surface моделированием и планирую работать в сфере 3D и делать игры.\nМой обычный пайплайн \nMaya - ZBrush - RizomUV - Marmoset(запечка) - Substance Painter\nиногда  начинаю во Fusion360.\nОткрыт к изучению нового софта.\n\nНедавно делал модель трапа для самолета в проекте\n\"Noch\" от Fair Games Studio\nhttps://store.steampowered.com/app/1363360/Noch/?curator_clanid=33028840\n\nCсылка на саму модель\nhttps://www.artstation.com/artwork/lx2KKJ\n\nПочти все модели в портфолию так же сделаны под геймдев\n\nК релокации в Санкт-Петребург готов</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-22 09:20:11', '2021-08-22 09:20:13', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/b8\\/je\\/b8jErXy5uZ.docx\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/b8\\/je\\/b8jErXy5uZ.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (160, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Reza</p><p><strong>Company:</strong> Artsoluki</p><p><strong>E-Mail</strong> studio@artsoluki.com</p><p><strong>Message</strong> Dear Sir/Madam,\nI would like to take this opportunity to introduce you to The Artsoluki team, Artsoluki is a family team.\nArtsoluki is an illustration studio which is passionate about producing original and inspiring artwork.\nWe can create different and creative images and designs with stunning results for clients.\nArtsoluki guarantees unique creativity, reliability, cost effectiveness and delivery is assured once we have agreed to your deadline schedule.\nWe are happy to see our portfolio.\nIf you are interested in working with us, send a written brief with as many details as possible about your project including, the number, size and complexity of illustrations you require. Wherever you are in the world, we’ll get back to you within 24 hours.\nWe are looking forward to cooperating with you.\n\nKind Regards,\n\nReza Soluki\nOffice Manager\nThe Artsoluki Team\n\nwww.artsoluki.com\nwww.instagram.com/artsoluki/\ninfo@artsoluki.com</p>', 'SUCCESS', NULL, '2021-08-22 09:58:26', '2021-08-22 09:58:27', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (161, 3, 'jobs@furylion.net', 'Middle Game Designer - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Анастасия</p><p><strong>Phone:</strong> +79254321945</p><p><strong>E-Mail:</strong> emptyskiff@gmail.com</p><p><strong>Message:</strong> Добрый день! \n \nМеня зовут Анастасия Пацанкова. Заинтересовала ваша вакансия гейм-дизайнера! \n \nЯ с отличием окончила НИУ ВШЭ по направлению \"Гейм-дизайн и виртуальная реальность\", в данный момент нахожусь в поиске работы по специальности для дальнейшего получения практического опыта. \n \nИмею опыт создания игровых механик, составления документации, расчета баланса. Работала в Unity и UE4. Имею навык работы в команде — при создании совместных проектов сотрудничала с программистами, концепт-художниками, 3D-художниками, саунд-дизайнерами и другими гейм-дизайнерами. Имею опыт составления технических заданий. \n \nМеня заинтересовали ваши проекты и компания, хотела бы предложить свою кандидатуру и больше узнать о работе. \n \nСпасибо за рассмотрение моего отклика, надеюсь на дальнейшее сотрудничество с вами!</p><p><strong>Vacancy:</strong> Middle Game Designer</p>', 'SUCCESS', NULL, '2021-08-23 16:48:19', '2021-08-23 16:48:21', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/cx\\/rf\\/CXRFDXyU2p.pdf\",\"as\":\"RESUME.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/cx\\/rf\\/CXRFDXyU2p.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (162, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Максим</p><p><strong>Phone:</strong> 89128739579</p><p><strong>E-Mail:</strong> mk.lap@mail.ru</p><p><strong>Message:</strong> Здравствуйте! \n\nМеня зовут Максим, я ищу работу на должности 3d-моделлера.\n\nСейчас нахожусь в процессе прохождения курса анатомии и дизайна персонажей. Курс ведет Терехов Павел https://www.artstation.com/goodatom\nВыбор этого курса основан на желании развиваться как художник по персонажам. Мне нравится создавать персонажей, воплощать их в 3D, анимировать и смотреть, как они оживают.\n\nОдна из целей сейчас, конечно же, найти работу в сфере gamedev и заниматься любимым делом в команде опытных специалистов.\n\nМоё портфолио: ArtStation: https://www.artstation.com/marso_mars \nInstagram: @marso_mars.studio\n\nБуду рад сотрудничеству!\n\nХарин Максим</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-23 19:45:04', '2021-08-23 19:45:06', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/sd\\/yb\\/SdybUfdwCa.pdf\",\"as\":\"Kharin_Maxim_RUS.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/sd\\/yb\\/SdybUfdwCa.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (163, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Вадим</p><p><strong>Phone:</strong> 89111217161</p><p><strong>E-Mail:</strong> vellsvadimala@gmail.com</p><p><strong>Message:</strong> Здравствуйте! \nМеня зовут Вадим, мне 18 лет.\nСейчас я учусь в Skillbox на 3d Generalist, и очень хотел бы работать в геймдеве. \nВ этом плане меня очень заинтересовала ваша компания. \n\nУ меня есть свой профиль на артстейшен: https://www.artstation.com/shizofeniy. \nТам вы сможете увидеть примеры моих работ. \nКроме того, сейчас я работаю над крутейшим пистолетом. \n\nГотов пройти ваше обучение , и работать в вашей компании как профессионал.\n\nНа данный момент я уже почти полностью освоил и знаю функционал Maya, а также владею базовыми знаниями пользования таких программ, как Substance Painter, Marmoset Toolbag и постепенно погружаюсь в Photoshop. \n\n+ Я легко обучаем и мега-перспективен. \n+ При себе имею мощный ноутбук, на котором и создаю свои текущие проекты. \n+ Есть опыт и знания в видеоиграх, киберспорте в целом. Поэтому я готов делиться молодежным взглядом на те или иные задачи.\n\nЯ, действительно, горю желанием работать в вашей компании. \nПро себя могу сказать, что я:\n• ответственный,\n• пунктуальный,\n• терпеливый,\nВ моей голове полно креатива. \n\nРаботу ищу на постоянной основе (а может и подработку, смотря как вы меня рассмотрите) именно здесь, потому что в Питере хорошо развита гейм индустрия. \n\nЯ готов к работе в команде с большими профессионалам (я осознаю весь уровень и спрос), чтобы в дальнейшим и самому стать первоклассным профессионалом.\n\nГотов обучится на вашем курсе , и показать отличный результат , и в последствии работать у вас крутым джуниором)</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-24 08:06:10', '2021-08-24 08:06:13', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/kc\\/jv\\/kcJV0OeSIC.pdf\",\"as\":\"Resume.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/kc\\/jv\\/kcJV0OeSIC.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (164, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Алена Алексеевна Клевцова</p><p><strong>Phone:</strong> +79103609079</p><p><strong>E-Mail:</strong> klevcova-alena99@mail.ru</p><p><strong>Message:</strong> http://t91036de.beget.tech/</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-24 15:03:33', '2021-08-24 15:03:35', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/4s\\/9s\\/4S9s9gnuba.png\",\"as\":\"Rezume.png\",\"mime\":\"image\\/png\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/4s\\/9s\\/4S9s9gnuba.png\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (165, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Анастасия Филиппова</p><p><strong>Phone:</strong> 89215753401</p><p><strong>E-Mail:</strong> nastya_filippova_1999@mail.ru</p><p><strong>Message:</strong> Здравствуйте! Меня зовут Анастасия, мне 22 года, я закончила СПбПУ по направлению информационный дизайн.\nОпыт работы - стажировка, во время которой проводилась работа над проектом геймификации образования (занималась созданием 3D моделей для локации, их оптимизацией, созданием виджетов). Имею опыт создания моделей, с пониманием пайплайна: от создания low-poly модели или скульпта по референсам, до внедрения ее в UE4. Примеры работ размещены в резюме, на ArtStation пока что лежит только моя выпускная работа.\nЯ хотела бы узнать, возможен ли вариант стажировки в вашей компании или есть ли открытые вакансии для junior-специалиста?</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-24 19:42:04', '2021-08-24 19:42:06', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/ip\\/nl\\/IpNlgnSagb.pdf\",\"as\":\"resume_filippova.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/ip\\/nl\\/IpNlgnSagb.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (166, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Muchkin</p><p><strong>Company:</strong> Muchkin</p><p><strong>E-Mail</strong> muchkinofficial@gmail.com</p><p><strong>Message</strong> Привет! У вас крутые проекты. Хотел сказать, что если вдруг вам понадобится композитор — я буду рад сотрудничать. Вот мой шоурил: https://youtu.be/38kqaetdHL4\n\nПортфолио: https://soundcloud.com/muchkinmusic/sets\n\nСайт с отзывами разработчиков: www.muchkinmusic.com\n\nЯ хорошо умею создавать атмосферу и настроение, работаю в основном в электронных жанрах, хотя открыт для любых предложений.\n\nМои расценки — 60-120$ за минуту музыки в зависимости от сложности.</p>', 'SUCCESS', NULL, '2021-08-25 09:30:51', '2021-08-25 09:30:54', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (167, 3, 'jobs@furylion.net', 'Project Manager - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Сергей</p><p><strong>Phone:</strong> +375298615480</p><p><strong>E-Mail:</strong> maurozarateakser@yandex.by</p><p><strong>Message:</strong> Добрый день, направляю свое резюме на должность проект-менеджера в Вашей компании. В сфере айти работаю уже более одного года в качестве сейлза с частичным выполнение функций проект-менеджера. До погружения в айти сферу на протяжении шести лет работал в продажах. На данный момент так же заканчиваю курсы TeachMeSkills в направлении проект-менеджер в айти. Имею огромное желание развиваться в качестве менеджера проектов. Буду рад оказаться в Вашей команде.</p><p><strong>Vacancy:</strong> Project Manager</p>', 'SUCCESS', NULL, '2021-08-25 12:05:29', '2021-08-25 12:05:32', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/6u\\/cn\\/6ucnD8JeMB.pdf\",\"as\":\"Sergei Akulov.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/6u\\/cn\\/6ucnD8JeMB.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (168, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Павел</p><p><strong>Phone:</strong> +79046357376</p><p><strong>E-Mail:</strong> proskurnya90@gmail.com</p><p><strong>Message:</strong> Добрый день!\n\nМеня зовут Павел и я нахожусь в поиске возможности начать карьеру в индустрии видеоигр. Ведь 30 лет это лучший возраст, чтобы исполнить мечту детства!\n\nНа данный момент я изучил полный пайплайн для создания game ready моделей. Всю основную работу по моделированию предпочитаю делать в Blender (драфт, HP, LP, UV и экспорт). На следующих этапах я использую Substance Painter для бейка и текстурирования. Кстати, неплохо знаю функционал Substance Designer. Для рендера и оформления подачи использую Marmoset Toolbag.\n\nЕсли хотите посмотреть портфолио, то вот ссылка на мои работы: https://www.artstation.com/araiguma\n\nВ самом резюме я подробно описал все скилы, которыми уже владею, ну а в далёком будущем (в далёкой далёкой галактике ...) я хочу стать художником по окружению. Поэтому, для начала, я готов часами раскладывать пивные банки и прочие пропсы по игровой локации ... вдумчиво и аккуратно! :)\n\nПрограммное обеспечение, которое я использую:\n- Blender 3D (или Maya)\n- Substance Painter\n- Substance Designer\n- Marmoset Toolbag\n- Adobe Photoshop\n- Unreal Engine 4\n- Unity Engine\n- Git\n\nУмею и хочу работать в дружном коллективе над общим проектом. Готов вкалывать как черт и впитывать знания от старших коллег! Пожалуйста, тестовое задание и я продемонстрирую свои навыки на практике.\n\nСпасибо.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-25 15:47:14', '2021-08-25 15:47:17', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/1x\\/kr\\/1xKrbDLhxY.pdf\",\"as\":\"\\u041f\\u0440\\u043e\\u0441\\u043a\\u0443\\u0440\\u043d\\u044f \\u041f\\u0430\\u0432\\u0435\\u043b \\u041e\\u043b\\u0435\\u0433\\u043e\\u0432\\u0438\\u0447.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/1x\\/kr\\/1xKrbDLhxY.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (169, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Илья</p><p><strong>Phone:</strong> +79685802990</p><p><strong>E-Mail:</strong> inscriborikimaru@gamil.com</p><p><strong>Message:</strong> Доброго дня. Я занимаюсь 3D 3 года. Начинал с моделей для 3D печати, сейчас уже знаю полностью пайплайн создания gameredy персонажей, ассетов, плэйнов. \nЧто я могу:\n- Скульпт высоко полигональных моделей. (Zbrush)\n- Моделинг лоуполи. (Zbrush, blender)\n- Ретоп. (3Dcoat, Maya)\n- UV-mapping (Blender, Maya)\n- Bake карт (Marmoset, Substance Painter, V-Ray, Arnold)\n- Текстуринг (Substance Painter и Handpaint в Photoshop)\n- Рендер\n\nСлабые стороны, чему еще учусь:\n- Создание реалтайм волос (Ornatrix, X-gen)\n- Анимация (могу, но пока что слабо Blender, Maya)\n- UE4\n\nВ индустрии я новичок. На мой предвзятый взгляд, заявленным вами требованиям соответствую. Так что буду рад с вами сотрудничать! \n\nПортфель: \nhttps://drive.google.com/drive/folders/15jEaf6TDG21gEb8QV4nhRipSIkHran3Z?usp=sharing\n\nhttps://www.artstation.com/chitsujo</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-25 16:40:14', '2021-08-25 16:40:16', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/4u\\/3q\\/4u3qoR4ScF.docx\",\"as\":\"\\u0421\\u0430\\u0432\\u0438\\u0446\\u043a\\u0438\\u0439 \\u0418\\u043b\\u044c\\u044f \\u0412\\u0438\\u043a\\u0442\\u043e\\u0440\\u043e\\u0432\\u0438\\u0447.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/4u\\/3q\\/4u3qoR4ScF.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (170, 3, 'jobs@furylion.net', '2D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Виталий</p><p><strong>Phone:</strong> +79114950557</p><p><strong>E-Mail:</strong> krikushik@gmail.com</p><p><strong>Message:</strong> Здравствуйте, хотел бы узнать, есть ли все же какая-то вероятность того, что вы рассмотрите заявку на удаленную основу, с радостью выполнил бы тогда тестовое задание. Спасибо!</p><p><strong>Vacancy:</strong> 2D Artist</p>', 'SUCCESS', NULL, '2021-08-25 17:56:23', '2021-08-25 17:56:26', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/ui\\/sh\\/uIshyFlfHf.pdf\",\"as\":\"CV 2d artist.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/ui\\/sh\\/uIshyFlfHf.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (171, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Ilia Tun</p><p><strong>Phone:</strong> +640212612031</p><p><strong>E-Mail:</strong> tunec.kht@mail.ru</p><p><strong>Message:</strong> https://iliatun.artstation.com/\nМеня зовут Илья Тун, и я подаю заявку на должность 3D-художника. Ранее в прошлом году я получил степень бакалавра в Media Design School в Окленде, Новая Зеландия, во время которой я принимал участие в нескольких игровых проектах в качестве Generalist 3D-художника, художника по персонажам и аниматора, технического художника и дизайнера уровней.\nО себе, я родом из Хабаровска, Россия, но живу в Новой Зеландии с 2013 года и всю свою жизнь играю в игры. Такие игры, как RTS (Stronghold, Hearts of Iron IV), Shooters (франшиза Call of Duty, франшиза Mass Effect) и RPG (Oblivion. Skyrim, Witcher, Dark Souls) навсегда сформировали мое восприятие и понимание видеоигр. Во время учебы в Media Design School я обнаружил в себе то, что вселило в меня уверенность, и то, что заставило меня осознать проблемы, требующие решения. Я постоянно поддерживаю себя в самосовершенствовании и укрепляю свои хорошие стороны.\nМои текущие цели - достичь уровня таких художников, как Tim Bergholz и людей в PaxelArt.\nЯ считаю, что у меня есть хороший потенциал, чтобы стать частью арт-команды и внести свой вклад в будущее вашего проекта.\nСпасибо, что рассмотрели мою заявку.\nИлья Тун</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-28 01:26:56', '2021-08-28 01:26:59', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/jo\\/mh\\/JOMhjO3M8Y.pdf\",\"as\":\"Ilia Tun CV03.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/jo\\/mh\\/JOMhjO3M8Y.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (172, 3, 'jobs@furylion.net', '2D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Анасатсия</p><p><strong>Phone:</strong> 89826181674</p><p><strong>E-Mail:</strong> okne4nap1@gmail.com</p><p><strong>Message:</strong> Здравствуйте! Очень заинтересовала ваша студия и проекты, над которыми вы работаете. Хотелось бы стать частью вашей команды. Готова выполнить тестовое задание, если требуется. Прикрепляю резюме. Я младший художник, поэтому готова всё своё свободное время тратить на работу и развитие в данном направлении. Для меня в первую очередь важен опыт и постоянная практика. Могу работать как над промо, так и с другими материалами.</p><p><strong>Vacancy:</strong> 2D Artist</p>', 'SUCCESS', NULL, '2021-08-28 18:02:04', '2021-08-28 18:02:06', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/il\\/3f\\/IL3frUCEjC.pdf\",\"as\":\"Resume_Anastasia.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/il\\/3f\\/IL3frUCEjC.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
