INSERT INTO `tager_mail_logs` VALUES (175, 3, 'jobs@furylion.net', 'Project Manager - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Кирилл Левчук</p><p><strong>Phone:</strong> +79992085792</p><p><strong>E-Mail:</strong> levchuk.k.e@gmail.com</p><p><strong>Message:</strong> Здравствуй дорогой HR. Меня зовут Кирилл и, в данный момент, я ПМ в аутсорсной IT-разработке. Пишу тебе с надеждой на рассмотрение моей кандидатуры в роли ПМ\'а в вашей компании, т.к. я уже долгое время горю идеей попасть в индустрию геймдева, какой бы сложной она ни была. \n\nВсю свою сознательную жизнь я провел бок о бок с видео-играми и страсть к ним до сих пор не угасла во мне. Я уверен, мы найдем о чем поговорить с тобой на первичном интервью, а больше информации обо мне можно узнать из CV.</p><p><strong>Vacancy:</strong> Project Manager</p>', 'SUCCESS', NULL, '2021-08-28 20:09:08', '2021-08-28 20:09:10', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/iq\\/fv\\/iqFvvkmlRQ.pdf\",\"as\":\"CV_Levchuk_KE.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/iq\\/fv\\/iqFvvkmlRQ.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (176, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Сергей</p><p><b>Phone:</b> +375257370381</p><p><b>E-Mail:</b> khram990@gmail.com</p><p><b>Message:</b> Здравствуйте.\nО себе, по образованию я архитектор, поэтому приходилось моделировать экстерьеры и интерьеры, но позже работал с разными проектами на фрилансе и делал и оружие, одежду, персонажей, предметы интерьера (работал над VR проектами)рисовал руками, делал 2д контент, игры под андройд, обработка видео, монтаж, видео презентации и видео рекламы\n\nCV: https://drive.google.com/open?id=1AXJLXhree6oaih2fPAMyiszscibBCeSY\nPortfolio: https://drive.google.com/open?id=1nV7d9KVWOtldYq4-RCqtu-3wg2bV2Uht\nhttps://www.artstation.com/khram\nhttps://sketchfab.com/khram990/models\nhttps://www.instagram.com/khram_solo\nhttps://www.youtube.com/channel/UCCStv62Um5KPLPDGbP6mQBg/videos\n\nИз последних работ по актуальности не могу сбросить так как занимался разработкой под виртуальную реальность и на прошлой работе.\n\nТелеграм @Khram_solo\n\nОчень хотел бы с вами работать</p>', 'SUCCESS', NULL, '2021-08-30 18:06:12', '2021-08-30 18:06:14', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/yo\\/zq\\/yozqes7WCc.pdf\",\"as\":\"\\u0425\\u0440\\u0430\\u043c\\u043e\\u0432 \\u0421\\u0435\\u0440\\u0433\\u0435\\u0439 \\u041d\\u0438\\u043a\\u043e\\u043b\\u0430\\u0435\\u0432\\u0438\\u0447.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/yo\\/zq\\/yozqes7WCc.pdf\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (177, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Богдан</p><p><strong>Phone:</strong> 89522061068</p><p><strong>E-Mail:</strong> shihovbogdan@gmail.com</p><p><strong>Message:</strong> Мне 25 лет и всю сознательную жизнь я увлекаюсь рисованием и видеоиграми. 1.5 года назад я узнал о Zbrush и возможностях которые он предоставляет. Одним из моих увлечений уже был скульптинг в традиционных медиа, и возможность делать это в цифре поражало разум. С тех пор уже больше года свое свободное время я посвещаю 3д моделированию. Освоил Blender, общие техники и фундаментальные знания . изучил мат часть по созданию гейм реди персонажей и ассетов. Вникаю в ретопологию и текстуринг в substance.  эксперементиую и постоянно ищу себя в cg, но ближе всего для меня по прежнему остается персонажное моделирование. В данный момент я периодически беру заказы на модели для 3д печати, и мечтаю прикоснуться к геймдеву. В данный момент я завершаю работу на текущем месте и Хочу попасть на стажировку в вашу студию на направление анатомии.\nзаранее простите за ломаный PDF. \nСсылка на портфель: bravedonkeybo.artstation.com</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-08-31 00:46:10', '2021-08-31 00:46:12', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/u4\\/1r\\/u41R2IpMQv.pdf\",\"as\":\"Curriculum vitae.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/u4\\/1r\\/u41R2IpMQv.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (178, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Дмитрий</p><p><b>Phone:</b> +79500324252</p><p><b>E-Mail:</b> gusevdmitriik@gmail.com</p><p><b>Message:</b> Здравствуйте!\n  Я долгое время слежу за Вашей студией и восхищаюсь проектами, ассеты для которых Вы делали - особенно TES Online. Я очень хочу влиться в команду таких профессионалов - для этого я готов учиться и работать столько, сколько потребуется. Надеюсь, для меня найдется место в команде FuryLion!\n  С уважением, Гусев Д. К.</p>', 'SUCCESS', NULL, '2021-08-31 06:51:54', '2021-08-31 06:51:56', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/fw\\/qq\\/FWqQ8oldls.pdf\",\"as\":\"\\u0413\\u0443\\u0441\\u0435\\u0432 \\u0414\\u043c\\u0438\\u0442\\u0440\\u0438\\u0439 \\u041a\\u043e\\u043d\\u0441\\u0442\\u0430\\u043d\\u0442\\u0438\\u043d\\u043e\\u0432\\u0438\\u0447_3D Artist.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/fw\\/qq\\/FWqQ8oldls.pdf\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
