INSERT INTO `tager_mail_logs` VALUES (182, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Федотов Николай</p><p><strong>Phone:</strong> +375259208860</p><p><strong>E-Mail:</strong> fedotov2002nikolai@gmail.com</p><p><strong>Message:</strong> Здравствуйте, умоляю, дайте возможность доказать, что я могу быть вам полезен. Я уже давно создаю модели, и у меня получается всё лучше и лучше! Мне нужно ещё получить опыт от профессионалов. Я видел у вас курсы есть, готов их все пройти, лишь бы вам понравится. + вскоре закончу курсы \"My Freedom\".\nРаботаю в таких программах: 3Ds Max, 3D Maya, Substance Painter, Zbrush, Marmoset Toolbag, Adobe Photoshop. \nПортфолио: https://disk.yandex.by/d/6eT22Tcxj6XqZw\nArtStation: https://www.artstation.com/mikolkaz\n\nПрошу, дайте шанс, я готов на всё, лишь бы быть с вами, если понадобится, я душу продам!</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-03 13:58:07', '2021-09-03 13:58:09', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/z8\\/po\\/Z8PoTXotxe.pdf\",\"as\":\"\\u0440\\u0435\\u0437\\u044e\\u043c\\u0435.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/z8\\/po\\/Z8PoTXotxe.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (183, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Александр</p><p><b>Phone:</b> +79873781227</p><p><b>E-Mail:</b> a.zhibalov@mail.ru</p><p><b>Message:</b> Добрый день! Не смотря на непрофильный опыт работы, имею огромную вовлеченность в видеоигровую индустрию (около 25 лет видеоигр за плечами). Имею небольшой опыт написания сценариев (участвовал в конкурсе). Так же сейчас работаю над собственным сценарием для метроидвании.</p>', 'SUCCESS', NULL, '2021-09-04 18:51:28', '2021-09-04 18:51:29', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/6f\\/wu\\/6fWUz6kWPO.docx\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/6f\\/wu\\/6fWUz6kWPO.docx\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
