INSERT INTO `tager_mail_logs` VALUES (186, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Мухаметшин Денис (freedomfighter)</p><p><b>Phone:</b> 79117163501</p><p><b>E-Mail:</b> mukhametshinfilm@gmail.com</p><p><b>Message:</b> Прикрепил сопроводительное письмо и ссылку на портфолио.</p>', 'SUCCESS', NULL, '2021-09-07 10:24:20', '2021-09-07 10:24:24', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/qj\\/mb\\/QjmBnqoEwO.pdf\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435_Freedomfighter.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/qj\\/mb\\/QjmBnqoEwO.pdf\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (187, 3, 'jobs@furylion.net', 'Unity Developer - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Александр</p><p><strong>Phone:</strong> 89111875767</p><p><strong>E-Mail:</strong> achasovskih1994@gmail.com</p><p><strong>Message:</strong> Добрый день.\n\nМеня зовут Александр. На данный момент я работаю в сфере, не связанной с IT, однако уже на протяжении полугода я стремлюсь осуществить свою давнюю мечту – стать разработчиком игр. За это время я изучил основы языка программирования C#, ООП, пройдя онлайн-курсы Udemy и Skillbox. Помимо этого, я развиваю свои навыки программирования на платформах Unity Learn, YouTube. Также в обучении мне помогла книга Джозефа Хокинга «Unity в действии. Мультиплатформенная разработка на C#».\n\nОднако лучшее обучение – это работа над реальными проектами. \n\nНесмотря на то, что у меня мало опыта в программировании, я готов много, быстро и эффективно обучаться. К тому же, ввиду моей академической специальности «Информатика и вычислительная техника», я могу быстро адаптироваться и вникнуть в незнакомую мне область.\n\nБуду вам признателен за отклик на мое резюме.\n\nС уважением,\nАлександр Часовских</p><p><strong>Vacancy:</strong> Unity Developer</p>', 'SUCCESS', NULL, '2021-09-07 11:03:22', '2021-09-07 11:03:24', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/fj\\/bk\\/fJBk94NbpJ.pdf\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/fj\\/bk\\/fJBk94NbpJ.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (188, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Arman Seilov</p><p><strong>Phone:</strong> +77477458089</p><p><strong>E-Mail:</strong> aseilov220@gmail.com</p><p><strong>Message:</strong> Доброго дня.\nУвидел вашу вакансию и заинтересовался. В моём арсенале по софтам Zbrush, Blender3D, 3dsMax, Substance Painter, CLIP STUDIO и Photoshop. 3D графикой увлекаюсь с 2015 года, но не мог ею полноценно заниматься так как основной профиль был другой и приоритеты были направленны в другую сторону. В данный момент решил поменять профиль и заняться профессионально 3D графикой. Чтобы хоть как-то составить конкуренцию прошел с отличием курс Zbrush от ArtCraft CG School под наблюдением Артёма Гусака. В данный момент моё портфолио небольшое, но я имею уже хорошее представление всего пайплайна по созданию персонажей и оптимизации под игровые движки. Буду рад если рассмотрите меня как кандидата на прохождение курса / рабочее место. Если у вас возникли какие-либо вопросы, можете связаться со мной, буду рад ответить на все ваши вопросы.\nСпасибо за внимание.\nhttps://www.artstation.com/archtyrant - портфолио\n+7 747 7458089 (Phone, Whatsapp, Telegram)\naseilov220@gmail.com</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-07 12:06:54', '2021-09-07 12:06:56', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/fm\\/vu\\/fmVu5PVMYo.docx\",\"as\":\"CV_ARMAN SEILOV3 ENG.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/fm\\/vu\\/fmVu5PVMYo.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (189, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Анатолий</p><p><b>Phone:</b> +375445471447</p><p><b>E-Mail:</b> Anatolijyaki@gmail.com</p><p><b>Message:</b> Здравствуйте.\n\nМеня зовут Анатолий. \nЯ ищу вакансию джуниор QA. \n\nУ меня хоть и мало опыта, но за время учебы на курсах я прошёл полный цикл тестирования ВЕБ-приложения, начиная с написания тест-плана и заканчивая презентацией о проделанной работе заказчику. Так же я тестировал веб-сервисы. Развернул локальный сервер и тестировал на нем десктопные приложения. Через установку виртуальной машины тестировал и репортал баги приложения, установленного на убунту, которая была инсталлирована на виртуальную машину. Так же тестировал мобильное приложение, которое развернул в установленном android-studio.  Работал с базами данных и писал запросы с взаимодействием нескольких таблиц. Мой английский сейчас на уровне А2+, но я старательно его учу. \nО себе хочу сказать, что я быстро обучаюсь, о чем свидетельствует изучение и практика всего вышеперечисленного всего за 2 месяца. Я очень замотивирован на личное развитие и успех компании. И всегда отдаюсь работе на 100% и стараюсь на пользу компании, я думаю об этом говорит то, что за 10 лет работы я только один раз поменял место работы.\n\nС удовольствием расскажу о себе больше на собеседовании.</p>', 'SUCCESS', NULL, '2021-09-08 11:58:05', '2021-09-08 11:58:07', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/je\\/cc\\/jECcHFFSuQ.pdf\",\"as\":\"\\u0421V_QA_Anatolij_Yakubouskij.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/je\\/cc\\/jECcHFFSuQ.pdf\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (190, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Alex Martyn</p><p><strong>Phone:</strong> 89168044410</p><p><strong>E-Mail:</strong> mneenoty@gmail.com</p><p><strong>Message:</strong> На стажера</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-08 15:24:14', '2021-09-08 15:24:16', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/ba\\/lr\\/BalrHxaFVr.pdf\",\"as\":\"Digital \\u041c\\u0430\\u0440\\u043a\\u0435\\u0442\\u043e\\u043b\\u043e\\u0433.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/ba\\/lr\\/BalrHxaFVr.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (191, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Abdel BELBACHIR</p><p><strong>Company:</strong> Square Kids</p><p><strong>E-Mail</strong> abdel.belbachir@squarekids.fr</p><p><strong>Message</strong> Dear Team,\n\nWe are a content creation company which focus on Education through Gamification in VR/AR.\nWe are looking for a longterm partnership to create VR/AR short programs.\n\nWe already have a clear idea of what we want and we will provide you as much resources as needed\nto achieve goals we will set for you. ( scenario, 3D props and settings, clear instructions in video or PDF...) \n\nOur first content is a 3D VR program that you have to design for Oculus Quest/Quest 2 and working also \non SteamVR.\n\nSubject :\nIt\'s a trip through Solar System in a spaceship with educational content (texts, voices...).\nAn astronaut is the teacher and presents interactions and things to do. \nTo enhance Education you have to add 3 mini interactions breaks :\n- manipulating a few stuff and experiencing in the spaceship laboratory\n- playing a short ping-pong match (duration 4 minutes) with some gravity effects\n- a final mini escape game which serves as final assessment to check knowledge\nthat user learned, but in a fun way.\n\nWe want realistic scenes with 3D Props and settings that we will provide.\nTotal duration of program is about 20 minutes.\n\nThat\'s the first content of a long list if you give us good rates quality and diligence.\nWe estimate that work to about 3-4 weeks (debug phase not included).\n\nCan you give us estimate cost and deadline that you can ensure?\nIf deadline affect price, can you tell us too?\n\nWe can arrange a Zoom meeting/Google Meet to go on further details\n\nLooking forwards to get news from you\n\nKind regards,</p>', 'SUCCESS', NULL, '2021-09-08 16:32:36', '2021-09-08 16:32:37', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (192, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Timur</p><p><strong>Company:</strong> Kensana Entertainemnt</p><p><strong>E-Mail</strong> timurkartaev@kensana.com</p><p><strong>Message</strong> Hello, we are a mobile game company, called Kensana Entertainment. Currently, we are launching our project to a soft launch and we would like to discuss about playable ads with you.</p>', 'SUCCESS', NULL, '2021-09-09 12:27:18', '2021-09-09 12:27:20', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (193, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Константин</p><p><b>Phone:</b> 89107296822</p><p><b>E-Mail:</b> kostya-zhuk-10@mail.ru</p><p><b>Message:</b> Здравствуйте. Хочется обсудить дальнейшее трудоустройство. Заинтересовала ваша компания. \nРаботаю в сфере 3d около года - в основном делаю модели для печати.\nПортфолио - https://www.artstation.com/geelkim</p>', 'SUCCESS', NULL, '2021-09-10 06:47:28', '2021-09-10 06:47:30', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/tk\\/qr\\/Tkqr9lrkie.jpg\",\"as\":\"20200928_212405.jpg\",\"mime\":\"image\\/jpeg\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/tk\\/qr\\/Tkqr9lrkie.jpg\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (194, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Николай</p><p><strong>Phone:</strong> +79237025296</p><p><strong>E-Mail:</strong> nikolaevnv1994@mail.ru</p><p><strong>Message:</strong> Добрый день! Прошу рассмотреть мою кандидатуру на прохождение обучения \"Фентези оружие и доспехи\". \nПортфолио по ссылке ниже:\nhttps://www.artstation.com/niknv</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-10 12:00:59', '2021-09-10 12:01:02', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/th\\/oo\\/ThOoWzcHTB.pdf\",\"as\":\"\\u041d\\u0438\\u043a\\u043e\\u043b\\u0430\\u0435\\u0432 \\u041d\\u0438\\u043a\\u043e\\u043b\\u0430\\u0439 \\u0412\\u0430\\u0441\\u0438\\u043b\\u044c\\u0435\\u0432\\u0438\\u0447.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/th\\/oo\\/ThOoWzcHTB.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (195, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Artem Efimchik</p><p><strong>Company:</strong> RBL Labs</p><p><strong>E-Mail</strong> artem@locgame.io</p><p><strong>Message</strong> Добрый день! Меня зовут Артем, я Lead game producer в RBL Labs. Нам нужна помощь в создании арта для коллекционной карточной игры + промо видео к ней. В буквальном смысле нужно все: UI и анимации UI, 2D и 3D арт и анимации, VFX. Можете ли вы нам в этом помочь? Сообщите пожалуйста, если у вас есть возможность созвониться на следующей неделе для обсуждения скоупа и вашего капасити на ближайшее время. Спасибо!</p>', 'SUCCESS', NULL, '2021-09-11 20:58:53', '2021-09-11 20:58:54', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (196, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Иван</p><p><strong>Phone:</strong> +89034340422</p><p><strong>E-Mail:</strong> lavlinskiy.i@mail.ru</p><p><strong>Message:</strong> Интересует работа 3D-arist, знаю 3D пакеты Blender,​ Maya, имеются навыки Zbrush.​ Умею делать uv развертку, запекать карты нормалей. Создавать пропсы, low-poly и Hight-poly модельки.\nТекстурировал объекты в Substance painter или же в самом 3D Пакете.\nЯ очень организованный и дисциплинированный, трудолюбив,\nобщителен, инициативен. Стремлюсь к получению новых знаний и применение их на практике.\nТрепетно отношусь к выполнению рабочих обязанностей.\n\nhttps://www.artstation.com/lavlinskiy</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-12 10:23:04', '2021-09-12 10:23:06', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/mg\\/xn\\/mGxNk9xXEL.pdf\",\"as\":\"\\u0418\\u0432\\u0430\\u043d \\u041b\\u0430\\u0432\\u043b\\u0438\\u043d\\u0441\\u043a\\u0438\\u0439.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/mg\\/xn\\/mGxNk9xXEL.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (197, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Полина Чугунова</p><p><strong>Phone:</strong> 89163641259</p><p><strong>E-Mail:</strong> evans.polina@mail.ru</p><p><strong>Message:</strong> Здравствуйте,\nМеня зовут Полина.\nМне интересен ваш проект и творческие задачи.\nЯ хорошо владею графическими редакторами, также занимаюсь 3D.\nЯ творческий, целеустремлённый и ответственный человек.\nБолее подробную информацию обо мне вы можете узнать из моего резюме.\nПознакомьтесь с моим портфолио-https://evanspolina.wixsite.com/website\nПрошу вас рассмотреть меня в качестве кандидата.\n \nС уважением,\nПолина Чугунова.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-13 08:58:15', '2021-09-13 08:58:17', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/vk\\/24\\/VK246awasN.pdf\",\"as\":\"\\u041f\\u043e\\u043b\\u0438\\u043d\\u0430 \\u0427\\u0443\\u0433\\u0443\\u043d\\u043e\\u0432\\u0430 (2).pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/vk\\/24\\/VK246awasN.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (198, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Антон</p><p><strong>Phone:</strong> 89500042539</p><p><strong>E-Mail:</strong> Random_804@mail.ru</p><p><strong>Message:</strong> Приветствую! я начинающий 3d artist, хочу попробывать попасть к вам в команду, работаю в zbrush  более 2 лет и в данный период нахожусь на обучении maya, photoshop.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-13 10:45:13', '2021-09-13 10:45:15', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/cz\\/xk\\/CZXkB1yrFK.jpg\",\"as\":\"4ZklBlAT8bg.jpg\",\"mime\":\"image\\/jpeg\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/cz\\/xk\\/CZXkB1yrFK.jpg\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (199, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Сергей</p><p><strong>Company:</strong> Николаев</p><p><strong>E-Mail</strong> 7955301@gmail.com</p><p><strong>Message</strong> Добрый день, меня зовут Сергей.\nУвлекаюсь 3d моделированием больше года.\nХочется расти и развиваться в игровой индустрии.\nНет ли возможности пройти стажировку в вашей компании.\nЗаранее спасибо.\nСсылка на примеры работ\nhttps://freelance.ru/Numinorik</p>', 'SUCCESS', NULL, '2021-09-13 12:58:00', '2021-09-13 12:58:03', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/fg\\/ts\\/fgtS96QHSw.jpg\",\"as\":\"123-123-.jpg\",\"mime\":\"image\\/jpeg\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/fg\\/ts\\/fgtS96QHSw.jpg\"}]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (200, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Анастасия Борзёнкова</p><p><b>Phone:</b> 89208257301</p><p><b>E-Mail:</b> borzenkova.anastasia.igor.evna@gmail.com</p><p><b>Message:</b> Приветствую! Меня зовут Анастасия, я бы хотела предложить свою кандидатуру на должность Junior Product Analyst.\n\nВ настоящее время более 16 месяцев я являюсь маркетологом-аналитиком петербургского холдинга Adaurum. В группу компаний входят: медиабаинговое агентство “МедиаСтраус”, агентство performance-маркетинга AdAurum Performance, рекламная сеть в сфере недвижимости AurumRealty, а также система автоматизации и оптимизации рекламы в интернете EveryStraus. В мои обязанности для медиабаингового агентства, рекламной сети в сфере недвижимости и агентства performance-маркетинга входит ведение, анализ и оптимзация рекламных кампаний клиентов. Однако основной моей деятельностью здесь является разработка новых инструментов для системы автоматизации и оптимизации рекламы. Примеры разработанных мной инструментов: бид-менеджер для Google Ads, оптимизатор цены за конверсию для Яндекс.Директ, Google Ads, Facebook Ads, MyTarget, инструмент кластерного анализа аудитории, инструмент автоматической настройки ретаргетинга/ремаркетинга на основе анализа статистики по конверсионности, вовлеченности и стоимости обращения, динамический коллтрекинг с использованием собственной технологией, позволяющей снизить количество используемых подменных номеров. Разрабатываемые и внедряемые мной инструменты позволяют проекту претендовать на резидентство Инновационного центра “Сколково”.\n\nПо образованию я программный инженер, поэтому имею базовые знания языков программирования, например SQL и Python. До работы в AdAurum я 7 лет проработала репетиром и 5 лет занималась написанием студенческих зачетных работ, поэтому у меня есть хорошая математическая база.\nИспытываю большой интерес к гейм-индустрии, в частности, интересует изучение поведения игроков и влияния внешних факторов на продукт.\n\nЯ ответственный и добросовестный специалист, который любит учиться. Всего, чего не умею, готова оперативно освоить. Если дадите шанс, буду работать много и усердно.</p>', 'SUCCESS', NULL, '2021-09-13 13:00:03', '2021-09-13 13:00:05', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/du\\/oy\\/DuoYQa6yTK.pdf\",\"as\":\"\\u0410\\u043d\\u0430\\u0441\\u0442\\u0430\\u0441\\u0438\\u044f \\u0411\\u043e\\u0440\\u0437\\u0435\\u043d\\u043a\\u043e\\u0432\\u0430, CV.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/du\\/oy\\/DuoYQa6yTK.pdf\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (201, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Екатерина</p><p><strong>Phone:</strong> +375293936840</p><p><strong>E-Mail:</strong> myalina8@gmail.com</p><p><strong>Message:</strong> Здравствуйте. Я начинающий 3d художник и очень хотела бы пройти обучение по направлению Фэнтези оружие и доспехи. В 3d меня больше привлекает окружение и props, чем персонажи, что вы можете увидеть в моем портфолио https://www.artstation.com/katemyal\nСейчас я работаю в основном в 3d max и substance painter, но также изучаю Zbrush\nНа данный момент я живу в Минске, но имею российское гражданство и при успешном прохождение курса не имею ничего против переезда в Питер (и так езжу туда практически каждый год с 2015 года)\nСпасибо!</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-14 13:51:53', '2021-09-14 13:51:57', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/m7\\/pi\\/m7pIRaksmd.pdf\",\"as\":\"\\u041c\\u044f\\u043b\\u0438\\u043d\\u0430 \\u0415\\u043a\\u0430\\u0442\\u0435\\u0440\\u0438\\u043d\\u0430 \\u0410\\u043b\\u044c\\u0431\\u0435\\u0440\\u0442\\u043e\\u0432\\u043d\\u0430.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/m7\\/pi\\/m7pIRaksmd.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
