INSERT INTO `tager_mail_logs` VALUES (203, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Валерия Федорова</p><p><strong>Phone:</strong> 89244679088</p><p><strong>E-Mail:</strong> valeria.fedorova3dcg@gmail.com</p><p><strong>Message:</strong> Здравствуйте, меня зовут Валерия, я из Якутска и занимаюсь 3D в течении 2 лет, работала Junior 3D моделлером в местной компании Fntastic и инди команде Frozen Line над игровыми проектами. Собираюсь переезжать в Санкт-Петербург в конце октября и поэтому ищу работу. С радостью пройду стажировку в вашей компании\nhttps://www.artstation.com/isilven</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-15 07:56:55', '2021-09-15 07:56:58', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/g6\\/gr\\/G6gr2S8sqD.pdf\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435_\\u0412\\u0430\\u043b\\u0435\\u0440\\u0438\\u044f_\\u0424\\u0435\\u0434\\u043e\\u0440\\u043e\\u0432\\u0430_3D.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/g6\\/gr\\/G6gr2S8sqD.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (204, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Ильмира</p><p><strong>Company:</strong> OTUS онлайн-образование</p><p><strong>E-Mail</strong> i.ibragimova@otus.ru</p><p><strong>Message</strong> Здравствуйте! Нам очень важно создать качественный образовательный продукт, поэтому мы расширяем партнерскую программу и ищем ИРОВЫЕ СТУДИИ/DIGITAL-КОМПАНИИ для создания совместного проекта. Я хочу вам предложить стать нашим партнером.\n\nЧто такое ИНДУСТРИАЛЬНОЕ ПАРТНЕРСТВО?\n\n∙ Вы предоставляете задание, сформированное на реальных рабочих задачах. Наши студенты защищают проектную работу по этому заданию.\n\n∙ Мы открываем вам самостоятельный доступ к базе на полгода и возможность (по желанию) участвовать в защите работ студентов.\n\nКак следствие, вы можете первыми хантить лучших выпускников курса.\n\n∙ Пиар для вашей компании. Мы размещаем ваш логотип компании на странице курса. Наши маркетологи проводят рекламную кампанию курса в интернете.\n\nИ еще, давайте мы подробнее расскажем вам о продвижении HR-бренда.\n\nЕсли в трех словах, то что получает компания-партнер?\nДоступ к базе резюме наших студентов и выпускников;\nСкидку до 20% на обучение сотрудников вашей компании;\nПродвижение HR-бренда и продуктов вашей компании в ИТ сообществе. Буду Рада обратной связи!\n\nС уважением, Ильмира\nМенеджер по работе с ключевыми клиентами\nООО «Отус онлайн-образование»\nemail: i.ibragimova@otus.ru\nсайт: https://otus.ru/\nТелефон: 7 499 938-92-02 доб. 796\nМобильный телефон: +79393318796\nTelegram:@i_ilmira\nООО «ОТУС онлайн-образование»\n125167, г. Москва, Нарышкинская аллея., д. 5, стр. 2, офис 316</p>', 'SUCCESS', NULL, '2021-09-15 12:35:16', '2021-09-15 12:35:20', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (205, 3, 'jobs@furylion.net', '2D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Александр</p><p><strong>Phone:</strong> 80259692181</p><p><strong>E-Mail:</strong> denver13.09.1991@mail.ru</p><p><strong>Message:</strong> https://www.artstation.com/alexmardas</p><p><strong>Vacancy:</strong> 2D Artist</p>', 'SUCCESS', NULL, '2021-09-15 18:11:37', '2021-09-15 18:11:38', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/rf\\/dd\\/rfddgIWOZ4.pdf\",\"as\":\"Aleksandr_Mardas_resume.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/rf\\/dd\\/rfddgIWOZ4.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (206, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Виктория Витальевна Кулешова</p><p><b>Phone:</b> +79529931554</p><p><b>E-Mail:</b> vikakuleshova06@gmail.com</p><p><b>Message:</b> Здравствуйте, хочу предложить свою кандидатуру на позицию младшего геймдизайнера/нарративного геймдизайнера/проект-менеджера. Был небольшой опыт работы в команде на позиции геймдизайнера, также приходилось заниматься сценарием.  Для работы использовала гугл-документы (написание тз, сценариев, концептов и т.п.), трелло (контроль процесса и задач). Обучаюсь на курсах от skillbox. Стараюсь следить за игровой индустрией в целом, постоянно обогащаю багаж знаниями различными статьями, семинарами, вебинарами, книгами. Есть огромное желание попасть в сферу геймдева и делать крутые игры с профессионалами. Может возможно пройти стажировку в вашей студии? \n\nС нетерпением буду ждать вашего ответа. \n\nС уважением, Виктория.</p>', 'SUCCESS', NULL, '2021-09-16 06:10:56', '2021-09-16 06:10:58', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/bf\\/dn\\/BFdNSEW9Wy.docx\",\"as\":\"\\u041d\\u0430\\u0440\\u0430\\u0431\\u043e\\u0442\\u043a\\u0438.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/bf\\/dn\\/BFdNSEW9Wy.docx\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (207, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Эрик</p><p><strong>Phone:</strong> 89234263946</p><p><strong>E-Mail:</strong> divix807@gmail.com</p><p><strong>Message:</strong> Здравствуйте, меня зовут Эрик. \nГод назад начал самостоятельное изучение 3d в Blender.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-16 09:30:34', '2021-09-16 09:30:37', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/2d\\/au\\/2daURGqeGr.docx\",\"as\":\"\\u041f\\u043e\\u0440\\u0442\\u0444\\u043e\\u043b\\u0438\\u043e \\u0441 \\u0440\\u0430\\u0431\\u043e\\u0442\\u0430\\u043c\\u0438.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/2d\\/au\\/2daURGqeGr.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (208, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Павел Бочеров</p><p><strong>Phone:</strong> 89151607433</p><p><strong>E-Mail:</strong> pbocherov@mail.ru</p><p><strong>Message:</strong> Добрый день, меня зовут Павел. \n\nС января 2021 наткнулся на 4х дневный курс по Blender и тут все завертелось, понеслось. \nВ конце апреля понял, что с знаниями из ютуба и Blender я , серьезную, карьеру 3d моделлера не сделаю, поэтому купил\nкурс 3d generalist на Skillbox.\nПо одному из курсов в специальности, Maya c 0 до PRO, защитил итоговую работу и получил сертификат.\nХорошо владею Maya, Substance Painter, Zbrush. Знаю этапы пайплайна.\nНа данный момент, пока прохожу обучение, делаю сторонние проекты для портфолио.\n\nЗдесь можно посмотреть мои работы на Artstation https://sefferot.artstation.com/\nИ на стоках https://www.cgtrader.com/sefferot\n\nХочу, в дальнейшем, связать свою жизнь и карьеру с 3d.\nГотов выполнить тестовое задание.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-17 13:29:47', '2021-09-17 13:29:49', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/mn\\/96\\/mn96sSKsl1.png\",\"as\":\"\\u041f\\u0430\\u0432\\u0435\\u043b \\u0411\\u043e\\u0447\\u0435\\u0440\\u043e\\u0432 \\u041c\\u0410\\u0423\\u0410.png\",\"mime\":\"image\\/png\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/mn\\/96\\/mn96sSKsl1.png\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
