INSERT INTO `tager_mail_logs` VALUES (210, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Богдан</p><p><strong>Phone:</strong> 89148962886</p><p><strong>E-Mail:</strong> Bogdan_Merkell@mail.ru</p><p><strong>Message:</strong> Привет! Я занимаюсь 3d уже достаточно долго, но весь мой опыт был связан в основном с моделированием одежды. Примерно год назад я увлекся персонажкой и хочу развиваться в этом направлении. Поработать в хорошей организации среди творческих людей единомышленников моя мечта.))) Есть опыт во всех перечисленных программах, которые требуются к кандидату.  https://gdjob.pro/kabinet/resume/ резюме https://www.artstation.com/the_black_hose портфель. Готов переехать в другой город, меня не что не держит.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-19 11:00:58', '2021-09-19 11:01:01', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/sh\\/ij\\/ShIJbwLbxt.png\",\"as\":\"\\u041c\\u0435\\u0440\\u043a\\u0435\\u043b\\u044c.\\u0411.\\u0412 \\u0420\\u0435\\u0437\\u044e\\u043c\\u0435.png\",\"mime\":\"image\\/png\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/sh\\/ij\\/ShIJbwLbxt.png\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (211, 3, 'jobs@furylion.net', '2D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Любовь Борозна</p><p><strong>Phone:</strong> +375336671517</p><p><strong>E-Mail:</strong> lyuba.velocidade@gmail.com</p><p><strong>Message:</strong> Добрый день. Заинтересовала позиция 2d художника, ищу возможность развиваться в этом направлении. Люблю скетчить, придумывать персонажей,  хочу развивать скилл в качественной финализации картинки. Есть большой опыт работы дизайнером. Некоторые мои работы можно посмотреть на сайте: https://www.artstation.com/velocidade</p><p><strong>Vacancy:</strong> 2D Artist</p>', 'SUCCESS', NULL, '2021-09-19 16:07:38', '2021-09-19 16:07:41', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/7x\\/i9\\/7xI9L3mb81.txt\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435_\\u041b\\u044e\\u0431\\u043e\\u0432\\u044c_\\u0411\\u043e\\u0440\\u043e\\u0437\\u043d\\u0430.txt\",\"mime\":\"text\\/plain\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/7x\\/i9\\/7xI9L3mb81.txt\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
