INSERT INTO `tager_mail_logs` VALUES (215, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Святослав Павлюченко</p><p><strong>Phone:</strong> 89215977133</p><p><strong>E-Mail:</strong> atom102115@gmail.com</p><p><strong>Message:</strong> Здравствуйте!\nРанее писал на хх, просили дополнить свои работы likeness скульптом - так и сделал, но там не ответили. \nБуду признателен за обратную связь.\nСсылка на артстейшн: \nhttps://www.artstation.com/maniac_xyz\nГугл диск с wip-ами: https://drive.google.com/drive/folders/1HOdzTXSJ7FtN_VUsAolEqi2YmQSHhT4d?usp=sharing</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-20 21:44:26', '2021-09-20 21:44:28', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/gr\\/tp\\/gRtp0Hb6oN.pdf\",\"as\":\"Resume.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/gr\\/tp\\/gRtp0Hb6oN.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (216, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Гасан</p><p><strong>Phone:</strong> 89674095502</p><p><strong>E-Mail:</strong> gasan5502@bk.ru</p><p><strong>Message:</strong> Добрый день. \n\nЯ работаю графическим дизайнером, занимаюсь 3D моделированием в свободное от работы время, и есть огромное желание участвовать в разработке игр. \n\nОпыта в коммерческих проектах нет, но зато знаю полный пайплайн разработки моделей в игровой индустрии,  от HighPoly и LowPoly, до Bake и текстурирования.\n\n  Знаю такие программы как Blender (но могу выучить любой другой 3D пакет как Maya или 3DMax буквально за пару дней) , Marmoset, RisomUV, ZBrush, Substance Painter (и немного Substance Designer) принципы экспорта в движок Unreal Engine, но могу легко выучить все что требуется и для Unity.\nВот моё небольшое портфолио: \n\nhttps://www.artstation.com/gasan5502 \n\nhttps://www.behance.net/ggasan55021e26</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-20 22:15:33', '2021-09-20 22:15:35', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/zw\\/ge\\/ZWge628Cr7.jpg\",\"as\":\"IMG-20210921-WA0001.jpg\",\"mime\":\"image\\/jpeg\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/zw\\/ge\\/ZWge628Cr7.jpg\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (217, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Maksim</p><p><strong>Company:</strong> Vitus</p><p><strong>E-Mail</strong> maksimvitus@gmail.com</p><p><strong>Message</strong> Hello,\nSome days ago I found an information about your company and I was excited about things you are doing.\nСould you please take a look on my CV (attached)?\nHope to see you soon!\nThanks and Best regards,\nMaksim Vitus</p>', 'SUCCESS', NULL, '2021-09-21 09:55:54', '2021-09-21 09:55:57', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/mc\\/qs\\/mCqS0QgV0R.doc\",\"as\":\"CV_Maksim_Vitus.doc\",\"mime\":\"application\\/msword\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/mc\\/qs\\/mCqS0QgV0R.doc\"}]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (218, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Кирилл</p><p><strong>Phone:</strong> +79139697894</p><p><strong>E-Mail:</strong> K1riss@yandex.ru</p><p><strong>Message:</strong> Здравствуйте, хотелось бы у вас пройти обучение с дальнейшим трудоустройством. Есть огромное желание развиваться и совершенствоваться!</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-21 14:17:59', '2021-09-21 14:18:01', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/px\\/5i\\/PX5iQClWn9.rar\",\"as\":\"3D artist.rar\",\"mime\":\"application\\/x-rar\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/px\\/5i\\/PX5iQClWn9.rar\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (219, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Полина Чугунова</p><p><strong>Phone:</strong> 89163641259</p><p><strong>E-Mail:</strong> evans.polina@mail.ru</p><p><strong>Message:</strong> Здравствуйте!\nМеня зовут Полина.\nМеня заинтересовала данная вакансия.\nМне интересен творческий процесс и задачи.\nЯ хорошо владею графическими редакторами, также занимаюсь 3D.\nВ ссылке, которую я прикреплю ниже будет моё портфолио с 2D и 3D работами.\nhttps://evanspolina.wixsite.com/website\n\nБуду рада, если вы рассмотрите меня в качестве кандидата на данную позицию.\nС уважением, \nЧугунова Полина.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-21 14:25:24', '2021-09-21 14:25:25', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/vz\\/yl\\/vZyLhRIrTo.pdf\",\"as\":\"\\u041f\\u043e\\u043b\\u0438\\u043d\\u0430 \\u0427\\u0443\\u0433\\u0443\\u043d\\u043e\\u0432\\u0430 (2).pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/vz\\/yl\\/vZyLhRIrTo.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (220, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Дарья</p><p><strong>Phone:</strong> +79268641260</p><p><strong>E-Mail:</strong> dariamozglova@gmail.com</p><p><strong>Message:</strong> Добрый день!\nИмею небольшой опыт работы с 3D студиями (фриланс), а также разрабатываю инди-проект в небольшой команде\nУверенно владею следующими 3D пакетами: ZBrush, 3DS Max, Blender, Marvelous Designer, Substance Painter.\nТакже хорошо работаю в Photoshop, Illustrator. Имею несколько лоу-поли работ и хендпеинт-текстур в портфолио, также занималась созданием как персонажей, так и объектов окружения. Больше года обучалась академическому рисунку - хорошо знаю анатомию и принципы освещения. Создавала несколько текстур как для hard-surface моделей, так и для органики.\nГотова выполнить тестовое задание\n\nПортфолио\nhttps://www.canva.com/design/DAEowLs0mrg/WHqOthbadd75DDQ8PLfJtw/view?utm_content=DAEowLs0mrg</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-21 15:38:04', '2021-09-21 15:38:05', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/ft\\/ag\\/ftageWKERx.pdf\",\"as\":\"Shestakova_Darya.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/ft\\/ag\\/ftageWKERx.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (221, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Marcus Cenci</p><p><strong>Company:</strong> Lost Boys Interactive</p><p><strong>E-Mail</strong> mcenci@lostboysinteractive.com</p><p><strong>Message</strong> Hello Fury Lion. \n\nInterested in speaking with you about some possible external art work for an upcoming game we\'re in the early stages of development for.\n\nI\'m available this week to discuss if you are. Thanks.\n\nMarcus Cenci - Studio Art Director - Lost Boys Interactive</p>', 'SUCCESS', NULL, '2021-09-21 15:41:30', '2021-09-21 15:41:32', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (222, 3, 'jobs@furylion.net', '2D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Сицко Михаил</p><p><strong>Phone:</strong> +375336024424</p><p><strong>E-Mail:</strong> m.s.ph@yandex.ru</p><p><strong>Message:</strong> Здравствуйте, мне нравятся ваши проекты и компания (давно подписан в инстаграме) и хотел бы попросить рассмотреть мое портфолио и cv, возможно я мог бы вам быть полезен, хотел быть стать частью вашей команды.\nГотов выполнить тестовое задание.\n\nСсылка на портфолио в cv и ниже: https://www.artstation.com/hiswood</p><p><strong>Vacancy:</strong> 2D Artist</p>', 'SUCCESS', NULL, '2021-09-21 19:10:47', '2021-09-21 19:10:50', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/xk\\/vs\\/xkVswC3LWl.pdf\",\"as\":\"Sitsko_Mikhail_2D_artist_CV.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/xk\\/vs\\/xkVswC3LWl.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
