INSERT INTO `tager_mail_logs` VALUES (225, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Азамат</p><p><strong>Phone:</strong> 89188296909</p><p><strong>E-Mail:</strong> dziov-azamat@mail.ru</p><p><strong>Message:</strong> Молодой, общительный, трудолюбивый, усидчивый парень, по настоящему горю своим делом и влюблен в свой труд, из плюсов помимо знаний непосредственно софта, владею английским на довольно высоком уровне, очень хотел бы у вас работать.\nСсылка на портфолио ниже и в графе файлов:\nhttps://www.canva.com/design/DAEbZXIJ6wg/fp5HWaE8ok0Y58x4eVw1qQ/view?utm_content=DAEbZXIJ6wg&utm_campaign=designshare&utm_medium=link&utm_source=publishsharelink</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-22 16:17:08', '2021-09-22 16:17:11', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/3e\\/so\\/3eSowAUxhL.\",\"as\":\"zAM DESIGN\",\"mime\":\"application\\/octet-stream\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/3e\\/so\\/3eSowAUxhL.\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
