INSERT INTO `tager_mail_logs` VALUES (228, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Виктория</p><p><strong>Phone:</strong> 89137331649</p><p><strong>E-Mail:</strong> milka2158@gmail.com</p><p><strong>Message:</strong> Здравствуйте, я хотела предложить свою кандидатуру 3d художника, я умею работать в таких программах как zbrush, 3dcoat, blender3d, substance painter, marvelous design. Знаю полный пайплан создании игровой модели от создании high poly до ее оптимизации в low poly. Мое портфолио можно посмотреть на milka_404.artstation.com/</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-24 05:45:24', '2021-09-24 05:45:26', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/ck\\/ap\\/ckaPveQiX2.jpg\",\"as\":\"1632462309.jpg\",\"mime\":\"image\\/jpeg\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/ck\\/ap\\/ckaPveQiX2.jpg\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (229, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Анастасия-Владимира</p><p><b>Phone:</b> +79502289543</p><p><b>E-Mail:</b> berfild@gmail.com</p><p><b>Message:</b> Меня зовут Анастасия-Владимира, в данный момент я студентка первого курса СПБГУ направления Графический дизайн, корпус моего университа находится на 7й линии В.О. Я ищу подработку/работу с частичной занятостью, например, с 16:30 до 21-22 часов в определенные дни по договоренности, была бы очень рада также удаленному трудоустройству со свободным графиком. \nК сожалению у меня нет опыта работы, тем более в сфере гейм-дизайна и анимации, но я очень хочу развиваться в этом, несмотря на учебу. Мне необходима эта возможность, даже если сама вакансия не будет связана с анимацией и дизайном, но я смогу иногда наблюдать за работой - это было бы очень хорошо для меня.\nНесмотря на то, что у меня нет записей в трудовой книжке, я работала с людьми и могу отметить свои навыки:\n- опыт в верстке элементарных газет\n- видеосъемка и монтаж\n- закупка и доставка материалов\n- выполнение мелких поручений\n- работа с устройствами печати и сканирования\n- копирайтинг и рерайтинг\n- ведение страниц в социальных сетях\n- уборка/поддержка помещений\nПри возможности, хотела бы выполнить пробное задание-поручение (что касается творческих сфер). Готова к стажировке. Т.к я нахожусь в постоянном процессе обучения (не только университет, но и курсы), то мои навыки, соответственно, тоже будут улучшаться. \nБольшое спасибо за прочтение и за обратную связь!</p>', 'SUCCESS', NULL, '2021-09-25 19:13:03', '2021-09-25 19:13:05', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/ug\\/7g\\/ug7gT2I9vo.png\",\"as\":\"CV.png\",\"mime\":\"image\\/png\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/ug\\/7g\\/ug7gT2I9vo.png\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
