INSERT INTO `tager_mail_logs` VALUES (231, 3, 'jobs@furylion.net', 'Java Script Developer - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Владимир Кублицкий</p><p><strong>Phone:</strong> +375295196181</p><p><strong>E-Mail:</strong> kublitskiyvladimir@gmail.com</p><p><strong>Message:</strong> https://furylion.net/careers/javascript\n\nhttps://vanwilder199.github.io/cv/cv/</p><p><strong>Vacancy:</strong> Java Script Developer</p>', 'SUCCESS', NULL, '2021-09-26 10:35:27', '2021-09-26 10:35:29', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/yp\\/vc\\/YpvCgI43X3.pdf\",\"as\":\"cv.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/yp\\/vc\\/YpvCgI43X3.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (232, 3, 'jobs@furylion.net', '2D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Милена Козуб</p><p><strong>Phone:</strong> +79891407055</p><p><strong>E-Mail:</strong> kozubmilena@gmail.com</p><p><strong>Message:</strong> Добрый день, я художница, имею уже небольшой опыт в геймдеве\nРазрабатывала и создавала персонажей для визуальной новеллы\nВ портфолио я прикрепила работы разных стилей и скетч из проекта, так же фрагменты работ в процессе\nУмею подстраиваться под стиль, умею работать в векторной графике и на среднем уровне владею 3д, при необходимости использую в работе\nСама очень активно играю в игры, не только для удовольствия, но и, для того чтобы получать новые идеи и вдохновение\nГотова работать даже просто за опыт\nЗаранее спасибо за ответ</p><p><strong>Vacancy:</strong> 2D Artist</p>', 'SUCCESS', NULL, '2021-09-26 13:46:41', '2021-09-26 13:46:43', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/vz\\/c9\\/Vzc9cIuhVn.docx\",\"as\":\"Doc1.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/vz\\/c9\\/Vzc9cIuhVn.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (233, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Yachao Wang</p><p><strong>Company:</strong> miHoYo Shanghai</p><p><strong>E-Mail</strong> yachao.wang@mihoyo.com</p><p><strong>Message</strong> Hello there, \n\nI\'m Yachao the outsourcing BD from miHoYo Shanghai. I\'ve seen you on XDS and hope to know more about your studio. \nMy email is yachao.wang@mihoyo.com.  Look forward to your message.  Thank you.</p>', 'SUCCESS', NULL, '2021-09-27 08:15:54', '2021-09-27 08:15:56', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (234, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Roksolana</p><p><strong>Company:</strong> Miss Millies</p><p><strong>E-Mail</strong> roksolana@missmillies.co.uk</p><p><strong>Message</strong> Hi,\nWe are looking for a web game with an instant winner scenario, is there something you can do?\nThanks</p>', 'SUCCESS', NULL, '2021-09-27 09:54:09', '2021-09-27 09:54:11', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
