INSERT INTO `tager_mail_logs` VALUES (236, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Тюпышев Данил</p><p><strong>Phone:</strong> 89371541210</p><p><strong>E-Mail:</strong> danil2218@mail.ru</p><p><strong>Message:</strong> Здравствуйте, я являюсь начинающим 3D художником и имею огромное желание расти и развиваться как профессионал. С удовольсвиеем получил бы возможность присоединится к вашей команде. Подробнее о моих навыках можно узнать в прикрепленном  CV. Примеры моих работ можно посмотреть в моем профиле на artstation: https://www.artstation.com/user_c0d37g</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-27 16:23:54', '2021-09-27 16:23:56', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/xx\\/7x\\/xX7XhLsc2k.pdf\",\"as\":\"CV \\u0422\\u044e\\u043f\\u044b\\u0448\\u0435\\u0432 \\u0414.\\u041d.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/xx\\/7x\\/xX7XhLsc2k.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (237, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Roman Vikhorev</p><p><strong>Company:</strong> Night Moves</p><p><strong>E-Mail</strong> swetagamesnovel@gmail.com</p><p><strong>Message</strong> Здравствуйте!\nМеня зовут Роман, я член команды разработчика Night Moves, мы разрабатываем интерактивную новеллу на мобильники под названием Love Pass.\nВ команде более 10 человек, хотели обсудить с вами возможные варианты сотрудничества, ниже ссылки для обзора текущей версии игры и доп материалы.\nТестовый билд, версия 0.1.6, для обзора персонажей и диалогов:\nhttps://drive.google.com/file/d/1v6cfDxi4UHCjOoGbyrL4FYxQdjHz2X1Q/\nПрезентация об игре:\nhttps://drive.google.com/file/d/1L60IYErQ7WSO7yO89LxVmUO4ZdGsH8eg/\nПример анимации, которую мы хотим сделать по итогу:\nhttps://drive.google.com/file/d/1SiTEFAUmdSmIQ8Z80nGGt9hDREcuKVjs/\n\nС уважением, \nРоман \ntelegram: @roman_vortex\nskype: r.v.r.v.1</p>', 'SUCCESS', NULL, '2021-09-27 19:10:05', '2021-09-27 19:10:07', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
