INSERT INTO `tager_mail_logs` VALUES (239, 3, 'jobs@furylion.net', 'Intern Developer - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Артем</p><p><strong>Phone:</strong> 375333527773</p><p><strong>E-Mail:</strong> gilimov2artyom@gmail.com</p><p><strong>Message:</strong> Привет, студент 3го курса ПГУ, живу в 7ой общаге. Хочу попробовать стать юнити девом. Делал пару простых игр, знаю что такое git) Не знаю что писать в резюме поэтому да.</p><p><strong>Vacancy:</strong> Intern Developer</p>', 'SUCCESS', NULL, '2021-09-28 12:36:23', '2021-09-28 12:36:25', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/1t\\/n1\\/1tN1KCGHGy.pdf\",\"as\":\"CV.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/1t\\/n1\\/1tN1KCGHGy.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (240, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Антон</p><p><strong>Phone:</strong> +79112742665</p><p><strong>E-Mail:</strong> a.a.karasaev@gmail.com</p><p><strong>Message:</strong> Здравствуйте! Меня зовут Антон Карасаев и я хочу стать частью команды FuryLion.SPB в роли Junior 3D Artist. Я всегда любил видео игры и мне очень интересна возможность работы в творческом коллективе профессионалов, создающих проекты высочайшего уровня. Я стремлюсь развиваться в сфере 3D графики. Начинал изучение данной сферы с 3DS Max, однако в дальнейшем перешел на Maya. Изучал принципы создания игровых моделей, проходил специализированные курсы по полному пайплайну (DraftPunk от XYZSchool) и отдельно по текстурированию (SuperSubstance от VideoSmile), а также постоянно смотрю обучающие видео на YouTube и ArtStation. Умею создавать игровые модели по пайплайну и импортировать их в игровые движки.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-09-28 12:59:05', '2021-09-28 12:59:08', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/rk\\/jh\\/RkJhjBngLb.docx\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435 \\u041a\\u0430\\u0440\\u0430\\u0441\\u0430\\u0435\\u0432 \\u0410.\\u0410..docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/rk\\/jh\\/RkJhjBngLb.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
