INSERT INTO `tager_mail_logs` VALUES (244, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Александр</p><p><b>Phone:</b> +375293037315</p><p><b>E-Mail:</b> ali.aliaksandr@gmail.com</p><p><b>Message:</b> Добрый день,\n\nМеня зовут Александр, рад заочному знакомству 😊\nМогли бы вы рассмотреть мое резюме на позицию QA Engineer, я хотел бы стать частью вашей команды. К сожалению, на данный момент у меня нет коммерческого опыта. \nИмею богатый игровой опыт ( PC: League of Legends, Cyberpunk2077, Apex, Black Desert, CS:GO, Destiny 2, TESO, Far Cry 5, GTA online, Hitman 2, MK11, No Mans sky, PUBG, Quake Champions, Warframe, WOW classic, Overwatch, Call of Duty Warzone. Mobile: Arena of Valor, League of Legends )\nЯ закончил курсы “Функциональное тестирование ПО” в IT-Academy, получил теоретические знания и практический опыт.\nНесмотря на то, что у меня мало практики, мне нравится данное направление и я хотел бы в нем развиваться и проявить себя. \n\nБуду рад обратной связи! \nСпасибо! \nС уважением,\nАлександр.</p>', 'SUCCESS', NULL, '2021-10-05 13:06:21', '2021-10-05 13:06:23', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/wq\\/lu\\/wQLUzCDaLl.pdf\",\"as\":\"CV_Aliakseyenka.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/wq\\/lu\\/wQLUzCDaLl.pdf\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (245, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Артем</p><p><strong>Phone:</strong> +375291224889</p><p><strong>E-Mail:</strong> shaukovichas@yahoo.com</p><p><strong>Message:</strong> Добрый день! Я Артем, живу в Беларуси, Минск. Я самый настоящий джун 3d artist и хочу попробовать свои силы в реальном деле. Ссылка на портфолио: https://www.artstation.com/arshel</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-05 17:12:44', '2021-10-05 17:12:46', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/nu\\/kd\\/NukDrkBs8s.pdf\",\"as\":\"\\u0428\\u0435\\u043b\\u043a\\u043e\\u0432\\u0438\\u0447 \\u0410\\u0440\\u0442\\u0435\\u043c.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/nu\\/kd\\/NukDrkBs8s.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (246, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Дмитрий</p><p><strong>Phone:</strong> +375445368891</p><p><strong>E-Mail:</strong> prohorchik1993@live.com</p><p><strong>Message:</strong> Молодой амбициозный) сейчас заканчиваю курс в fungi.by на курсе 3d окружение. Без вредных привычек. Творческая личность) к сожалению работ в портфолио немного пока но скоро добавлю ещё) а пока https://www.artstation.com/dmitryprohorchik\nПосле курса планирую  идти повышать свой скил дальше в xyzschool.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-06 09:03:38', '2021-10-06 09:03:40', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/e3\\/f6\\/e3F6JQqx1Y.jpg\",\"as\":\"IMG_20190630_105506.jpg\",\"mime\":\"image\\/jpeg\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/e3\\/f6\\/e3F6JQqx1Y.jpg\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (247, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Анастасия</p><p><strong>Phone:</strong> +79223732239</p><p><strong>E-Mail:</strong> aneftanova@gmail.com</p><p><strong>Message:</strong> Доброго времени суток! Хочется работать-работать-работать, поэтому пишу вам, приклеиваю к сообщению CV и портфолио: https://www.artstation.com/bethorie\n\nО себе: имею психологическое образование и классный менеджерский бэкграунд, но так как очень неравнодушна к играм с юных лет, решила пойти в геймдев к единомышленникам. За время изучения 3D заметила, что мне очень нравится техника, оружие. Несмотря на отсутствие коммерческого опыта, готова выкладываться на 200%.\n\nБуду рада любому вашему ответу, а также с удовольствием выполню тестовое задание. Продуктивной недели и хорошего настроения!</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-06 09:33:18', '2021-10-06 09:33:21', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/hm\\/uh\\/hMUhu9UEMr.jpg\",\"as\":\"Neftanova Anastasia CV.jpg\",\"mime\":\"image\\/jpeg\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/hm\\/uh\\/hMUhu9UEMr.jpg\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (248, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Руслан</p><p><strong>Phone:</strong> +79251212418</p><p><strong>E-Mail:</strong> zalyalievrus@gmail.com</p><p><strong>Message:</strong> Здравствуйте! Меня зовут Руслан, и я обожаю видеоигры.\nА с некоторых пор стал любить их ещё больше, потому что теперь я работаю над их созданием. Мне бы очень хотелось иметь возможность работать и учиться под началом художников из вашей студии. Кроме того, владею английским языком на уровне intermediate.\nЯ всегда готов к выполнению тестового задания, поэтому в случае данной необходимости, буду рад поработать над ним!\nНадеюсь, что данное письмо Вам пришло. Благодарю за скорый ответ!</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-06 09:58:26', '2021-10-06 09:58:28', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/mc\\/n7\\/mcn7loaisD.pdf\",\"as\":\"\\u0417\\u0430\\u043b\\u044f\\u043b\\u0438\\u0435\\u0432 \\u0420\\u0443\\u0441\\u043b\\u0430\\u043d_3D \\u0445\\u0443\\u0434\\u043e\\u0436\\u043d\\u0438\\u043a.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/mc\\/n7\\/mcn7loaisD.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (249, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Петр</p><p><strong>Phone:</strong> 79299197005</p><p><strong>E-Mail:</strong> peterkotunov@mail.ru</p><p><strong>Message:</strong> Здравствуйте! Я 3d-художник без опыта работы в студиях, хотел бы попробовать пройти у вас дистанционное обучение на вакансию Junior 3d artist</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-06 14:48:21', '2021-10-06 14:48:23', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/co\\/jz\\/COjZSx3vCc.docx\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/co\\/jz\\/COjZSx3vCc.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
