INSERT INTO `tager_mail_logs` VALUES (251, 3, 'jobs@furylion.net', 'VFX Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> test</p><p><strong>Phone:</strong> +55555555555555555555555555</p><p><strong>E-Mail:</strong> test@gmail.com</p><p><strong>Message:</strong> test</p><p><strong>Vacancy:</strong> VFX Artist</p>', 'SUCCESS', NULL, '2021-10-07 09:29:23', '2021-10-07 09:29:26', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/wj\\/cx\\/WjCxmIIul8.pdf\",\"as\":\"test.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/wj\\/cx\\/WjCxmIIul8.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (252, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Гаяне Амбарцумян</p><p><strong>Phone:</strong> 89998897713</p><p><strong>E-Mail:</strong> gayanehambardzumyan8@gmail.com</p><p><strong>Message:</strong> Здравствуйте! \nМеня зовут Амбарцумян Гаяне и я проходила учебу в НИУ ВШЭ на направлении «Визуальные эффекты», в качестве 3D Generalist-a. \n\nЗанимаюсь скульптингом, текстурированием, моделированием, клинапом. \nИз программ предпочитаю связку: Blender, Zbrush, Nuke, но могу подстроиться под любые другие, так как уже успела поработать с рядом других ПО.\nВ последнее время начала увлекаться гейм-дизайном, поэтому очень хотелось бы стать частью вашей команды.\n\nПрикладываю ссылки на портфолио:\n\n1. https://www.artstation.com/neyan_s\n\n2. REEL VFX - https://www.youtube.com/watch?v=01u3F_23iWw&ab_channel=Gaya\n\n3. REEL CLEANUP - https://www.youtube.com/watch?v=Wbs_y457tWM&ab_channel=Gaya\n\n4. https://drive.google.com/drive/folders/1HWcuM2xzxwDkyRkS3M3vkcFZf-Mf6_4F?usp=sharing\n\nС уважением,\nГаяне</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-07 13:25:00', '2021-10-07 13:25:03', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/pq\\/ge\\/pQGey83TSS.pdf\",\"as\":\"Ambartcumian Gaiane_CV (1).pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/pq\\/ge\\/pQGey83TSS.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (253, 3, 'jobs@furylion.net', 'Project Manager - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Жегздринь Егор</p><p><strong>Phone:</strong> +375298249290</p><p><strong>E-Mail:</strong> gegzdrin@mail.ru</p><p><strong>Message:</strong> Добрый день.\nМеня зовут Егор и мне очень интересна работа менеджера проектов в вашей компании.\nЯ закончил курсы академии Belhard по менеджменту проектов и бизнес-анализу. На нынешнем месте работы занимаюсь руководством проектом по созданию сайтов и внедрению CRM-систем. Провожу сбор, анализ и формализацию бизнес-требований с заказчиками, описание и моделирование бизнес-процессов, создаю прототипы сайтов, занимаюсь написанием технического задания и иной необходимой документации, распределяю задачи между командой во время разработки сайта . Также у меня есть юридическое образование.\nПонимаю, что моего опыта на вакансию менеджера проектов не достаточно, однако, возможно у вас имеется открытая позиция ассистента менеджера проектов, на которую я мог бы быть рассмотрен, в качестве кандидата?!\nБуду рад обратной связи!</p><p><strong>Vacancy:</strong> Project Manager</p>', 'SUCCESS', NULL, '2021-10-08 13:39:58', '2021-10-08 13:40:01', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/ev\\/cu\\/eVcUu4xaWq.pdf\",\"as\":\"\\u0416\\u0435\\u0433\\u0437\\u0434\\u0440\\u0438\\u043d\\u044c \\u0415\\u0433\\u043e\\u0440 \\u041f\\u0430\\u0432\\u043b\\u043e\\u0432\\u0438\\u0447.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/ev\\/cu\\/eVcUu4xaWq.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (254, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Альберт</p><p><strong>Phone:</strong> +79159648725</p><p><strong>E-Mail:</strong> dartabik@gmail.com</p><p><strong>Message:</strong> Здравствуйте. Очень заинтересовала вакансия вашей компании \"junior 3d artist\". Я уже какое-то время изучаю создание трёхмерных персонажей, в основном изучал полуреалистичных персонажей или реалистичные бюсты, но если надо в казуал, в ту сторону тоже могу попробовать, есть пару сделанных работ в казуальном стиле. Я очень люблю игровую индустрию, с 2-х лет являюсь ярым её поклонником и очень бы хотел попасть в кузницу игр. Готов учиться новому и работать в команде, знаю английский на разговорном уровне, на базовом уровне знаю немецкий. Буду очень рад, если в вашей компании есть место для меня. Мой контактный телефон: +7 915 964 87 25. Мой e-mail: dartabik@gmail.com. С уважением, Альберт. \n\nВот моё основное портфолио: \n\n[https://www.artstation.com/unstableskynet](https://www.artstation.com/unstableskynet) \nВот дополнительное: \n\n[https://www.instagram.com/albertgcrea/](https://www.instagram.com/albertgcrea/)</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-08 14:44:48', '2021-10-08 14:44:49', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/8y\\/qx\\/8YQXLnOvvj.pdf\",\"as\":\"CV_ver2.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/8y\\/qx\\/8YQXLnOvvj.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (255, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Кирилл Сафарян</p><p><b>Phone:</b> +375291382091</p><p><b>E-Mail:</b> kirillsaf.bmw@gmail.com</p><p><b>Message:</b> Я обладаю хорошими коммуникативными навыками, умею четко выражать свои мысли и точку зрения, разбираюсь в дизайне игр так как имею огромный игровой опыт и постоянно изучаю дизайн игр разных жанров. Как уже писал ранее я имею огромный игровой опыт (PC, console, mobile games) в абсолютно разных играх (в online играх (популярных и не очень), co-op, сюжетных играх, Free To Play, Battle Royale, FPS, RPG, RTS, и т.д.) и это научило меня обращать внимание на разные детали, которые стоит учитывать при создании игр (то есть где разработчики чаще всего не замечают ошибки). Всё это помогло мне сформировать мой нестандартный взгляд на gamedev. Имею следующие навыки в: 3D моделировании (Cinema, изучаю 3Ds max), игровом движке Unity, программах для создания иллюстраций (Photoshop, Illustrator), Digital Art. Имею хороший уровень английского языка (в том числе и технического) (хожу на курсы), разбираюсь в разработке игр, имею базовые знания С++. Всегда готов учиться новому и это для меня не составляет труда. Спасибо за ваше время и внимание!</p>', 'SUCCESS', NULL, '2021-10-08 18:43:27', '2021-10-08 18:43:29', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/ut\\/wn\\/utWnRM60O1.docx\",\"as\":\"\\u0421V.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/ut\\/wn\\/utWnRM60O1.docx\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
