INSERT INTO `tager_mail_logs` VALUES (262, 3, 'jobs@furylion.net', '2D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Диана</p><p><strong>Phone:</strong> +375293662964</p><p><strong>E-Mail:</strong> dbokut29@gmail.com</p><p><strong>Message:</strong> Доброго времени суток! \nНа вашем сайте узнала, что в Вашей компании открыта вакансия 2D-художника.\n\nМеня зовут Бокуть Диана, мне 20 лет. По специальности я техник-программист, специализация \"Компьютерная графика и дизайн\". Хорошо владею AdobePhotoshop и AdobeIllustrator.\nНедавно прошла курс «Основы цифрового рисунка».\n\nЯ люблю рисовать и хочу приносить своей работой красоту и креатив в игровую индустрию. В будущем хочу реализовать себя как концепт-художник.\n\nСпасибо за внимание, Диана.\nwww.pinterest.com/dbokut29  - примеры работ</p><p><strong>Vacancy:</strong> 2D Artist</p>', 'SUCCESS', NULL, '2021-10-11 15:55:06', '2021-10-11 15:55:08', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/zk\\/v9\\/zkv9e6BZPU.pdf\",\"as\":\"Diana_Bokut__resume.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/zk\\/v9\\/zkv9e6BZPU.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
