INSERT INTO `tager_mail_logs` VALUES (264, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Владимир</p><p><strong>Phone:</strong> +375293386963</p><p><strong>E-Mail:</strong> proto09@yandex.ru</p><p><strong>Message:</strong> Здравствуйте! Я проживаю в Минске.\nМеня очень заинтересовала ваша вакансия . Дайте мне шанс , я готов учиться , узнавать новое и применять это на практике) \nСочту за честь выполнить тестовое задание.\nТакже прошу ознакомиться со своим портфолио: \nhttps://www.artstation.com/vladimirkhvorost7</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-12 07:40:04', '2021-10-12 07:40:06', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/vw\\/iv\\/VwIv4gIRTE.docx\",\"as\":\"\\u0414\\u043e\\u043a\\u0443\\u043c\\u0435\\u043d\\u0442 Microsoft Word.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/vw\\/iv\\/VwIv4gIRTE.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
