INSERT INTO `tager_mail_logs` VALUES (266, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Леонид</p><p><strong>Phone:</strong> 89236157971</p><p><strong>E-Mail:</strong> leokorekov42@gmail.com</p><p><strong>Message:</strong> Здравствуйте, меня зовут Кореков Леонид, готов работать и учиться новому в 3D графике\nСофт: Blender, Maya, Substance painter, Marmoset toolbag, Photoshop\nНавыки: High и Low-poly моделирование, UV - развертка, текстурирование, рендеринг. Во всем есть куда расти.\nСсылка на примеры работ: leostyle.artstation.com</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-12 15:48:08', '2021-10-12 15:48:10', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/fk\\/gm\\/fkGMhDii1S.pdf\",\"as\":\"Leonid_Valeryevich_Korekov.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/fk\\/gm\\/fkGMhDii1S.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (267, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Виктор</p><p><strong>Phone:</strong> +375336635989</p><p><strong>E-Mail:</strong> mr.grinko.viktor@ya.ru</p><p><strong>Message:</strong> Добрый день. Есть огромное желание работать и развиваться в 3D и готов вам это доказать.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-13 07:50:17', '2021-10-13 07:50:19', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/80\\/aa\\/80aa6KmNXw.pdf\",\"as\":\"SV Grinko Viktor.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/80\\/aa\\/80aa6KmNXw.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (268, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> София</p><p><strong>Phone:</strong> 89206457756</p><p><strong>E-Mail:</strong> smsonechka@mail.ru</p><p><strong>Message:</strong> Здравствуйте! Меня зовут София, я художник. Имею художественное (среднее) и техническое (высшее) образования, проходила курсы по программам 3d Max, Rhino, Matrix. Работаю с 2008 года в сфере производства ювелирных украшений. Несколько лет занимаюсь дизайном ювелирки. Хочу поменять работу на более творческую, чтобы больше проявлять себя. С детства был интерес к рисованию людей, персонажей, одежды. Во время учёбы изучала анатомию, академический рисунок, скульптуру, мелкую пластику, живопись. Есть графический планшет. Программу Zbrash только начала изучать, работы для портфолио в области геймдева тоже ещё не накопила. Но есть большое желание и интерес, а также усидчивость, коммуникабельность и ответственность. Надеюсь на обратную связь, спасибо за внимание!:) \nP.S. По этой ссылке можно посмотреть некоторые мои работы с ювелирными изделиями. \nhttps://cloud.mail.ru/public/6L9F/khBqJxH9S</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-13 16:45:13', '2021-10-13 16:45:18', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/wi\\/cn\\/wIcn9TA8Q6.pdf\",\"as\":\"\\u0421\\u043c\\u0438\\u0440\\u043d\\u043e\\u0432\\u0430 \\u0421.\\u0410. \\u0440\\u0435\\u0437\\u044e\\u043c\\u0435 (1).pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/wi\\/cn\\/wIcn9TA8Q6.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
