INSERT INTO `tager_mail_logs` VALUES (270, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Карина Самончик</p><p><b>Phone:</b> +375291032972</p><p><b>E-Mail:</b> karisamonchik@gmail.com</p><p><b>Message:</b> Здравствуйте!\n\nМеня зовут Карина Самончик. \nХочу предложить свою кандидатуру в качестве стажёра 3d artist.  \n\nАктивно работаю с такими программами, как 3Ds Max, Substance Painter, Zbrush, Marmoset, Corona Renderer, Adobe Photoshop.\nВ декабре 2020 года окончила курсы в Gripinsky 3D school, после чего продолжаю обучение, используя онлайн материалы школы XYZ, а также англоязычного ресурса Flippednormals.\n\nМои работы можно увидеть в портфолио: https://karinasam.artstation.com/\n                                                                       https://www.behance.net/karinasam\n \nИмею высшее техническое образование (окончила энергетический факультет БНТУ в 2019 году), высокий уровень знания английского языка (upper-intermediate).\n\nТакже прикрепляю к письму файл с резюме.\n\nС нетерпением жду ответа!</p>', 'SUCCESS', NULL, '2021-10-13 18:26:14', '2021-10-13 18:26:16', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/2z\\/nl\\/2znL9uPT4V.pdf\",\"as\":\"CV Samonchik.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/2z\\/nl\\/2znL9uPT4V.pdf\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
