INSERT INTO `tager_mail_logs` VALUES (273, 3, 'jobs@furylion.net', 'Senior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Илья</p><p><strong>Phone:</strong> +375293495487</p><p><strong>E-Mail:</strong> pilatovichilya@gmail.com</p><p><strong>Message:</strong> Добрый день, Fury Lion.\nМеня зовут Илья. Сооснователь студии компьютерной графики.\nУмеем делать крутые фотореалистичные 3Д модели и компьютерную графику.\nСоздавали классные сцены на UE4 для кино. \n\nВозможно наши навыки будут вам полезны.\nЖду вашего ответа!</p><p><strong>Vacancy:</strong> Senior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-15 09:31:35', '2021-10-15 09:31:38', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/ew\\/p2\\/EwP2xskz9g.pdf\",\"as\":\"\\u041f\\u0440\\u0435\\u0437\\u0435\\u043d\\u0442\\u0430\\u0446\\u0438\\u044f VAL studio (rus).pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/ew\\/p2\\/EwP2xskz9g.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (274, 3, 'jobs@furylion.net', 'Game Designer (HC) - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Денис</p><p><strong>Phone:</strong> +375297224463</p><p><strong>E-Mail:</strong> arsentyev.mailbox@gmail.com</p><p><strong>Message:</strong> Здравтсвуюте! Меня зовут Денис Арсентьев. Меня заинтересовала должность “Game Designer”, которую я увидел на сайте ваше компании.\nНашёл вас по ссылке одной из онлайн-школ геймдизайна и был крайне удивлён, что когда-то был у вас на страничке в ВК по причине классных арт-работ. И у вас действительно обалденные работы!\nМне 40 лет, 20 из которых я проработал в индустриях развлечений и рекламы на позиции человека который разрабатывал концепты и доводил их до реализации (креативный менеджер, креативный директор).\n3 года назад, наконец-то пошёл по пути профессии о которой давно мечтал — геймдизайн.\nХочу присоединиться к вашей команде как геймдизайнер! Буду рад рассказать более подробно о своем опыте и потенциале при встрече. Резюме в приложении. Ожидаю обратную связь!</p><p><strong>Vacancy:</strong> Game Designer (HC)</p>', 'SUCCESS', NULL, '2021-10-15 14:56:24', '2021-10-15 14:56:28', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/8c\\/98\\/8C98bIis0d.pdf\",\"as\":\"CV_Denis Arsentyev_GameDesigner_ru.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/8c\\/98\\/8C98bIis0d.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
