INSERT INTO `tager_mail_logs` VALUES (276, 3, 'jobs@furylion.net', 'Middle Game Designer - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Нэм</p><p><strong>Phone:</strong> +79253728049</p><p><strong>E-Mail:</strong> 123489n@gmail.com</p><p><strong>Message:</strong> Debug.Log( \"здрасти\" ) ; \nМеня зовут Нэм, Хочу предложить свою кандидатуру на данную должность.)\nЯ делаю игры от стадии идеи до реализации.GDD, кодую на C#, ну и еще много всего )\n\nссылка на портфолио:\nhttps://drive.google.com/drive/folders/12s0N8zKrMh-J70pgAFn0-ZI440YUEhY6?usp=sharing\n\nссылка на короткое резюме:\nhttps://drive.google.com/drive/folders/1nkljj17lQiQpASMgiDvt7249hCmURXrh?usp=sharing\n\nНадеюсь на скорую связь = )</p><p><strong>Vacancy:</strong> Middle Game Designer</p>', 'SUCCESS', NULL, '2021-10-16 18:06:36', '2021-10-16 18:06:39', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/ri\\/we\\/RiWefE2XKP.pdf\",\"as\":\"Game designer \\u041d\\u044d\\u043c \\u0421\\u0435\\u043a\\u0443\\u043b\\u0438\\u0447.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/ri\\/we\\/RiWefE2XKP.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (277, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Максим</p><p><strong>Phone:</strong> +79534200909</p><p><strong>E-Mail:</strong> c3posw@mail.ru</p><p><strong>Message:</strong> Добрый день! Меня зовут Максим, и мне безумно нравится фэнтезийное оружие. Сделать что-нибудь для серии The Elder Scrolls - мечта всей жизни! \nПрикрепляю CV с подробной информацией.\nСпасибо, что даёте шанс начинающим 3D художникам проявить себя!</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-17 14:29:53', '2021-10-17 14:30:31', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/cz\\/qq\\/CzQqhlT29t.pdf\",\"as\":\"CV_MaksimBatyrev.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/cz\\/qq\\/CzQqhlT29t.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (278, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Ирина</p><p><strong>Phone:</strong> 89023665421</p><p><strong>E-Mail:</strong> iuhanyova@gmail.com</p><p><strong>Message:</strong> Здравствуйте!\nМеня заинтересовала ваша вакансия на должность Junior 3D Artist. Пожалуйста, рассмотрите мою кандидатуру.\n\nСсылка на портфолио:\nhttps://www.artstation.com/irinauhaneva\n\nНа данный момент я ищу работу в игровой сфере. Есть небольшой опыт в анимации персонажа. Все модели в портфолио(кроме девушки) - Low-poly c запечеными картами с High-poly. Готова выполнить тестовое.\n\nУчилась на архитектора, у меня хороший навык рисования от руки и передачи характера.\nЗанималась архвизом с 2016 по настоящее время в 3ds max (Corona), работала дизайнером интерьеров, иногда моделила мебель и декор сама, создавала реалистичные материалы, переделывала готовые модельки из 3ddd.\n\nС февраля 2021 года изучала пайплайн и программы для работы - Zbrush, 3dcoat, Marvelous Designer, Substanse Painter, Marmoset Toolbag, делала различные модели – пропсы и персонажей.\n\nПрикладываю также ссылку на инстаграм, где показан навык рисования:\nhttps://www.instagram.com/cgnevik/?utm_medium=copy_link\n\nТакже вы можете посмотреть результаты моего предыдущего опыта дизайнером интерьеров:\nhttps://www.behance.net/Space_design56\n\nЕсли вы примите меня на эту должность, вы найдете трудолюбивого сотрудника, который следует ТЗ, быстро учится и соблюдает дедлайны!</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-17 14:50:51', '2021-10-17 14:50:56', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/6m\\/tk\\/6Mtk0hOPHE.pdf\",\"as\":\"\\u0423\\u0445\\u0430\\u043d\\u0435\\u0432\\u0430_3d_artist.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/6m\\/tk\\/6Mtk0hOPHE.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (279, 3, 'jobs@furylion.net', '2D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Дмитрий Иоскевич</p><p><strong>Phone:</strong> +375297888700</p><p><strong>E-Mail:</strong> dmitryyaz@gmail.com</p><p><strong>Message:</strong> Добры день! Меня заинтересовала вакансия 2D Artist в Вашей компании, которую я нашел на вашем сайте. \nЯ профессиональный концепт-художник с большим стажем работы в CG, от концептов до готового продукта. На протяжении долгого времени участвовал в разработке популярного детского мультсериала SunnyBunnies. Руководил воплощением моих концептов. Работаю в большинстве программ — графических редакторах и 3D моделирования, легко обучаем и постоянно пополняю арсенал профессионального инструментария.\nМне близки идеи и интересны проекты компании Furylion, потому хочу участвовать в их производстве. Верю, что у нас может сложиться плодотворное сотрудничество.\nПредлагаю вам ознакомиться с моими приложенными резюме и портфолио. \nЗаранее благодарю за внимание к моему резюме.\n\nhttps://drive.google.com/drive/folders/1bNvusJtPadpPp5hEWSBfI3bipUQi49BV?usp=sharing</p><p><strong>Vacancy:</strong> 2D Artist</p>', 'SUCCESS', NULL, '2021-10-18 10:45:40', '2021-10-18 10:45:41', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/w5\\/ye\\/W5yEQjfqIl.pdf\",\"as\":\"Resume Ioskevich Dmitry.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/w5\\/ye\\/W5yEQjfqIl.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (280, 2, 'info@furylion.net', 'FuryLion WebSite - Feedback Form', '<p><strong>Name:</strong> Kuba Karolczak</p><p><strong>Company:</strong> All in! Games</p><p><strong>E-Mail</strong> kuba.karolczak@allingames.com</p><p><strong>Message</strong> Hi,\nI’m Kuba, producer at All in! Games, a video game publisher. I’m currently starting a new project and I’m looking for a porting company that would help us bring a big, mobile IP onto Nintendo Switch and, in time, Playstation and Xbox.\n\nI cannot give you too many details about the project without signing an NDA, but here is some brief information that I can give:\n- It’s written in C++ and is using a proprietary engine\n- Some graphics might need upscaling (the game is in 2D)\n- We would need the port to be ready in early 2022, if possible\n\nFor the moment I only need a cost and time estimates for porting this game onto Nintendo Switch and for upscaling the existing graphics.\n\nPlease let me know if you would be interested in the project.</p>', 'SUCCESS', NULL, '2021-10-18 11:12:12', '2021-10-18 11:12:14', '[]', 'Feedback', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (281, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Виталий</p><p><strong>Phone:</strong> +380508836771</p><p><strong>E-Mail:</strong> vitalikshakhov5991@gmail.com</p><p><strong>Message:</strong> https://t.me/vitalikshakhov</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-18 16:31:21', '2021-10-18 16:31:23', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/1t\\/vb\\/1tVbrjn3TM.pdf\",\"as\":\"\\u0428\\u0430\\u0445\\u043e\\u0432 \\u0412.\\u0413..pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/1t\\/vb\\/1tVbrjn3TM.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (282, 3, 'jobs@furylion.net', '2D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Евгения</p><p><strong>Phone:</strong> +375297704219</p><p><strong>E-Mail:</strong> eva000579@mail.com</p><p><strong>Message:</strong> Здравствуйте! Меня зовут Евгения.\n Много слышала о вашей компании,поэтому не смогла пройти мимо вакансии 2D artist. \nВ прошлом я работала обычным художником и преподавала.\nЯ понимаю, что в области геймдейва я \"слабый игрок\",только потому,что у меня нет особого опыта и навыков,приобретаемых непосредственно в момент работы в данной отрасли.Но есть море позитива,энтузиазма и желания реализовать себя!\nЯ 2 года занималась на курсах digital artist.Попутно стараюсь прокачать скиллы в 3D.\nТак как у меня нет опыта и в резюме писать особо нечего,решила рассказать вам о себе в письме.Мое портфолио https://www.behance.net/970c1a30 Готова выполнить тестовое задание.\nЯ была бы рада с вами  сотрудничать.\nС уважением,Евгения.\neva000579@gmail.com</p><p><strong>Vacancy:</strong> 2D Artist</p>', 'SUCCESS', NULL, '2021-10-21 13:40:59', '2021-10-21 13:41:02', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/0q\\/bh\\/0QbhnH1NUO.pdf\",\"as\":\"\\u041c\\u0443\\u0440\\u0430\\u0448\\u043a\\u043e \\u0415\\u0432\\u0433\\u0435\\u043d\\u0438\\u044f \\u0420\\u0415\\u0417\\u042e\\u041c\\u0415 .pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/0q\\/bh\\/0QbhnH1NUO.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (283, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Gaiane Ambartcumian</p><p><strong>Phone:</strong> 89998897713</p><p><strong>E-Mail:</strong> gayanehambardzumyan8@gmail.com</p><p><strong>Message:</strong> Здравствуйте! \nПроходила учебу в НИУ ВШЭ на направлении «Визуальные эффекты», в качестве 3D Generalist-a. Заинтересовала данная вакансия, так как хотелось бы связать свой путь с игровой индустрией.\n\nВ портфолио вы найдете не только лоу/хай-поли окружение и персонажей, но и портреты людей.\nРаботаю в основном в Blender, Zbrush, Houdini.\nТак же имею опыт работы в Maya и Houdini. В основном, пользовалась такими рендерами как: Cycles, Eevee, Mantra, Arnold.\nИз последних проектов – моделирование и текстурирование персонажей для мультфильма на английской площадке в ютуб.\nБыстро ориентируюсь в новых программах, так как уже знакома с логикой разных 3д софтов.\nУровень английского – B2.\n\nhttps://www.artstation.com/neyan_s\nhttps://drive.google.com/drive/folders/1HWcuM2xzxwDkyRkS3M3vkcFZf-Mf6_4F?usp=sharing\nVFX REEL: https://www.youtube.com/watch?v=01u3F_23iWw\nCOMPOSITING REEL: https://www.youtube.com/watch?v=Wbs_y457tWM</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-21 22:27:44', '2021-10-21 22:27:46', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/rh\\/vv\\/rhVv7op2zr.pdf\",\"as\":\"Ambartcumian Gaiane_CV (1).pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/rh\\/vv\\/rhVv7op2zr.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (284, 3, 'jobs@furylion.net', 'Intern Developer - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Тимофей</p><p><strong>Phone:</strong> +375336951851</p><p><strong>E-Mail:</strong> tima.plisko@mail.ru</p><p><strong>Message:</strong> Хочу попасть на курсы \"Основы разработки игр в Unity\"</p><p><strong>Vacancy:</strong> Intern Developer</p>', 'SUCCESS', NULL, '2021-10-22 12:10:55', '2021-10-22 12:10:58', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/3n\\/vv\\/3nVVx1dRmO.pdf\",\"as\":\"CV_Plisko.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/3n\\/vv\\/3nVVx1dRmO.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (285, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Алёна</p><p><strong>Phone:</strong> 89800528044</p><p><strong>E-Mail:</strong> alenavol98@gmail.com</p><p><strong>Message:</strong> Здравствуйте! Меня зовут Алёна. Год назад я закончила обучение в университете по специальности \"Информационные системы и технологии\" и практически сразу же принялась за обучение профессии \"3D дженералист\" от Skillbox. \n\nОпыта работы в сфере 3D моделирования у меня пока нет, кроме выполнения полного пайплайна связанного с домашним заданием от skillbox, но есть другие качественные преимущества!\n\nЯ организованная, дисциплинированная, умею слушать и принимать критику, слушать фидбек и следовать ему, чтобы достичь необходимых результатов. Быстро и с большой охотой обучаюсь новому. Вредных привычек не имею, особенно вредных привычек которые могут помешать работать в офисе.\n\nХочу пройти у вас обучение на направление \"Фентези оружие и доспехи\", если возможность выбора ещё есть. В случае успешного прохождения обучения, готова к переезду в срочном порядке.\n\nСсылка на портфолио есть в резюме, но я лучше её и сюда помещу: https://doubletrouble_dt.artstation.com/</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-22 16:06:34', '2021-10-22 16:06:36', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/pz\\/cy\\/pZcYAaO9cN.pdf\",\"as\":\"\\u0420\\u0435\\u0437\\u044e\\u043c\\u0435 \\u0410\\u043b\\u0451\\u043d\\u0430.docx (1).pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/pz\\/cy\\/pZcYAaO9cN.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (286, 3, 'jobs@furylion.net', 'Intern Developer - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Андрей</p><p><strong>Phone:</strong> 375333724726</p><p><strong>E-Mail:</strong> pecerskijandrej64@gmail.com</p><p><strong>Message:</strong> Запись на курсы по основам разработки игр. В анкете написано, что мы будем знать по итогу прохождения курсов, но не указано, нужны ли уже какие-то знания по конкретному языку, движку или редактору. Прошу выслать список позиций для предварительной подготовки, если таковы необходимы</p><p><strong>Vacancy:</strong> Intern Developer</p>', 'SUCCESS', NULL, '2021-10-23 14:38:22', '2021-10-23 14:38:24', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/fk\\/ds\\/FkdSaMpibG.pdf\",\"as\":\"CV.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/fk\\/ds\\/FkdSaMpibG.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (287, 3, 'jobs@furylion.net', 'Product Owner - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Arbab Nomani</p><p><strong>Phone:</strong> +923331267597</p><p><strong>E-Mail:</strong> marbabn@gmail.com</p><p><strong>Message:</strong> I\'ve been working on some Idle F2P IP titles recently which includes Wiz Khalifa Weed Farm and NARCOS (netflix boxoffice series) both are out in the market and proving their metal.\nAs a professional, I\'ve been working with onsite and offshore multicultural teams, also managing LiveOps of launched games apart from playing my role as a Producer/Product Manager.</p><p><strong>Vacancy:</strong> Product Owner</p>', 'SUCCESS', NULL, '2021-10-23 18:41:49', '2021-10-23 18:41:53', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/t0\\/op\\/t0OP4AsgLG.pdf\",\"as\":\"Resume-Sr.PM-F2P Games Producer-2021.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/t0\\/op\\/t0OP4AsgLG.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (288, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Руслан</p><p><strong>Phone:</strong> +79992491374</p><p><strong>E-Mail:</strong> ruslanmurs@yandex.ru</p><p><strong>Message:</strong> Здравствуйте, я бы хотел попасть на должность начинающего 3D художника. Мое портфолио https://sketchfab.com/muru , https://www.artstation.com/murs .</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-24 14:21:23', '2021-10-24 14:21:26', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/zj\\/ds\\/Zjds4M343K.docx\",\"as\":\"CV_murs.docx\",\"mime\":\"application\\/vnd.openxmlformats-officedocument.wordprocessingml.document\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/zj\\/ds\\/Zjds4M343K.docx\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (289, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Олег</p><p><strong>Phone:</strong> +79217996116</p><p><strong>E-Mail:</strong> oleg.beaver@gmail.com</p><p><strong>Message:</strong> Добрый день!\n Меня зовут Олег. Мне 27 лет. Живу в городе Санкт-Петербург. \n Я начинающий 3D Artist. Обучаюсь моделированию в течении полутора лет. Прошел курсы Knower School по направлению игровой графики. Сейчас прохожу курс школы XYZ по текстурированию. Имею высшее художественное образование с техническим уклоном. На данный момент занимаю руководящую должность в театре, но всю жизнь мечтаю заниматься играми. Помимо 3Dsmax, Blender знаю Autocad на уровне уверенного пользователя, умею читать и создавать чертежи, в том числе создавать модели в Autocad для формирования технической документации. Имею навыки в Photoshop. Умею текстурировать в Substance Painter и запекать модели в Marmoset. К сожалению моя профессиональная деятельность оставляет мало времени на учебу и совершенствование навыков, поэтому с радостью бы присоединился к вашей команде для дальнейшего роста и развития и более серьезного углубления в учебный процесс по направлению. \nС моим портфолио можно ознакомиться по ссылке: https://www.artstation.com/bbrv_art</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-25 14:08:38', '2021-10-25 14:08:40', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/jy\\/iy\\/JYiy8UtGwL.pdf\",\"as\":\"\\u0411\\u043e\\u0431\\u0440\\u043e\\u0432 \\u041e\\u043b\\u0435\\u0433.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/jy\\/iy\\/JYiy8UtGwL.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (290, 3, 'jobs@furylion.net', 'Junior 3D Artist - FuryLion WebSite - Vacancies Form', '<p><strong>Name:</strong> Марьяна</p><p><strong>Phone:</strong> 89052736650</p><p><strong>E-Mail:</strong> mara.mir90@gmail.com</p><p><strong>Message:</strong> Добрый день! В прошлом году мы обсуждали возможность прохождения у вас стажировки с дальнейшем трудоустройством на должность Junior 3D Artist, но это не удалось реализовать из-за ковида. Прикрепляю свое обновленное резюме, портфолио: https://marakopt.artstation.com/  Прошу рассмотреть мою кандидатуру.</p><p><strong>Vacancy:</strong> Junior 3D Artist</p>', 'SUCCESS', NULL, '2021-10-25 15:47:55', '2021-10-25 15:47:57', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/4t\\/d9\\/4tD9UaiB8H.pdf\",\"as\":\"\\u041c\\u0438\\u0440\\u043e\\u0448\\u043d\\u0438\\u0447\\u0435\\u043d\\u043a\\u043e \\u041c\\u0430\\u0440\\u044c\\u044f\\u043d\\u0430 \\u0412\\u043b\\u0430\\u0434\\u0438\\u043c\\u0438\\u0440\\u043e\\u0432\\u043d\\u0430.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/4t\\/d9\\/4tD9UaiB8H.pdf\"}]', 'Cv', NULL, NULL, 'webform@furylion.net', 'Furylion');
INSERT INTO `tager_mail_logs` VALUES (291, 5, 'v.ozierski@ozitag.com', 'New Cv without vacancy', '<p><b>Name:</b> Алина</p><p><b>Phone:</b> 80293844395</p><p><b>E-Mail:</b> a.shkott@mail.ru</p><p><b>Message:</b> Привет всем!) Меня зовут Алина, я начинающий 3д художник из Минска.\nЯ имею художественное образование, рисую чуть больше 10 лет.\nВ последние годы я работала по другой специальности в сфере архитектуры и строительства, где создавала 3д визуализации объектов и проектную документацию.\nВ течении последнего года развиваю себя как 3д художник в области игрового дизайна.\nЯ бы очень хотела начать свой путь в интересной для меня отрасли с сильной командой!\n\nПрограммы: maya, 3dsMax, corona, zbrush, uvlayout, marmoset, 3dcoat, photoshop, substance painter, cinema 4d.\n\n- Навыки low-poly и high-poly моделирования;\n- Создание UV разверток;\n- Ретопология;\n- Запекание моделей;\n- Текстурирование;\n- Создание финального рендера;\n- Базовые знания анимации.\n\nhttps://www.artstation.com/shkot\n\nБуду рада обратной связи!)</p>', 'SUCCESS', NULL, '2021-10-25 16:17:19', '2021-10-25 16:17:23', '[{\"path\":\"\\/var\\/www\\/app\\/storage\\/app\\/public\\/uploads\\/feedback\\/hc\\/bx\\/hcbxJc0CtD.pdf\",\"as\":\"CV.pdf\",\"mime\":\"application\\/pdf\",\"url\":\"https:\\/\\/furylion.net\\/uploads\\/feedback\\/hc\\/bx\\/hcbxJc0CtD.pdf\"}]', 'CvWithoutVacancy', NULL, NULL, 'webform@furylion.net', 'Furylion');
