INSERT INTO `tager_page_fields` VALUES (137947, 7, 'questionsItems', '[[{\"name\":\"question\",\"value\":\"\\u0412\\u044b \\u043f\\u0440\\u043e\\u0434\\u0430\\u0435\\u0442\\u0435 \\u044d\\u0442\\u0438 \\u043a\\u0443\\u0440\\u0441\\u044b?\"},{\"name\":\"answer\",\"value\":\"\\u041d\\u0435\\u0442. \\u0426\\u0435\\u043b\\u044c \\u043d\\u0430\\u0448\\u0438\\u0445 \\u043a\\u0443\\u0440\\u0441\\u043e\\u0432: \\u0432\\u043e\\u0441\\u043f\\u0438\\u0442\\u0430\\u0442\\u044c \\u0443\\u0432\\u0435\\u0440\\u0435\\u043d\\u043d\\u044b\\u0445 \\u0443\\u0447\\u0435\\u043d\\u0438\\u043a\\u043e\\u0432, \\u043f\\u0440\\u043e\\u0434\\u043e\\u043b\\u0436\\u0430\\u0442\\u044c \\u0441\\u043e\\u0432\\u0435\\u0440\\u0448\\u0435\\u043d\\u0441\\u0442\\u0432\\u043e\\u0432\\u0430\\u0442\\u044c \\u0438\\u0445 \\u0441\\u043a\\u0438\\u043b\\u043b\\u044b \\u0438 \\u0432\\u0437\\u044f\\u0442\\u044c \\u043b\\u0443\\u0447\\u0448\\u0438\\u0445 \\u043a \\u0441\\u0435\\u0431\\u0435 \\u0432 \\u0448\\u0442\\u0430\\u0442\"}],[{\"name\":\"question\",\"value\":\"\\u041a\\u0430\\u043a \\u0434\\u043e\\u043b\\u0433\\u043e \\u0443\\u0447\\u0438\\u0442\\u044c\\u0441\\u044f?\"},{\"name\":\"answer\",\"value\":\"\\u0412\\u0441\\u044e \\u0436\\u0438\\u0437\\u043d\\u044c\"}],[{\"name\":\"question\",\"value\":\"\\u041a\\u0430\\u043a\\u043e\\u0432\\u0430 \\u043f\\u0440\\u043e\\u0434\\u043e\\u043b\\u0436\\u0438\\u0442\\u0435\\u043b\\u044c\\u043d\\u043e\\u0441\\u0442\\u044c \\u043a\\u0443\\u0440\\u0441\\u0430?\"},{\"name\":\"answer\",\"value\":\"\\u0412 \\u0437\\u0430\\u0432\\u0438\\u0441\\u0438\\u043c\\u043e\\u0441\\u0442\\u0438 \\u043e\\u0442 \\u043a\\u0443\\u0440\\u0441\\u0430 \\u0438 \\u0432\\u0430\\u0448\\u0435\\u0433\\u043e \\u0438\\u0437\\u043d\\u0430\\u0447\\u0430\\u043b\\u044c\\u043d\\u043e\\u0433\\u043e \\u0441\\u043a\\u0438\\u043b\\u043b\\u0430. \\u041e\\u0442 \\u043e\\u0434\\u043d\\u043e\\u0439 \\u043d\\u0435\\u0434\\u0435\\u043b\\u0438 \\u0434\\u043e \\u0442\\u0440\\u0435\\u0445 \\u043c\\u0435\\u0441\\u044f\\u0446\\u0435\\u0432. \\u0417\\u0430\\u0434\\u0430\\u0447\\u0430 \\u043f\\u043e\\u0434\\u0442\\u044f\\u043d\\u0443\\u0442\\u044c \\u0432\\u0430\\u0441 \\u0434\\u043e \\u0443\\u0440\\u043e\\u0432\\u043d\\u044f \\u0441\\u043f\\u0435\\u0446\\u0438\\u0430\\u043b\\u0438\\u0441\\u0442\\u0430, \\u0433\\u043e\\u0442\\u043e\\u0432\\u043e\\u0433\\u043e \\u043a \\u0440\\u0430\\u0431\\u043e\\u0442\\u0435 \\u0432 \\u043f\\u0440\\u043e\\u0434\\u0430\\u043a\\u0448\\u0435\\u043d\\u0435 \\u0438 \\u043f\\u0440\\u043e\\u0434\\u043e\\u043b\\u0436\\u0438\\u0442\\u044c \\u043e\\u0431\\u0443\\u0447\\u0435\\u043d\\u0438\\u0435 \\u043d\\u0430 \\u0431\\u043e\\u0435\\u0432\\u044b\\u0445 \\u043f\\u0440\\u043e\\u0435\\u043a\\u0442\\u0430\\u0445\"}],[{\"name\":\"question\",\"value\":\"\\u041d\\u0443\\u0436\\u0435\\u043d \\u043b\\u0438 \\u043e\\u043f\\u044b\\u0442 \\u0440\\u0430\\u0431\\u043e\\u0442\\u044b?\"},{\"name\":\"answer\",\"value\":\"\\u041d\\u0435\\u0442, \\u043d\\u0443\\u0436\\u043d\\u044b \\u0442\\u043e\\u043b\\u044c\\u043a\\u043e \\u0431\\u0430\\u0437\\u043e\\u0432\\u044b\\u0435 \\u0437\\u043d\\u0430\\u043d\\u0438\\u044f \\u0441\\u043e\\u0444\\u0442\\u0430 \\u0438 \\u043f\\u043e\\u0440\\u0442\\u0444\\u043e\\u043b\\u0438\\u043e, \\u043a\\u043e\\u0442\\u043e\\u0440\\u043e\\u0435 \\u044d\\u0442\\u043e \\u043f\\u043e\\u0434\\u0442\\u0432\\u0435\\u0440\\u0436\\u0434\\u0430\\u0435\\u0442\"}],[{\"name\":\"question\",\"value\":\"\\u0427\\u0442\\u043e \\u0434\\u0435\\u043b\\u0430\\u0442\\u044c \\u0435\\u0441\\u043b\\u0438 \\u044f \\u0435\\u0449\\u0435 \\u0441\\u0442\\u0443\\u0434\\u0435\\u043d\\u0442?\"},{\"name\":\"answer\",\"value\":\"\\u0422\\u0443\\u0442 \\u0438\\u043d\\u0434\\u0438\\u0432\\u0438\\u0434\\u0443\\u0430\\u043b\\u044c\\u043d\\u043e. \\u041d\\u0443\\u0436\\u043d\\u043e \\u0431\\u044b\\u0442\\u044c \\u043e\\u0447\\u0435\\u043d\\u044c \\u0433\\u0438\\u0431\\u043a\\u0438\\u043c \\u0438 \\u043a\\u0440\\u0443\\u0442\\u0438\\u0442\\u044c\\u0441\\u044f \\u0442\\u0430\\u043a, \\u0447\\u0442\\u043e\\u0431\\u044b \\u043c\\u043e\\u0436\\u043d\\u043e \\u0431\\u044b\\u043b\\u043e \\u0438 \\u0443\\u0447\\u0438\\u0442\\u044c\\u0441\\u044f, \\u0438 \\u0440\\u0430\\u0431\\u043e\\u0442\\u0430\\u0442\\u044c\"}],[{\"name\":\"question\",\"value\":\"\\u041f\\u043e\\u0447\\u0435\\u043c\\u0443 \\u0443 \\u0432\\u0430\\u0441 \\u0432 \\u043f\\u043e\\u0440\\u0442\\u0444\\u043e\\u043b\\u0438\\u043e \\u0442\\u0430\\u043a\\u0438\\u0435 \\u043a\\u0440\\u0443\\u0442\\u044b\\u0435 \\u043f\\u0440\\u043e\\u0435\\u043a\\u0442\\u044b?\"},{\"name\":\"answer\",\"value\":\"\\u041f\\u043e\\u0442\\u043e\\u043c\\u0443 \\u0447\\u0442\\u043e \\u0443 \\u043d\\u0430\\u0441 \\u043a\\u0440\\u0443\\u0442\\u0430\\u044f \\u043a\\u043e\\u043c\\u0430\\u043d\\u0434\\u0430 \\u0438 \\u0442\\u044b \\u043c\\u043e\\u0436\\u0435\\u0448\\u044c \\u0441\\u0442\\u0430\\u0442\\u044c \\n\\u0435\\u0435 \\u0447\\u0430\\u0441\\u0442\\u044c\\u044e\"}]]', NULL);
INSERT INTO `tager_page_fields` VALUES (137948, 7, 'questionsItems[0]', NULL, 137947);
INSERT INTO `tager_page_fields` VALUES (137949, 7, 'question', 'Вы продаете эти курсы?', 137948);
INSERT INTO `tager_page_fields` VALUES (137950, 7, 'answer', 'Нет. Цель наших курсов: воспитать уверенных учеников, продолжать совершенствовать их скиллы и взять лучших к себе в штат', 137948);
INSERT INTO `tager_page_fields` VALUES (137951, 7, 'questionsItems[1]', NULL, 137947);
INSERT INTO `tager_page_fields` VALUES (137952, 7, 'question', 'Как долго учиться?', 137951);
INSERT INTO `tager_page_fields` VALUES (137953, 7, 'answer', 'Всю жизнь', 137951);
INSERT INTO `tager_page_fields` VALUES (137954, 7, 'questionsItems[2]', NULL, 137947);
INSERT INTO `tager_page_fields` VALUES (137955, 7, 'question', 'Какова продолжительность курса?', 137954);
INSERT INTO `tager_page_fields` VALUES (137956, 7, 'answer', 'В зависимости от курса и вашего изначального скилла. От одной недели до трех месяцев. Задача подтянуть вас до уровня специалиста, готового к работе в продакшене и продолжить обучение на боевых проектах', 137954);
INSERT INTO `tager_page_fields` VALUES (137957, 7, 'questionsItems[3]', NULL, 137947);
INSERT INTO `tager_page_fields` VALUES (137958, 7, 'question', 'Нужен ли опыт работы?', 137957);
INSERT INTO `tager_page_fields` VALUES (137959, 7, 'answer', 'Нет, нужны только базовые знания софта и портфолио, которое это подтверждает', 137957);
INSERT INTO `tager_page_fields` VALUES (137960, 7, 'questionsItems[4]', NULL, 137947);
INSERT INTO `tager_page_fields` VALUES (137961, 7, 'question', 'Что делать если я еще студент?', 137960);
INSERT INTO `tager_page_fields` VALUES (137962, 7, 'answer', 'Тут индивидуально. Нужно быть очень гибким и крутиться так, чтобы можно было и учиться, и работать', 137960);
INSERT INTO `tager_page_fields` VALUES (137963, 7, 'questionsItems[5]', NULL, 137947);
INSERT INTO `tager_page_fields` VALUES (137964, 7, 'question', 'Почему у вас в портфолио такие крутые проекты?', 137963);
INSERT INTO `tager_page_fields` VALUES (137965, 7, 'answer', 'Потому что у нас крутая команда и ты можешь стать \nее частью', 137963);
