INSERT INTO `tager_page_fields` VALUES (138185, 3, 'firstArtTitle', '2D ART', NULL);
INSERT INTO `tager_page_fields` VALUES (138186, 3, 'firstArtTitle1', 'With love to art creation', NULL);
INSERT INTO `tager_page_fields` VALUES (138187, 3, 'firstArtText1', 'We offer the development of 2D graphics of any complexity together with our fully equipped teams consisting of an art leader, 2D artists and managers. We can either create everything ourselves or expand your team of specialists with our artists. Our teams are scalable. You can add or subtract commands at any time.', NULL);
INSERT INTO `tager_page_fields` VALUES (138188, 3, 'firstArtTitle2', 'Art Production', NULL);
INSERT INTO `tager_page_fields` VALUES (138189, 3, 'firstArtText2', 'We create concept art for games, promotional assets, motion graphics, mobile, desktop and non-digital projects. And produce concept art for mobile games: iOS and Android, concept art for video games including PC, Mac, Apple TV and various consoles, as well as illustration and concept art for board games', NULL);
INSERT INTO `tager_page_fields` VALUES (138190, 3, 'firstArtTitle3', 'UI/UX Design', NULL);
INSERT INTO `tager_page_fields` VALUES (138191, 3, 'firstArtText3', 'We focus on user interfaces for projects with gaming mechanics only. Our artists work closely with game designers to create UI that enhances user experience. Starloop designed graphical user interfaces and user experiences for games of various styles: from cartoon mobile games to hardcore sci-fi multiplayer shooters', NULL);
INSERT INTO `tager_page_fields` VALUES (138192, 3, 'firstArtTitleAdditional', 'Our services:', NULL);
INSERT INTO `tager_page_fields` VALUES (138193, 3, 'firstArtTextAdditional', '<p>2D Art, Concept Art, UI/UX Design, Illustrations</p>', NULL);
