INSERT INTO `tager_page_fields` VALUES (138220, 3, 'secondArtTitle', '3D ART', NULL);
INSERT INTO `tager_page_fields` VALUES (138221, 3, 'secondArtTitle1', 'The big team', NULL);
INSERT INTO `tager_page_fields` VALUES (138222, 3, 'secondArtText1', '3D department is the largest department of the company. It employs over 80 high-quality artists and technicians producing 3D graphics of the highest possible quality.', NULL);
INSERT INTO `tager_page_fields` VALUES (138223, 3, 'secondArtTitle2', 'We are flexible', NULL);
INSERT INTO `tager_page_fields` VALUES (138224, 3, 'secondArtText2', 'We provide a full range of services. Our specialists know how and love to make graphics for a wide variety of tasks - from hyper-casual models to cinematic quality.', NULL);
INSERT INTO `tager_page_fields` VALUES (138225, 3, 'secondArtTitle3', 'We are scalable', NULL);
INSERT INTO `tager_page_fields` VALUES (138226, 3, 'secondArtText3', 'Our specialists, if necessary, go beyond the classical scaling of content. We will be happy to participate in pre-production and develop the visual style of the future world hit together with our partners.', NULL);
INSERT INTO `tager_page_fields` VALUES (138227, 3, 'secondArtTitleAdditional', 'Our services:', NULL);
INSERT INTO `tager_page_fields` VALUES (138228, 3, 'secondArtTextAdditional', '<p>Creation of 3D models of the highest level (characters, armors and weapons), Realistic facial anatomy sculpt, Hairstyles of any complexity (cards) and simulation hair, CleanUp 3D scan human heads and wardrobes, Retopology of assets, Creating clothes, Realistic PBR texture, Good experience in exporting and configuring assets in the game engine.</p>', NULL);
