INSERT INTO `tager_page_fields` VALUES (140731, 6, 'title', 'Начало...', 140730);
INSERT INTO `tager_page_fields` VALUES (140732, 6, 'description', 'Будет сложно, будет казаться что ты слаб и абсолютно бездарен, но с огромным желанием стать лучшим. Личная жизнь? Забудь...', 140730);
INSERT INTO `tager_page_fields` VALUES (140733, 6, 'image', '1596', 140730);
INSERT INTO `tager_page_fields` VALUES (140734, 6, 'stepsItems[1]', NULL, 140729);
INSERT INTO `tager_page_fields` VALUES (140735, 6, 'title', 'Понимание...', 140734);
INSERT INTO `tager_page_fields` VALUES (140736, 6, 'description', 'С каждой задачей сложного и непонятного будет становиться все меньше. Страх задавать тупые вопросы постепенно пропадет и что-то даже начнет получаться.', 140734);
