INSERT INTO `tager_page_fields` VALUES (140738, 6, 'stepsItems[2]', NULL, 140729);
INSERT INTO `tager_page_fields` VALUES (140739, 6, 'title', 'Перерождение!', 140738);
INSERT INTO `tager_page_fields` VALUES (140740, 6, 'description', 'Постепенно придет осознание того как можно реально на практике применять все что тебе объясняли и с этого момента ты готов брать реальные задачи и гордо называться джуном!', 140738);
