INSERT INTO `tager_pages` VALUES (5, NULL, '/back-run-3D-privacy-policy', 'Back Run 3D – Privacy Policy', 'Back Run 3D – Privacy Policy', '<p>Last updated: 1 September 2021</p><p>This Privacy Policy explains how your personal data is collected and processed by “FuryLion Group LLC” when you use the Back Run 3D mobile application (the “App”).</p><p>The App is a free to play game (with optional in-game-purchases), and in order to maintain the high quality and a great game experience we process information from and about you in particular to improve the entire experience in the App and to support internal operations.</p><p>We update this Privacy Policy from time to time. If we make changes, we will notify you by revising the date at the top of the policy and, depending on the specific changes, we will provide you with additional notice or require a renewed consent. We encourage you to review the Privacy Policy whenever you access the App to stay informed about how we process your personal data and how you can protect your privacy.</p><h2>Collection of information</h2><h3>Information you provide to us</h3><p>This Privacy Policy only concerns the App. If you submit any information to FuryLion Group LLC through our website or other sites or services, please review the FuryLion Group LLC Privacy Policy or such other privacy policy as applicable for information about how we collect, use and disclose such information.</p><h3>Information we collect automatically through the app</h3><p>When you access or use the App, we automatically collect general information about you, including:</p><ul><li>Log Information: We log information about your use of the App, including the type of device you use, the features you use, access times and your IP address.</li><li>Device Information: We collect information about the device you use to access the App, including information about the device’s software and hardware, unique device identifiers (i.e. Device ID and advertising ID), device tokens for push- messages, mobile network information and time zone.</li><li>Usage Information: We collect information relating to your use of the App, including your game progress, scores, achievements and interactions with other players.</li><li>Consumption information: We collect information about your consumption habits relating to your use of the App, including which purchases you make with both virtual and real currencies and the reception of virtual goods in-game.</li></ul><h3>Information we collect from other sources</h3><p>If you log into the App using a third party site or platform such as Facebook, Apple Game Center and Google Sign-In, we access information about you from that site or platform, such as your screen name, profile information and friend lists, in accordance with the authorization procedures determined by such third party site or platform provided that you have given the third party site in question such consent.</p><p>If you log into the App using a third party site or platform, you represent and warrant that (i) your access and use of such features in connection with the App will comply with the applicable terms and policies of such site or platform; and (ii) that you are over the minimum age limit that is prescribed for such third party site or platform by the legislation in the individual jurisdictions.</p><h2>Use of information – purpose and legal basis</h2><p>We use information about you for the following purposes in accordance with the legal bases for each type of personal data as described below:</p><p>Log-, device-, usage-, and consumption information</p><ul><li>are being processed:<ul><li>to provide and deliver the products and services you request and send you related information as requested by you / as agreed with you;</li><li>to provide and maintain the App and the game experience; and</li></ul></li></ul><p>to send you technical notices, updates, security alerts, and support and administrative messages;</p><p><i>Our processing for the above purposes is necessary for the performance of a contract to which you are party in order to support the operation of the App, facilitate the delivery of requested products and services and enable maintenance and update of the App, see Article 6(1)(b) of the GDPR.</i></p><ul><li>to provide news and information about the App that we think will be of interest to you;</li><li>to personalize and improve the App and provide tailored content and features;</li><li>to monitor and analyze trends, usage and activities in connection with the App; and</li></ul><p>to provide children (as this term is construed under GDPR in EU, COPPA in the US and relevant applicable legislation in other jurisdictions) with reasonable contextual advertisements in the App.</p><p><i>Our processing for the above purposes is justified by our legitimate interests in providing advertisements and content of interest to you and improving our services in accordance with Article 6(1)(f) of the GDPR (also known as \"the balancing-of-interest rule\").</i></p><p>to provide non-child users that have given us consent to share their advertising IDs with our ad network partners (as further specified under Sharing of Information) for the purpose of serving them with personalized advertisement in the App (behavioral advertising).</p><p><i>Our processing for the above purpose is justified by our legitimate interests in providing advertisements and content of interest to you in accordance with Article 6(1)(f) of the GDPR. The disclosure of your advertising ID to third parties for the purposes of behavioral advertising is based on your consent in accordance with Article 6(1)(a) of the GDPR (see more below under Sharing of Information).</i></p><p>Information from other sources</p><ul><li>are being processed:</li></ul><p>to provide and deliver the products and services you request and send you related information;</p><p><i>Our processing for the above purpose is necessary for the performance of a contract to which you are party in order to facilitate the delivery of requested products and services, see Section 6(1)(b) of the GDPR.</i></p><ul><li>to link or combine information we get from others to help understand your needs and provide you with better service; and</li></ul><p>to provide news and information about the App we think will be of interest to you;</p><p><i>Our processing for the above purposes is justified by our legitimate interests in providing content of interest to you and improving our services in accordance with Article 6(1)(f) of the GDPR.</i></p><p>We only process your information to the extent that is necessary to achieve the purposes for which the information has been collected.</p><h2>Storage of information</h2><p>FuryLion Group LLC will store your personal data for as long as necessary in order to provide you with the App or otherwise fulfil the purposes as described above, unless further storage is required in order to establish, exercise or defend a legal claim or to comply with applicable law, including accounting rules.</p><p>Your personal data are deleted or anonymized as soon as it no longer serves one of the above mentioned purposes and in any event no later than three (3) years after your interaction with FuryLion Group LLC has ceased.</p><h2>Sharing of information</h2><p>We disclose information about you to the following categories of recipients based on the legal bases in Sections 6(1)(b), 6(1)(c) and 6(1)(f) of the GDPR (see a description of the legal bases above):</p><ul><li>Social networks, see more under \"Social Sharing features\";</li><li>Third parties if we are required to disclose your personal data by applicable law, rule, regulation, legal process or in connection with, or during negotiations of, any merger, sale of company assets, financing or acquisition of all or a portion of our business by another company;</li><li>The authorities if we believe your actions are inconsistent with the spirit or language of our policies or if the disclosure is necessary to protect the rights, property and safety of Kiloo or others;</li><li>Other players in order to provide certain in-app features, such as leaderboards, if you log into the App using a third-party service, such as Facebook or Apple Game Center;</li><li>Advertising network companies in order to serve contextual advertisements (the data include your IP-address, Device ID and advertising ID).</li></ul><p>Furthermore, if you have given your consent in accordance with Section 6(1)(a) of the GDPR, we share your advertising ID to advertising network companies for the purpose of them serving behavioral advertisements to you within the App. We use or may use the following advertising network companies:</p><ul><li>MoPub, Inc.&nbsp;<a href=\"https://www.mopub.com/legal/privacy/\" target=\"_blank\">https://www.mopub.com/legal/privacy/</a></li><li>MoPub, Inc. Partners&nbsp;<a href=\"https://www.mopub.com/legal/partners/\" target=\"_blank\">https://www.mopub.com/legal/partners/</a></li></ul><p>The recipients\' use of the disclosed information will not be covered by this Privacy Policy. If you have questions concerning the processing carried out by such third parties, you should review their privacy policy.</p><p>In connection with our processing, we use data processors such as server hosting providers, technical service providers for supporting internal operations, user login services and analytics service providers.</p><ul><li>GameAnalytics ApS&nbsp;<a href=\"https://gameanalytics.com/privacy\" target=\"_blank\">https://gameanalytics.com/privacy</a></li><li>Tenjin, Inc.&nbsp;<a href=\"https://www.tenjin.io/privacy\" target=\"_blank\">https://www.tenjin.io/privacy</a></li><li>Facebook Analytics (Facebook, Inc.)&nbsp;<a href=\"https://www.facebook.com/about/privacy/\" target=\"_blank\">https://www.facebook.com/about/privacy/</a></li><li>Firebase (Google LLC)&nbsp;<a href=\"https://firebase.google.com/support/privacy\" target=\"_blank\">https://firebase.google.com/support/privacy</a></li></ul><h2>Social sharing features</h2><p>The App offers social sharing features and other integrated tools (such as the Facebook “Like” button), which let you share actions you take in the App with other media. You must be over the minimum age limit that is prescribed by the legislation in the individual jurisdictions to use any social sharing features integrated in the App. The use of such features enables the sharing of information with your friends or the public, depending on the settings you establish with the entity that provides the social sharing feature.</p><p>The App has social features from the following providers:</p><ul><li>Facebook</li><li>Game Center</li></ul><p>For more information about the processing carried out by the respective third parties in connection with social sharing features, please visit the privacy policies of the entities that provide these features, which can be found here:</p><ul><li>Facebook:&nbsp;<a href=\"https://www.facebook.com/about/privacy/\" target=\"_blank\">https://www.facebook.com/about/privacy/</a></li><li>Game Center:&nbsp;<a href=\"https://www.apple.com/legal/internet-services/itunes/gamecenter/\" target=\"_blank\">https://www.apple.com/legal/internet-services/itunes/gamecenter/</a></li></ul><h2>Children</h2><p>You must be at least 16 years old to use the App. If you are accepting these Terms and using the App, you warrant that you state the correct age and you are 16 or more years old.</p><p>If you have additional questions about FuryLion Group LLC\'s privacy practices related to children under the applicable minimum age, please contact us at apps@furylion.net.</p><h2>Transfer to third countries</h2><p>In connection with the processing, we will in certain circumstances transfer your personal data to recipients in the U.S which has been declared an unsafe third country by the European Commission.</p><p>We only transfer personal data to entities in third countries that have provided appropriate safeguards to ensure that their level of data protection is in agreement with this privacy policy and applicable law.</p><p>Consequently, the transfers will only occur based on the following safeguards:</p><ul><li>If the entity is certified to comply with the principles for data protection under the US-EU Privacy Shield Framework (\"Privacy Shield\") (you can view the entities certified under Privacy Shield at&nbsp;<a href=\"https://www.privacyshield.gov/\" target=\"_blank\">https://www.privacyshield.gov/</a>), or</li><li>If we have entered into standard data protection clauses adopted by the Commission with the entity, which is deemed to offer sufficient safeguards with respect to the protection of the privacy and fundamental rights and freedoms of individuals (you can obtain a copy of the clauses by contacting FuryLion Group LLC).</li></ul><h2>Security</h2><p>FuryLion Group LLC takes reasonable measures to help protect information about you from loss, theft, misuse and unauthorized access, disclosure, alteration and destruction.</p><h2>Your rights</h2><p>If you wish to use any of the rights described below, you may contact us at any time by emailing us at apps@furylion.net.</p><p>We process and answer your requests without undue delay and in any event within one month of our receipt of the request unless a longer period is required due to the complexity of the request. In this case, our response time can be up to three months in total as permitted by Article 12 of the GDPR.</p><h3>Right to request access</h3><p>You have the right to request access into the data that we are processing on you, see Article 15 of the GDPR, including information about:</p><ul><li>the purposes of the processing</li><li>the categories of personal data concerned</li><li>the recipients or categories of recipient to whom the personal data have been or will be disclosed</li><li>the envisaged period for which the personal data will be stored</li></ul><p>Furthermore, you have the right to obtain a copy of the personal data undergoing processing. Please note that the access may be restricted due to intellectual property or trade secrets.</p><h3>The right to object</h3><p>You have the right to object to our processing of your personal data on grounds relating to your particular situation when the data are processed based on the balancing-of- interest rule in Section 6(1)(f) of the GDPR, see Article 21 of the GDPR. In this case, we will cease the processing unless there are compelling legitimate grounds for the processing which override your interests, rights and freedoms or if the processing is necessary for the establishment, exercise or defense of legal claims.</p><p>You have the right to object to our processing of your personal data for direct marketing purposes at any time. We will cease the processing of your personal data for this purpose after the objection. Please note that if you exercise this right, your user license to use the App will cease automatically.</p><h3>Right to rectification and erasure</h3><p>You have the right to have inaccurate personal data rectified, see Article 16 of the GDPR.</p><p>Furthermore, you have the right to have your personal data erased where one of the following grounds applies, see Article 17 of the GDPR:</p><ul><li>the personal data are no longer necessary in relation to the purposes for which they were collected or otherwise processed,</li><li>if you have withdrawn your consent and there are no other legal grounds for the processing,</li><li>if you have objected to the processing and there are no overriding legitimate grounds for the processing,</li><li>the personal data have to be erased for compliance with a legal obligation in Union or Member State law,</li><li>the personal data have been unlawfully processed or</li><li>the personal data have been collected in relation to the offer of information society services.</li></ul><p>Please note that your right to erasure may be limited if the data are necessary for compliance with a legal obligation or for the establishment, exercise or defense of legal claims.</p><h3>The right to restriction</h3><p>You have the right to obtain restriction of processing in certain circumstances, see Article 18 of the GDPR. If you have the right to restriction, we will only process your data with your consent or for the establishment, exercise or defense of a legal claim or to protect a person or important grounds of public interest.</p><h3>The right to withdraw consent</h3><p>If we have asked for your consent to our processing of your data, you have the right to withdraw your consent at any time, see Article 7 of the GDPR.</p><p>If you withdraw your consent, we will cease processing of the data for which you have withdrawn consent, unless we have a legal obligation to keep some or parts of your data.</p><p>Please note that if you withdraw your consent, your user license to use the App will cease automatically.</p><p>The withdrawal of your consent does not affect the lawfulness of processing based on your consent before its withdrawal.</p><h3>Data Deletion Request</h3><p>You may request FuryLion Group LLC to erase without undue delay your personal data when it is no longer necessary for FuryLion Group LLC to retain such data.</p><p>In order for your data to be erased you can contact FuryLion Group LLC by&nbsp;<strong>apps@furylion.net</strong>&nbsp;with request.</p><h3>The right to data portability</h3><p>You have the right to receive the personal data you have provided us with which we process in a structured, commonly used and machine-readable format and have the right to transmit those data to another controller if the processing is based on consent or contract performance, see Article 20 of the GDPR.</p><h3>Push notifications</h3><p>We send push notifications or alerts to your mobile device to provide game-related information, service updates, promotional communications and other related messages, if you have agreed to such notifications. You can deactivate these notifications by changing your notification settings on your device.</p><h2>Contact and complaints</h2><p>FuryLion Group LLC has the following contact information:</p><p>E-mail: apps@furylion.net</p><p>If you wish to make a complaint over the processing of your personal data, you have the right to lodge a complaint to the relevant supervisory authority.</p>', NULL, '2021-08-25 00:00:00', NULL, NULL, NULL, NULL, '2021-08-25 14:44:44', '2021-10-07 09:15:52', NULL, 9, 10, NULL);
