INSERT INTO `vacancies` VALUES (12, 11, 'Java Script Developer', 'javascript', 'FuryLion расширяет отдел программирования в Новополоцке JS разработчиками для работы над казуальными играми и Playable Ads.', 'FuryLion расширяет отдел программирования в Новополоцке JS разработчиками для работы над казуальными играми и Playable Ads.', 'FuryLion - это более 150 профессионалов своего дела, работающих в 3-ех офисах.\n\nУдаленно не рассматриваются!\n\nПроекты предполагаются как на аутсорс, так и внутренние разработки студии.', 'Возможность поработать над самыми успешными, всемирно известными мобильными и консольными продуктами.', NULL, 'Full Time', 'Junior, Middle, Senior', 'JS, React, Pixi.js, Three.js, Vue.js, React, HTML5', '<ul><li>Знание и опыт работы с Javascript ES6 и выше;</li><li>Знание html5;</li><li>Умение писать читабельный код без ошибок, следуя общим стандартам программирования и особенностям проекта;</li><li>Умение и нормальное отношение задачам в которых нужно разбираться в чужом коде;</li><li>Знание распространенных алгоритмов;</li><li>Знание паттернов проектирования;</li><li>Владение системами контроля версий (git).</li></ul>', '<ul><li>Опыт работы с Node.JS, webpack, babel;</li><li>Опыт разработки игр на Pixi.js, Three.js или других игровых движках;</li><li>Знание Front-End фреймворков (Vue.js, React);</li><li>Высшее образование по ИТ специальности;</li><li>Знание основ гейм-дизайна;</li><li>Умение работать с Photoshop (не рисовать);</li><li>Умение работать с Spine (не анимировать);</li><li>Уверенный Английский язык.</li></ul>', '<ul><li>Работу в уютном офисе в центре Новополоцка</li><li>Вкусные комплексные обеды за счет компании</li></ul><p style=\"margin-left:20px;\">&nbsp;</p><ul><li>Адекватное руководство и опытных коллег</li><li>Своевременную и достойную оплату труда на карту Приорбанка в $</li></ul><p style=\"margin-left:20px;\">&nbsp;</p><ul><li>При желании и необходимости курсы английского прямо в офисе с преподавателем</li><li>Возможность бесконечного карьерного роста в компании</li></ul>', 'HTML5, JS', 3, 1064, NULL, NULL, NULL, NULL);
INSERT INTO `vacancies` VALUES (13, 12, 'Unity Developer', 'unity-minsk-hc', 'FuryLion расширяет отдел программирования в Минске Unity разработчиками для работы над гипер-казуальными играми.', 'FuryLion расширяет отдел программирования в Минске Unity разработчиками для работы над гипер-казуальными играми', 'FuryLion - это более 150 профессионалов своего дела, работающих в 3-ех офисах.\n\nУдаленно не рассматриваются!', 'Работа в динамичном и быстро развивающемся отделе Hyper Casual. Мы разработали такие успешные гиперказуальные игры, как Restaurant Life и Airport Life 3D с более чем 20 миллионами игроков.', NULL, 'Full Time', 'Middle, Senior', 'Unity, C#', '<ul><li>Опыт разработки игр на Unity3D</li><li>Отличное знание C#</li><li>Умение писать читабельный код без ошибок, следуя общим стандартам программирования и особенностям проекта</li><li>Умение и нормальное отношение задачам в которых нужно разбираться в чужом коде</li><li>Знание распространенных алгоритмов</li><li>Знание паттернов проектирования</li><li>Хорошее знание математической базы</li><li>Владение системами контроля версий (git)</li><li>Уверенный английский язык</li></ul>', '<ul><li>Знание Unreal Engine</li><li>Знание веб фреймворков для написания PlayableAds</li><li>Высшее образование по ИТ специальности</li><li>Знание основ гейм-дизайна</li><li>Умение работать с Photoshop (не рисовать)</li><li>Опыт работы с протоколами сериализации, такими как “proto-buf”</li><li>Опыт внедрения кастомных модулей, расширения редактора</li></ul>', '<ul><li>Укомплектованное рабочее место в офисе в БЦ \"Имперский\"</li><li>Возможность быстрого роста</li></ul><p>&nbsp;</p><ul><li>Топовый компьютер с 2 мониторами</li><li>Удобный график работы</li></ul><p>&nbsp;</p><ul><li>Дружный коллектив и демократичную атмосферу</li><li>Тимбилдинги и другие радостные события корпоративной жизни</li></ul>', 'Unity, C#', 1, 1086, NULL, NULL, NULL, NULL);
INSERT INTO `vacancies` VALUES (14, 13, 'Junior 3D Artist', 'junior-3d-artist', 'FuryLion в поисках начинающего 3D художника в арт отдел Питерского офиса. В задачи будет входить создание 3D моделей для ААА игр.', 'FuryLion в поисках начинающего 3D художника в арт отдел Питерского офиса. В задачи будет входить создание 3D моделей для ААА игр.', 'FuryLion - это более 150 профессионалов своего дела, работающих в 3-ех офисах.\n\nУдаленное сотрудничество не рассматривается!\n\n\nПроекты предполагаются как на аутсорс, так и внутренние разработки студии.', 'Набираем желающих пройти очное\\дистанционное, бесплатное обучение с дальнейшим трудоустройством по программе FuryLion School. На данный момент проводим обучение по направлениям:\n\n1) Анатомия лица. Клинап 3D скана головы (ZBrush, Substance Painter, Maya, Photoshop) 8 дней.\n\n2) Фентези оружие и доспехи. (3ds Max+Zbrush+xNormal) 10 дней.\n\nВ случае успешного прохождения курса возьмем Вас в команду!\n\n\nБез портфолио (ссылкой на artstation, behance) и резюме не рассматриваем!', NULL, 'Full time', 'Junior', '3D Art', '<ul><li>Знание софта ZBrush, Maya\\3Ds Max (в зависимости от курса), Substance Painter, Photoshop;</li><li>Наличие в портфолио GameReady моделей или анатомии в ZBrush для курса \"Анатомия лица\"</li><li>Аккуратность, внимательность и усидчивость в работе;</li><li>Четкое следование фидбеку;</li><li>Гибкость при переходе на новый софт\\задачи;</li><li>Быстрая обучаемость;</li><li>Умение работать в команде, коммуникабельность;</li><li>Огромное желание развиваться.</li></ul>', '<ul><li>Насмотренность и чувство вкуса;</li><li>Любовь к видео играм;</li><li>Отсутствие вредных привычек несовместимых с работой в офисе;</li><li>Художественное образование.</li></ul>', '<ul><li>Работу над западными ААА проектами, в великолепном офисе на Васильевском острове;</li><li>Укомплектованное рабочее место, мощной рабочей станцией;</li></ul><p>&nbsp;</p><ul><li>Возможность профессионального и карьерного роста;</li><li>Чай, кофе, печеньки)</li></ul>', 'Junior 3D Artist', 4, 1103, NULL, NULL, NULL, NULL);
INSERT INTO `vacancies` VALUES (15, 14, '3D Artist', '3d-artist', 'FuryLion в поисках талантливого 3D художника в арт отдел Питерского офиса. В задачи будет входить создание 3D моделей для ААА игр.', 'FuryLion в поисках талантливого 3D художника в арт отдел Питерского офиса. В задачи будет входить создание 3D моделей для ААА игр.', 'FuryLion - это более 150 профессионалов своего дела, работающих в 3-ех офисах\n\nУдаленное сотрудничество не рассматривается!\n\n\nПроекты предполагаются как на аутсорс, так и внутренние разработки студии.', 'Без портфолио и резюме не рассматриваем!\n\nУдаленное сотрудничество не рассматриваем!\n\nБез опыта работы от 1 года на ААА проектах не рассматриваем!', NULL, 'Full time', 'Middle', '3D Art', '<ul><li>Опыт работы над ААА проектами от 1 года;<strong>&nbsp;</strong></li><li>Знание софта (3dsMax, Maya, ZBrush, Photoshop, Substance Painter, Marvelous Designer);</li><li>Наличие портфолио;</li><li>Аккуратность, внимательность и усидчивость в работе;</li><li>Гибкость при переходе на новый софт\\задачи;</li><li>Быстрая обучаемость;</li><li>Умение работать в команде, коммуникабельность;</li><li>Огромное желание развиваться.</li></ul>', '<ul><li>Насмотренность и чувство вкуса;</li><li>Любовь к видео играм;</li><li>Отсутствие вредных привычек несовместимых с работой в офисе;</li><li>Художественное образование.</li></ul>', '<ul><li>Работу над западными ААА проектами, в великолепном офисе на Васильевском острове;</li><li>Укомплектованное рабочее место, мощной рабочей станцией;</li></ul><p>&nbsp;</p><ul><li>Возможность профессионального и карьерного роста;</li><li>Чай, кофе, печеньки)</li></ul>', 'Middle 3D Artist', 4, 1102, NULL, NULL, NULL, NULL);
INSERT INTO `vacancies` VALUES (16, 15, 'Senior 3D Artist', 'senior-3d-artist', 'FuryLion в поисках опытного и талантливого 3D художника в арт отдел Питерского офиса. В задачи будет входить создание 3D моделей для ААА игр.', 'FuryLion в поисках опытного и талантливого 3D художника в арт отдел Питерского офиса. В задачи будет входить создание 3D моделей для ААА игр.', 'FuryLion - это более 150 профессионалов своего дела, работающих в 3-ех офисах\n\nУдаленное сотрудничество не рассматривается!\n\n\nПроекты предполагаются как на аутсорс, так и внутренние разработки студии.', 'Без портфолио и резюме не рассматриваем!\n\nУдаленное сотрудничество не рассматриваем!\n\nБез опыта работы от 3 лет на ААА проектах не рассматриваем!', NULL, 'Full time', 'Senior', '3D Art', '<ul><li>Опыт управления коллективом на ААА проектах;</li><li>Наличие портфолио;</li><li>Лидерские качества;</li><li>Аккуратность, внимательность и усидчивость в работе;</li><li>Умение самостоятельно разбираться с новыми задачами и документацией;</li><li>Ведение деловой переписки с заказчиком;</li><li>Знание английского;</li><li>Контроль качества работы Artist\'ов и Junior Artist\'ов.</li></ul>', '<ul><li>Насмотренность и чувство вкуса;</li><li>Любовь к видео играм;</li><li>Отсутствие вредных привычек несовместимых с работой в офисе;</li><li>Художественное образование.</li></ul>', '<ul><li>Работу над западными ААА проектами, в великолепном офисе на Васильевском острове;</li><li>Укомплектованное рабочее место, мощной рабочей станцией;</li></ul><p>&nbsp;</p><ul><li>Возможность профессионального и карьерного роста;</li><li>Чай, кофе, печеньки)</li></ul>', 'Senior 3D Artist', 4, 1104, NULL, NULL, NULL, NULL);
INSERT INTO `vacancies` VALUES (17, 16, '2D \\ 3D - Animator', '2d-3d-animator', 'FuryLion в поисках талантливого 2D \\ 3D  аниматора в арт отдел Питерского офиса. В задачи будет входить создание 2D \\ 3D анимаций для видео игр.', 'FuryLion в поисках талантливого 2D \\ 3D  аниматора в арт отдел Питерского офиса. В задачи будет входить создание 2D \\ 3D анимаций для видео игр.', 'FuryLion - это более 150 профессионалов своего дела, работающих в 3-ех офисах\n\nУдаленное сотрудничество не рассматривается!\n\n\nПроекты предполагаются как на аутсорс, так и внутренние разработки студии.', 'Без портфолио и резюме не рассматриваем!\n\nУдаленное сотрудничество не рассматриваем!', NULL, 'Full time', 'Junior, Middle, Senior', '2D \\ 3D Art', '<ul><li>Наличие портфолио;</li><li>Создание высококачественных анимаций персонажей, окружения и UI;</li><li>Подготовка анимаций для интеграции и интеграция в движок;</li><li>Риггинг моделей;</li><li>Клинап анимаций;</li><li>Нарезка изображений и материала для анимаций;</li><li>Знание принципов анимации;</li><li>Владение инструментами создания анимаций (Maya);</li><li>Владение инструментом создания 2D анимаций Spine, Flash будет плюсом.</li></ul>', '<ul><li>Невероятное желание стать профессионалом, лучшим в своем деле;</li><li>Адекватность и жизнерадостность, открытость к новым людям и знаниям;</li><li>Отсутствие причин, не совместимых с работой в офисе;</li><li>Знание анатомии или опыт работы с персонажной анимацией;</li><li>Знание английского языка;</li><li>Готовность осваивать новые программы и инструменты;</li><li>Знание принципов графического дизайна и психологии зрительного восприятия;</li><li>Будет плюсом умение рисовать и дорисовывать графический материал;</li><li>Будет плюсом умение делать эффекты.</li></ul>', '<ul><li>Работу над западными ААА проектами, в великолепном офисе на Васильевском острове;</li><li>Укомплектованное рабочее место, мощной рабочей станцией;</li></ul><p>&nbsp;</p><ul><li>Возможность профессионального и карьерного роста;</li><li>Чай, кофе, печеньки)</li></ul>', '2D \\ 3D - Animator', 4, 1105, NULL, NULL, NULL, '2021-10-21 10:30:45');
INSERT INTO `vacancies` VALUES (18, 17, 'Project Manager', 'project-manager-minsk', 'FuryLion в поиске талантливого менеджера игровых проектов в Минский офис студии на полный рабочий день', 'FuryLion в поиске талантливого менеджера игровых проектов в Минский офис студии на полный рабочий день', 'FuryLion - это более 150 профессионалов своего дела, работающих в 3-ех офисах\n\nУдаленно не рассматриваются!\n\nПроекты предполагаются как на аутсорс, так и внутренние разработки студии', 'Очень важен опыт именно в геймдеве. Знание специфики работы в игровых студиях и понимание распределения ролей кто за что отвечает.', NULL, 'Full Time', 'Middle, Senior', 'GitLab, Time Tracking, Agile', '<ul><li style=\"margin-left:20px;\">Постоянное тесное взаимодействие с командой</li><li style=\"margin-left:20px;\">Контроль состояния бэклога, задач, поддержание его в актуальном состоянии</li><li style=\"margin-left:20px;\">Менеджмент рисков проекта, менеджмент ожиданий заказчика, контроль того, что проект выполняется в срок, нужный бюджет и в ожидаемый скоуп и в нужном качестве</li><li style=\"margin-left:20px;\">Помощь в коммуникации между командой, продукт менеджерами и заказчиком</li><li style=\"margin-left:20px;\">Помощь команде в принятии решений</li><li style=\"margin-left:20px;\">Проведение Scrum-событий: планирование, ретроспектива, грумминг, демо</li><li style=\"margin-left:20px;\">Общение с клиентом на ежедневной основе, ведение переговоров</li><li style=\"margin-left:20px;\">Сбор и подготовка требований для задач для всех членов команды, ведение работы в трекере задач</li><li style=\"margin-left:20px;\">Готовность работать в нескольких проектах одновременно, работа с приоритетами внутри проекта, так и группы</li></ul>', '<ul><li style=\"margin-left:20px;\">Уровень английского языка upper-intermediate</li><li style=\"margin-left:20px;\">Опыт на схожей позиции от 2-х лет</li><li style=\"margin-left:20px;\">Опыт в менеджменте рисков</li><li style=\"margin-left:20px;\">Опыт работы в Scrum команде</li><li style=\"margin-left:20px;\">Опыт составления отчетности о ходе проекта</li><li style=\"margin-left:20px;\">Наличие технического образования или знаний в области, способность чтения технической документации</li><li style=\"margin-left:20px;\">Опыт ведения проекта на разных стадиях жизненного цикла</li><li style=\"margin-left:20px;\">Ведение бизнес документации проекта</li><li style=\"margin-left:20px;\">Знание и практический опыт принципов гибких методологий разработки</li></ul>', '<ul><li>Работу над разными проектами</li><li>Укомплектованное рабочее место в офисе в БЦ \"Имперский\"</li><li>Возможность быстрого роста</li></ul><p>&nbsp;</p><ul><li>Компьютер с 2 мониторами</li><li>Удобный график работы</li></ul><p>&nbsp;</p><ul><li>Дружный коллектив и демократичную атмосферу</li><li>Тимбилдинги и другие радостные события корпоративной жизни</li></ul>', 'Management', 1, 1108, NULL, NULL, NULL, NULL);
INSERT INTO `vacancies` VALUES (19, 18, 'VFX Artist', 'vfx-artist', 'FuryLion в поисках талантливого VFX-ера в арт отдел Минского офиса. В задачи будет входить разработка эффектов и внедрение их в игру.', 'FuryLion в поисках талантливого VFX-ера в арт отдел Минского офиса. В задачи будет входить разработка эффектов и внедрение их в игру.', 'FuryLion - это более 150 профессионалов своего дела, работающих в 3-ех офисах\n\nУдаленно не рассматриваются!', 'Проекты предполагаются как на аутсорс, так и внутренние разработки студии. Проекты разные: от казуала до аниме, от гиперказуала до ААА', NULL, 'Full Time', 'Middle, Senior', 'Unity, Unreal', '<ul><li>Разработка визуальных эффектов для высококачественных мобильных проектов</li><li>Настройка эффектов и интеграция в движок Unity</li><li>Оптимизация эффектов</li><li>Настройка материалов</li><li>Хорошее понимание красивого :)</li></ul>', '<ul><li>Знание Unreal Engine или других движков</li><li>Понимание английского языка</li><li>Готовность осваивать новые программы и инструменты</li><li>Знание принципов графического дизайна и психологии зрительного восприятия</li><li>Будет плюсом умение рисовать и дорисовывать графический материал</li><li>Будет плюсом умение делать простейшую анимацию</li><li>Знание основ программирования</li></ul>', '<ul><li>Работу над разными проектами</li><li>Укомплектованное рабочее место в офисе в БЦ \"Имперский\"</li><li>Возможность быстрого роста</li></ul><p>&nbsp;</p><ul><li>Компьютер с 2 мониторами</li><li>Удобный график работы</li></ul><p>&nbsp;</p><ul><li>Дружный коллектив и демократичную атмосферу</li><li>Тимбилдинги и другие радостные события корпоративной жизни</li></ul>', 'VFX', 1, 1109, NULL, NULL, NULL, NULL);
INSERT INTO `vacancies` VALUES (20, 19, '2D Art Lead', '2d-art-lead', 'Вакансия для амбициозного и талантливого художника, который давно уже ищет что-то большее чем просто работа над 2D', 'Вакансия для амбициозного и талантливого художника, который давно уже ищет что-то большее чем просто работа над 2D', 'FuryLion - это более 150 профессионалов своего дела, работающих в 3-ех офисах\n\nУдаленно не рассматриваются!\n\nПроекты предполагаются как на аутсорс, так и внутренние разработки студии\n\nОбязательно прикрепляйте ссылку на портфолио (арт стейшн или беханс в сообщении или в описании)', 'Вакансия предполагает работу над различными проектами, большая часть из которых казуальные. Как правило, это большие франшизы и всемирно извозные бренды, такие как Disney, Marvel и т.д.\n\nВ обязанности входит работа с командой 2D художников, которых может быть до 10-15 человек в команде. Нужно помогать, фидбечить, участвовать планировании и оценке проектов.\n\nМы предлагает возможность бесконечного роста, как по карьерно лестнице, так и в выборе проектов. Специфика аутсорса позволяет подобрать интересный и подходящий вам по скиллу и интересам проект.', NULL, 'Full Time', 'Senior', '2D Art, Management', '<ul><li>Художественный вкус, чувство цвета, знание композиции</li><li>Умение и желание работать в разных стилях (флэт, казуальный) и подстраиваться под стиль проекта</li><li>Умение создавать персонажей, фоны, элементы интерфейса</li><li>Любовь к играм и понимание зачем пришли в геймдев</li><li>Умение рисовать от руки и на графическом планшете</li><li>Наличие в портфолио игрового арта (скетчи, концепты, локации, интерфейс и т.д)</li><li>Аккуратность, внимательность и усидчивость в работе</li><li>Гибкость при переходе на новый софт\\задачи</li><li>Быстрая обучаемость</li><li>Умение работать в команде, коммуникабельность</li><li>Огромное желание развиваться</li><li>Готовность к переработкам в случае кранчей</li></ul>', '<ul><li>Насмотренность и опыт геймера</li><li>Любовь к казуальным играм</li><li>Интерес к комиксам</li><li>Отсутсвие вредных привычек несовместимых с работой в офисе</li></ul>', '<ul><li>Работу над разными проектами</li><li>Укомплектованное рабочее место в офисе в БЦ \"Имперский\"</li><li>Возможность быстрого роста</li></ul><p>&nbsp;</p><ul><li>Компьютер с 2 мониторами и новым графическим планшетом</li><li>Удобный график работы</li></ul><p>&nbsp;</p><ul><li>Дружный коллектив и демократичную атмосферу</li><li>Тимбилдинги и другие радостные события корпоративной жизни</li></ul>', '2D Art, Management', 1, 1110, NULL, NULL, NULL, NULL);
INSERT INTO `vacancies` VALUES (21, 20, 'UI/UX Artist', 'ui-artist', 'Вакансия для опытных художников и дизайнеров интерфейсов на полный рабочий день в Минском офисе компании', 'Вакансия для опытных художников и дизайнеров интерфейсов на полный рабочий день в Минском офисе компании', 'FuryLion - это более 150 профессионалов своего дела, работающих в 3-ех офисах\n\nУдаленно не рассматриваются!\n\nПроекты предполагаются как на аутсорс, так и внутренние разработки студии', 'Ищем опытного художника, работающего в первую очередь с интерфейсами. Необходимо будет рисовать окна, кнопки, иконки, индикаторы и так далее. \n\nОчень важен навык рисования. Практически весь интерфейс рисуется с нуля, все иконки так же отрисовываются.\n\nВажны знания в UX, понимание правил построения удобных интерфейсов и большая наигранность в мобильные игры.', NULL, 'Full Time', 'Middle, Senior', 'Illustrator, Photoshop', '<ul><li>Проектирование и разработка игровых интерфейсов для мобильных игр</li><li>Отрисовка иконок и других элементов интерфейса</li><li>Владение графическим редактором Photoshop/Illustrator</li><li>Опыт создания интерфейсов</li><li>Наличие портфолио (игровые интерфейсы и их элементы, для мобильных или социальных игр)</li><li>Хорошее понимание юзабилити</li></ul>', '<ul><li>Насмотренность и опыт геймера</li><li>Любовь к казуальным играм</li><li>Интерес к комиксам</li><li>Отсутсвие вредных привычек несовместимых с работой в офисе</li><li>Английский язык</li></ul>', '<ul><li>Работу над разными проектами</li><li>Укомплектованное рабочее место в офисе в БЦ \"Имперский\"</li><li>Возможность быстрого роста</li></ul><p>&nbsp;</p><ul><li>Компьютер с 2 мониторами и новым графическим планшетом</li><li>Удобный график работы</li></ul><p>&nbsp;</p><ul><li>Дружный коллектив и демократичную атмосферу</li><li>Тимбилдинги и другие радостные события корпоративной жизни</li></ul>', 'UI, UX', 1, 1111, NULL, NULL, NULL, NULL);
INSERT INTO `vacancies` VALUES (22, 21, 'Game Designer (HC)', 'hypercasual-game-designer', 'Усиливаем команду крепким гейм дизайнером для работы над гиперказуальными играми', 'Усиливаем команду крепким гейм дизайнером для работы над гиперказуальными играми.', 'FuryLion - это более 150 профессионалов своего дела, работающих в 3-ех офисах\n\nУдаленно специалисты не рассматриваются!', 'FuryLion успешно выпустили несколько гиперказуальных игр с суммарной аудиторией в 20 миллионов игроков и планирует успешно осваивать этот безумно конкурентный но интересный рынок. С нашими издателями SayGames и Good Job Games мы уже выпустили 3 игры и готовим еще много чего интересного. \n\nОпыт, технологии и команда собранная на аутсорс проектах позволяет нам пробовать и реализовывать идеи любой сложности, независимо от сложности и времязатрат. \n\nВ обязанности будет входить работа над играми вместе с продюсером или работа со своей собственной командой над играми.', NULL, 'Full Time', 'Middle, Senior', 'Unity', '<ul><li>Опыт работы в качестве геймдизайнера от 1-го года</li><li>Богатое воображение</li><li>Умение правильно излагать свои мысли как устно, так и письменно</li><li>Аналитический склад ума</li><li>Внимательность к деталям</li><li>Умение составлять документацию</li><li>Любовь к играм и богатый игровой опыт</li><li>Целеустремленность и способность всегда доводить начатое до конца</li><li>Наличие представления о программировании и дизайне</li><li>Разработка концепции и дизайна игры</li><li>Разработка новых и поддержка старых проектов</li><li>Работа над сценарием</li><li>Участие в разработке игровых механик</li></ul>', '<ul><li>Знание Unity</li><li>Знание английского языка</li><li>Наличие навыков технического письма</li></ul>', '<ul><li>Интересную сложную работу над уникальными игровыми проектами мирового уровня</li><li>Обучение замечательной профессии “Гейм-дизайнер” в разных жанрах</li><li>Возможность профессионального роста и развития,</li></ul><p style=\"margin-left:20px;\">&nbsp;</p><ul><li>Комфортные условия труда, гибкий график работы</li><li>Дружный коллектив и демократичную атмосферу</li></ul><p style=\"margin-left:20px;\">&nbsp;</p><ul><li>Тимбилдинги и другие радостные события корпоративной жизни</li><li>Работа в офисе в Питере или в Минске</li></ul>', 'Game Design', 1, 1113, NULL, NULL, NULL, NULL);
INSERT INTO `vacancies` VALUES (23, 22, 'Product Owner', 'product-owner', 'Вакансия для амбициозного и талантливого менеджера, который хочет проявить себя на крупном игровом проекте по всемирной известной франшизе', 'Вакансия для амбициозного и талантливого менеджера, который хочет проявить себя на крупном игровом проекте по всемирной известной франшизе', 'FuryLion - это более 150 профессионалов своего дела, работающих в 3-ех офисах\n\nУдаленно не рассматриваются!', 'Вакансия предполагает работу над различными проектами, большая часть из которых казуальные. Как правило, это большие франшизы и всемирно извозные бренды, такие как Disney, Marvel и т.д.\n\nПрямо сейчас есть необходимость подключиться на большой match-3 проект, над которым мы работаем в коллаборация с американской студией.\n\nВакансия про бизнес составляющую продукта, про эффективность команды, про фичи которые необходимо делать и про подачу этого всего  клиенту и партнеру. Работа будет вестись бок о бок с менеджером проекта и лидами направлений.', NULL, 'Full Time', 'Middle, Senior', 'Team, Business', '<ul><li>Создание дорожных карт и направление развития проектов</li><li>Общий анализ рынка и конкурентов в отрасли</li><li>Поиск новых идей и создание MVP</li><li>Разработка и поддержка существующих игр (тестирование, аналитика)</li><li>Тесное сотрудничество с командой&nbsp;</li><li>Тесное сотрудничество с клиентом, а также другими его внешними командами на английском языке</li><li>Ответственность за введение нового функционала</li></ul>', '<ul><li>Успешные запуски мобильных приложений&nbsp;</li><li>Навыки подбора команды&nbsp;</li><li>Идеальный английский язык</li><li>Опыт работы гейм-дизайнером или программистом</li><li>Большой опыт геймера</li></ul>', '<ul><li>Работу над разными проектами</li><li>Укомплектованное рабочее место в офисе в БЦ \"Имперский\"</li><li>Возможность быстрого роста</li></ul><p>&nbsp;</p><ul><li>Компьютер с 2 мониторами</li><li>Удобный график работы с возможностью высыпаться&nbsp;</li></ul><p>&nbsp;</p><ul><li>Дружный коллектив и демократичную атмосферу</li><li>Тимбилдинги и другие радостные события корпоративной жизни</li></ul>', 'Team, Business', 1, 1298, NULL, NULL, NULL, NULL);
INSERT INTO `vacancies` VALUES (24, 23, 'Product Owner', 'product-owner-spb', 'Вакансия для амбициозного и талантливого менеджера, который хочет проявить себя на крупном игровом проекте по всемирной известной франшизеTeam, Business.', 'Вакансия для амбициозного и талантливого менеджера, который хочет проявить себя на крупном игровом проекте по всемирной известной франшизе.', 'FuryLion - это более 150 профессионалов своего дела, работающих в 3-ех офисах\n\nУдаленно не рассматриваются!', 'Вакансия предполагает работу над различными проектами, большая часть из которых казуальные. Как правило, это большие франшизы и всемирно извозные бренды, такие как Disney, Marvel и т.д.\n\nПрямо сейчас есть необходимость подключиться на большой match-3 проект, над которым мы работаем в коллаборация с американской студией.\n\nВакансия про бизнес составляющую продукта, про эффективность команды, про фичи которые необходимо делать и про подачу этого всего  клиенту и партнеру. Работа будет вестись бок о бок с менеджером проекта и лидами направлений.', NULL, 'Full Time', 'Middle, Senior', NULL, '<ul><li>Создание дорожных карт и направление развития проектов</li><li>Общий анализ рынка и конкурентов в отрасли</li><li>Поиск новых идей и создание MVP</li><li>Разработка и поддержка существующих игр (тестирование, аналитика)</li><li>Тесное сотрудничество с командой</li><li>Тесное сотрудничество с клиентом, а также другими его внешними командами на английском языке</li><li>Ответственность за введение нового функционала</li></ul>', '<ul><li>Успешные запуски мобильных приложений</li><li>Навыки подбора команды</li><li>Идеальный английский язык</li><li>Опыт работы гейм-дизайнером или программистом</li><li>Большой опыт геймера</li></ul>', '<ul><li>Работу над западными ААА проектами, в великолепном офисе на Васильевском острове;</li><li>Укомплектованное рабочее место, мощной рабочей станцией;</li></ul><p>&nbsp;</p><ul><li>Возможность профессионального и карьерного роста;</li><li>Чай, кофе, печеньки)</li></ul>', 'Team, Business', 4, 1299, NULL, NULL, NULL, NULL);
INSERT INTO `vacancies` VALUES (25, 24, 'React.JS Developer', 'react-js-developer', 'Приглашаем front-end разработчика, который любит и умеет использовать React.\nАутсорс направленность студии позволит подобрать вам интересный и соответсвующий скиллу проект.', 'Приглашаем front-end разработчика, который любит и умеет использовать React.\nАутсорс направленность студии позволит подобрать вам интересный и соответсвующий скиллу проект.', 'FuryLion - это более 150 профессионалов своего дела, работающих в 3-ех офисах.\n\nУдаленно не рассматриваются!\n\nПроекты предполагаются как на аутсорс, так и внутренние разработки студии.', 'Работа в гейм-дев студии с ее невероятной динамикой и постоянный потоком креатива.', NULL, 'Full Time', 'Middle, Senior', 'React, JS', '<ul><li style=\"margin-left:20px;\">Опыт коммерческой разработки веб-приложений от 2-х лет</li><li style=\"margin-left:20px;\">Отличные знания JavaScript (ES2015+/Typescript, React, Redux/MobX, Webpack)</li><li style=\"margin-left:20px;\">Знания HTML/CSS/Material UI</li><li style=\"margin-left:20px;\">Знание системы контроля версий Git</li><li style=\"margin-left:20px;\">Опыт работы с REST, GraphQL</li><li style=\"margin-left:20px;\">Знание шаблонов проектирования, структур данных</li><li style=\"margin-left:20px;\">Опыт работы с инструментами анализа производительности</li><li style=\"margin-left:20px;\">Работали хотя бы с одним фреймворком для юнит-тестирования (таким как Jest или другие)</li><li style=\"margin-left:20px;\">Английский от intermediate (В1 и выше)</li></ul>', '<ul><li style=\"margin-left:20px;\">Знание и опыт работы с GraphQL, React Native, CSS-in-JS, Node.js</li><li style=\"margin-left:20px;\">Успешный опыт решения проблем, критическое мышление и развитые коммуникативные навыки</li></ul>', '<ul><li>Работу в уютном офисе в центре Новополоцка</li><li>Вкусные комплексные обеды за счет компании</li></ul><p style=\"margin-left:20px;\">&nbsp;</p><ul><li>Адекватное руководство и опытных коллег</li><li>Своевременную и достойную оплату труда на карту Приорбанка в $</li></ul><p style=\"margin-left:20px;\">&nbsp;</p><ul><li>При желании и необходимости курсы английского прямо в офисе с преподавателем</li><li>Возможность бесконечного карьерного роста в компании</li></ul>', 'React, JS', 3, 1304, NULL, NULL, NULL, NULL);
INSERT INTO `vacancies` VALUES (26, 25, 'QA Engeneer', 'qa-engeneer', 'FuryLion расширяет отдел контроля качества в Новополоцке', 'Возможность поработать над самыми успешными, всемирно известными мобильными и консольными продуктами.', 'FuryLion расширяет отдел контроля качества в Новополоцке.', 'Удаленно не рассматриваются!\n\nПроекты предполагаются как на аутсорс, так и внутренние разработки студии.', NULL, 'Full Time', 'Junior, Middle, Senior', 'QA', '<ul><li style=\"margin-left:20px;\">Тестирование игр на платформах iOS, Android, реже веб-сайтов и приложений</li><li style=\"margin-left:20px;\">Разработка и обновление документации (тест-кейсы, чек-листы и так далее)</li><li style=\"margin-left:20px;\">Ведение баг-трекера и информирование заказчика и команды разработки о найденных ошибках</li><li style=\"margin-left:20px;\">Участие в работе по улучшению процессов команды и подходов тестирования</li></ul>', '<ul><li>Владение ПК на уровне продвинутого пользователя;</li><li>Опыт работы с платформами&nbsp;iOS и&nbsp;Android</li><li>Знание теории тестирования либо прохождение курсов по QA</li><li>Интерес к игровой индустрии, богатый игровой опыт в мобильные игры</li><li>Приветствуется технический бэкграунд и техническое профильное образование, знание основ программирования и понимание работы связки клиент-сервер</li><li>Ответственность и порядочный подход к работе</li></ul>', '<ul><li style=\"margin-left:20px;\">Работу в уютном офисе в центре Новополоцка</li><li style=\"margin-left:20px;\">Адекватное руководство и опытных коллег</li></ul><p style=\"margin-left:20px;\">&nbsp;</p><ul><li style=\"margin-left:20px;\">Своевременную и достойную оплату труда на карту в долларах США</li><li style=\"margin-left:20px;\">Бесплатные комплексные обеды для сотрудников в офис от ведущей службы доставки еды в городе</li></ul><p style=\"margin-left:20px;\">&nbsp;</p><ul><li style=\"margin-left:20px;\">Возможность бесконечного карьерного роста в компании, как в пределах QA отдела, так и в другие департаменты</li></ul>', 'QA, Quality', 3, 1894, NULL, NULL, NULL, NULL);
